INSERT INTO `artistas` VALUES ('$.X.Y',0,0,NULL),('$werve',5480561,383711,'$werve (Alex) is a 16-year-old multigenre producer from London, specialising in Phonk House, Brazilfunk (/Automotivo), and Krushclub. Most known for tracks such as \"TOMA TOMA TOMA\", \"krushed!\", and \"BALADINHA SINISTRA\", $werve saw rapid success in 2021 with his debut \"CITY LIGHT$\" at just 13 years of age, and is a firm frontrunner of the phonk/funk movement. <a href=\"https://www.last.fm/music/$werve\">Read more on Last.fm</a>'),('0to8',1608857,173117,'Phonk music <a href=\"https://www.last.fm/music/0to8\">Read more on Last.fm</a>'),('2 minutos',2481321,70670,'Los integrantes de Dos Minutos se juntaron en 1987 y comenzaron a tocar en el \'89, en plena hiperinflación: «en esas circunstancias empezamos nosotros, Alfonsín dejaba el gobierno, asumía Menem y debutábamos la noche en que la gente salìa a saquear mercados para poder comer...».\r\n\r\nYa habían grabado los temas \"Ya no sos igual\" y \"Arrebato\" en un álbum independiente junto a otras bandas.\r\n\r\n\"Valentín Alsina\" (1994) es el título del primer disco, en homenaje a su ciudad de origen. <a href=\"https://www.last.fm/music/2+Minutos\">Read more on Last.fm</a>'),('22DEADROSES',4710,1549,' <a href=\"https://www.last.fm/music/22DEADROSES\">Read more on Last.fm</a>'),('3X Music',538,137,' <a href=\"https://www.last.fm/music/3x+Music\">Read more on Last.fm</a>'),('404flipp',NULL,NULL,NULL),('8nine Muzique',2140,341,' <a href=\"https://www.last.fm/music/8nine+Muzique\">Read more on Last.fm</a>'),('A Flock Of Seagulls',12737520,1208617,'A Flock of Seagulls are a synthpop group formed in 1979 in Liverpool, England by brothers Mike Score (keyboards, vocals) and Ali Score (drums), joining with Frank Maudsley (bass) and Paul Reynolds (guitar), that gained popularity and subsequently infamy in the early days of MTV with the videos for their songs \"I Ran (So Far Away)\" (sometimes known just as \"I Ran\") and \"Space Age Love Song\" , the latter in which showcased lead singer Mike Score\'s distinct haircut. <a href=\"https://www.last.fm/music/A+Flock+of+Seagulls\">Read more on Last.fm</a>'),('A\'Studio',388090,33728,'Pop & dance group from Kazakhstan. Currently works in Russia. The participant of The Song of the Year 2006 with Alla Pugacheva. In 2004 group released remix on \"S.O.S.\" that soon occupied the top of dance charts around the globe. 1987 - established under the name \"Alma-Ata\". A bit later this name was changed to A\'Studio.\r\n\r\nOfficial site <a href=\"https://www.last.fm/music/A%27Studio\">Read more on Last.fm</a>'),('AaRON',5681730,270594,'AaRON (Artificial Animals Riding On Neverland) is a French musical duet, playing electronic pop, who sings in French and English. Their first tour of Europe was carried out in 2007 between March 14 and November 28, including dates in (Spain, Switzerland, Belgium, Austria, Luxembourg). Several (16) gigs were sold out.\r\n\r\nMembers\r\n * Simon Buret : singer, author and composer\r\n * Olivier Coursier : composer and arranger\r\n\r\nAlbums:\r\n2007 	Artificial Animals Riding On Neverland 	 <a href=\"https://www.last.fm/music/Aaron\">Read more on Last.fm</a>'),('Aaron Oliver',126,39,' <a href=\"https://www.last.fm/music/Aaron+Oliver\">Read more on Last.fm</a>'),('Aboga',1317,402,' <a href=\"https://www.last.fm/music/AbogA\">Read more on Last.fm</a>'),('Abraham Garrido',2504,680,' <a href=\"https://www.last.fm/music/Abraham+Garrido\">Read more on Last.fm</a>'),('Abraham Mateo',2513893,159577,'Abraham Mateo (born in San Fernando (Cadiz), Spain on August 25, 1998) is a Spanish teen actor and pop singer. Abraham was discovered in 2009, when he was ten, by producers of the record label EMI Music Spain, who happened across Abraham\'s videos in Youtube and his multiple performances in the television show Menuda Noche on the Canal Sur TV of Andalucia, Spain. His self-titled debut album, Abraham Mateo, was released in Spain in December 2009. The album was produced by the spanish composer and producer Jacobo Calderon <a href=\"https://www.last.fm/music/Abraham+Mateo\">Read more on Last.fm</a>'),('adore',8135285,638860,'There are several artists known as Adore:\r\n\r\n1) Adore (nyc2) is a glitchcore-ish group made up of online avatars whose real identities remain unknown. Their first releases came in mid-2023.\r\n@whodoyouadore\r\n\r\n2) Adore is electronica artist Mikael Ellingsen. He has been making music since 2007. For his latest album release Momentary Leap he is joined by associate producer and lifelong friend Aleksander Eile.\r\n\r\nContact: c (at) adoretunes.com\r\nBergen, Norway <a href=\"https://www.last.fm/music/Adore\">Read more on Last.fm</a>'),('Adrien Wilcox',NULL,NULL,NULL),('Agent Fresco',NULL,NULL,NULL),('Aggresivnes',37798,6472,' <a href=\"https://www.last.fm/music/Aggresivnes\">Read more on Last.fm</a>'),('Agnes Obel',27260650,950090,'Agnes Caroline Thaarup Obel (born 28th october 1980) is a Danish singer-songwriter. Her first album, Philharmonics, was released by PIAS Recordings on 4 October 2010 in Denmark, Norway, Germany and other European countries. Since February 2011, Philharmonics is certified gold. On September 30th 2013, she released her second album Aventine.\r\n\r\nAgnes Obel was born Agnes Caroline Thaarup Obel in 1981. Living in Copenhagen, and coming from a musician family, Agnes Obel learned piano at a very young age. <a href=\"https://www.last.fm/music/Agnes+Obel\">Read more on Last.fm</a>'),('Aiden Carter',NULL,NULL,NULL),('Aiko el grupo',989955,26598,' <a href=\"https://www.last.fm/music/Aiko+el+grupo\">Read more on Last.fm</a>'),('Aitana',13143201,221387,'Aitana Ocaña Morales, better known as simply Aitana, is a Spanish singer and songwriter. She first gained national recognition in 2017, placing as the runner-up in series nine of the Spanish reality television talent competition Operación Triunfo, behind Amaia Romero. While competing in Operación Triunfo, Aitana released the single \"Lo malo\" with fellow competitor Ana Guerra. The song went on to become a number-one hit in Spain and was certified five times platinum <a href=\"https://www.last.fm/music/Aitana\">Read more on Last.fm</a>'),('Ak–Boyz',37143,3870,' <a href=\"https://www.last.fm/music/Ak%E2%80%93Boyz\">Read more on Last.fm</a>'),('Akon',58954910,3619293,'Alioune Badara Akon Thiam, born April 16, 1977 in Saint Louis, Missouri, United States, known simply as Akon, is a Senegalese-American singer-songwriter, record producer, businessman, and philanthropist.\r\n\r\nHe rose to prominence in 2004 following the release of the singles \"Locked Up\" and \"Lonely\", from his debut album \"Trouble\". His second album, \"Konvicted\", earned him a Grammy Award nomination for the single Smack That featuring Eminem. His latest album, \"Freedom\", was released in 2008. <a href=\"https://www.last.fm/music/Akon\">Read more on Last.fm</a>'),('AKRIILA',7829190,89753,'Akriila is a Chilean musician and producer known for her ethereal and electronic soundscapes. Her music blends dreamy synths with haunting vocals, creating an immersive experience that explores themes of introspection, identity, and emotional depth. Since her debut, Akriila has been recognized for her unique sound and has garnered a dedicated following in the indie music scene. Her work often reflects a deep connection to both personal experiences and broader <a href=\"https://www.last.fm/music/AKRIILA\">Read more on Last.fm</a>'),('Alain Caron',NULL,NULL,NULL),('alamodilla',NULL,NULL,NULL),('Alan Caballero',7,7,' <a href=\"https://www.last.fm/music/Alan+Caballero\">Read more on Last.fm</a>'),('Alcalá Norte',523882,14038,'Alcalá Norte is a 6-member Spanish alternative rock band founded in 2019 by 3 friends from a Madrid neighbourhood, Ciudad Lineal (Jaime Barbosa, Juan Pablo Juliá and Álvaro Rivas).\r\n\r\nAfter releasing an EP in 2020 and several singles in subsequent years, in April 2024 they released their first studio album, with a meteoric success that allowed them to enter the music charts of Promusicae\'s Top 100 vinyl charts in little more than a month, in Spotify\'s viral Top 50 <a href=\"https://www.last.fm/music/Alcal%C3%A1+Norte\">Read more on Last.fm</a>'),('Alejandro Armes',34279,4865,' <a href=\"https://www.last.fm/music/Alejandro+Armes\">Read more on Last.fm</a>'),('Alejandro Sanz',14255681,664748,'Alejandro Sanz, born Alejandro Sánchez Pizarro on December 18, 1968 in Madrid, is an Award winning, Spanish pop/ballad musician and singer-songwriter who has won a record 17 Latin Grammys, more than any other Spanish musician in history. He has sold more than 25 million albums worldwide.\r\n\r\nAlejandro Sanz is the second son of María Pizarro Medina from Alcalá de los Gazules, and Jesús Sánchez Madero from Algeciras, Spain. He began playing guitar at the age of seven and composing his first songs three years later. <a href=\"https://www.last.fm/music/Alejandro+Sanz\">Read more on Last.fm</a>'),('Alessandro Alessandroni',NULL,NULL,NULL),('Alex Cherney',25439,6934,'Alex Cherney is a sunshine indie artist based in New York.  He writes, records and produces from his self-built tiny house.  Cherney\'s music fuses a classic sound (The Beatles, Joni Mitchell, Bob Marley) with world percussion and a modern mix. <a href=\"https://www.last.fm/music/Alex+Cherney\">Read more on Last.fm</a>'),('Alex Finkin',2578,710,' <a href=\"https://www.last.fm/music/Alex+Finkin\">Read more on Last.fm</a>'),('Alex G',235236674,1960230,'Alex Giannascoli, better known by his stage name Alex G (formerly (Sandy) Alex G), is a multi-instrumentalist based in  Philadelphia, Pa. He attended Haverford High School where he served as a member of The Skin Cells (2006-2015) along with Sam and Colin Acchione.\r\n\r\nUnder his own name of Alex G, he started his career with DIY self-releases on Bandcamp and began building up an audience with his label debut, DSU (2014), released on Orchid Tapes to critical acclaim from various publications. <a href=\"https://www.last.fm/music/Alex+G\">Read more on Last.fm</a>'),('Alex Guillén',930,95,' <a href=\"https://www.last.fm/music/Alex+Guill%C3%A9n\">Read more on Last.fm</a>'),('Alex Warren',22967724,832643,'Alexander Warren Hughes (born September 18, 2000) is an American stomp clap hey singer, songwriter, YouTuber, and influencer. He was a founding member of the collaborative TikTok group the Hype House from 2019 to 2022. He began independently releasing music in 2021 before getting signed to Atlantic Records the following year. His 2024 single \"Burning Down\" from his debut studio album, You\'ll Be Alright, Kid (Chapter 1) (2024), was his first song to appear on the Billboard Hot 100 chart. <a href=\"https://www.last.fm/music/Alex+Warren\">Read more on Last.fm</a>'),('Alex, Jorge Y Lena',78578,10179,'Alex, Jorge Y Lena are three accomplished individual artists that can pool their talents to create a passionate and energetic shade of Latin Pop. The engaging voice of Alex Ubago; the daring creativity of Jorge Villamizar; and the melodic perfection of Lena; three personalities, three different talents from three different parts of the world compliment one another in a way that artists rarely do.\r\n <a href=\"https://www.last.fm/music/Alex,+Jorge+Y+Lena\">Read more on Last.fm</a>'),('Alexander IV',83332,29286,' <a href=\"https://www.last.fm/music/Alexander+IV\">Read more on Last.fm</a>'),('Alexis y Fido',3019505,267958,' Known for their skillful wordplay and their comedic double entendres, reggaeton duo Alexis y Fido, affectionately known as \"Los Pitbulls,\" may be old dogs in the genre, but they have plenty of new tricks that will make audiences sit down and beg for more.\r\n\r\nAfter wooing reggaeton fans with the smash single El Tiburon, featured on Luny Tunes\' Mas Flow 2, the hardworking duo is now set to unleash its debut album The Pitbulls, which is promising to make the world bark to a new tune. <a href=\"https://www.last.fm/music/Alexis+y+Fido\">Read more on Last.fm</a>'),('ALEXSUCKS',954435,129499,'Los Angeles\' ALEXSUCKS are the unpredictable wildcards, quickly making a name for themselves in the LA rock scene. The bands lineup consists of vocalist Alex Alvarez, guitarist John Luther, drummer Ethan Demoulin, and bassist Garrett Orseno, who also produces and DJs under the moniker DJ Topgun. \r\n\r\nFrontman Alex Alvarez, who has been skating since he was three, is known for his unapologetic style inspired by the garage dance-punk revival featuring catchy singalong lyrics. <a href=\"https://www.last.fm/music/ALEXSUCKS\">Read more on Last.fm</a>'),('All That Jazz',NULL,NULL,NULL),('All Time Low',141081845,2492749,'All Time Low is an American pop punk band formed in Baltimore, Maryland, United States in 2003. When Alex Gaskarth (lead vocals, rhythm guitar, keyboards) was in middle school, he was moved from private school to public school, where he met Jack Barakat (lead guitar, backing vocals), and put the band together; later recruiting Rian Dawson (drums, percussion), and Zack Merrick (bass guitar, backing vocals). The band\'s name came from a line in the New Found Glory song Head On Collision. <a href=\"https://www.last.fm/music/All+Time+Low\">Read more on Last.fm</a>'),('Allan Holdsworth',NULL,NULL,NULL),('Alleh',2253822,129186,' <a href=\"https://www.last.fm/music/Alleh\">Read more on Last.fm</a>'),('Aloe Blacc',14410801,1214964,'Egbert Nathaniel Dawkins III (born 1979 in Orange County, California), better known by the stage name Aloe Blacc, is an American soul singer, rapper and musician. He began his recording career as an MC back in 1995 when he joined up with hip-hop producer Exile to form the mainstay indie rap group Emanon. Aloe released his debut solo album Shine Through on Stonethrow Records in 2006 and followed this up in 2010 with Good Things. He has also collaborated with the Cradle Orchestra under the name Bee <a href=\"https://www.last.fm/music/Aloe+Blacc\">Read more on Last.fm</a>'),('Alok',24117575,1182170,'Alok Achkar Peres Petrillo (born August 26, 1991) is a Brazilian musician, DJ and record producer. He is known for his single \"Hear Me Now\". In 2021, Alok was ranked the 4th best DJ in the world by DJ Mag, being the highest position occupied by a Brazilian.\n\nAlok has become one of the most prominent icons in the Brazilian electronic scene, with honors and awards, such as \"Best DJ in Brazil\" by House Mag in 2014 and 2015, and being the only Brazilian in the top 25 in the world the following year by DJ Mag magazine. <a href=\"https://www.last.fm/music/Alok\">Read more on Last.fm</a>'),('Alvaro Diaz',22956313,241097,'Jorge Álvaro Díaz Conocido como Álvaro Díaz y nacido en la isla de San Juan, Puerto Rico; es un joven publicista y rapero de 29 años de edad.\r\n\r\nComenzando desde chico su gusto por el Hip-Hop (el Rap en específico) Álvaro comienza su introducción a este género improvisando en pistas y grabando desde tiempo atrás. Casi 10 años tuvieron que pasar para que el joven rapero viera plasmado su trabajo en la calle, menos de 3 años activo con el proyecto y la música de Álvaro Díaz ya ha logrado posicionarse dentro del mercado latino <a href=\"https://www.last.fm/music/Alvaro+Diaz\">Read more on Last.fm</a>'),('Amaia Montero',1322389,78567,'Amaia Montero Saldías (born August 26, 1976 in Irun, Gipuzkoa) is a Spanish singer and song writer.\r\n\r\nShe was the vocalist of the group La Oreja de Van Gogh, which obtained great hits and has earned fame at the Iberoamerican level.\r\n\r\nShe started studying Chemistry in the UPV/EHU where she met the rest of the members of the band, but when the band became famous she started studying Psychology at the UNED. Just like the rest of the group, she later stopped studying. <a href=\"https://www.last.fm/music/Amaia+Montero\">Read more on Last.fm</a>'),('Amanda Martinez',NULL,NULL,NULL),('Amapiano Trending Vibes',297,127,' <a href=\"https://www.last.fm/music/Amapiano+Trending+Vibes\">Read more on Last.fm</a>'),('Amaury Gutiérrez',54917,7325,'De nacionalidad cubana, Amaury Gutiérrez ve la primer luz el 9 de Septiembre de 1963, en Santa Clara, Cuba. Cuando se encontraba cursando la secundaria decidió dedicarse a la música y su oportunidad llegó al responder a una convocatoria de la Escuela de Instructores de Arte, institución donde obtuvo una beca.\r\n\r\nEn sus composiciones, Amaury Gutiérrez pone énfasis especial en el aspecto vocal, no sólo por su pasado académico, sino por el particular sentimiento que le imprime a sus interpretaciones. <a href=\"https://www.last.fm/music/+noredirect/Amaury+Guti%C3%A9rrez\">Read more on Last.fm</a>'),('Amor Acústico',3830,688,' <a href=\"https://www.last.fm/music/Amor+Ac%C3%BAstico\">Read more on Last.fm</a>'),('Ana Mena',3985009,121534,'Ana Mena Rojas (born February 25, 1997) is a Spanish singer and actress. She began her career in 2011 in the TV series Marisol, la película (2011). Her musical career began in 2016, when she released her debut single \"No Soy Como Tú Crees\". Mena has collaborated with many well known artists since, including Becky G, CNCO and Lali. In 2018, she released her debut studio album, Index. <a href=\"https://www.last.fm/music/Ana+Mena\">Read more on Last.fm</a>'),('Andre Butano',14081,3487,'Born in Santiago, Chile, Andre Butano originally came from the world of gastronomy. Resident and collaborator at La Feria, the only international club in the country and also owns his own label, \'Cachai Music\'.\n\nThe beginnings of his professional life were in the world of gastronomy. His studies of international cuisine led him to work in the most famous restaurants of Santiago. It is during this stage, that in the absence of some DJs to play ambient music at the restaurant, that he dares to enter the world of records and mixes. <a href=\"https://www.last.fm/music/Andre+Butano\">Read more on Last.fm</a>'),('Andre Crom',141914,38597,'Andre Crom from Germany, had an amazing start into 2013: a #1 Beatport Deephouse Charts hit (Teenage Mutants & Hanging On).  Besides that, both his label and himself entered the „mostcharted labels/artists of 2012 list of Resident Advisor with # 8 for OFF Recordings and # 40 for Andre Crom.  The future does not look bad either: solo shows and label showcases all over the world are confirmed for the first half of 2013, including key events such as Sonar, A.D.E. and several ibiza gigs. <a href=\"https://www.last.fm/music/Andre+Crom\">Read more on Last.fm</a>'),('Andrea Imparato Quintet',38,3,' <a href=\"https://www.last.fm/music/Andrea+Imparato+Quintet\">Read more on Last.fm</a>'),('Andrea Motis',NULL,NULL,NULL),('Andreew',8404,2213,' <a href=\"https://www.last.fm/music/AndReew\">Read more on Last.fm</a>'),('Andres Luetto',521,320,' <a href=\"https://www.last.fm/music/Andres+Luetto\">Read more on Last.fm</a>'),('Andrew Huang',NULL,NULL,NULL),('Andrew Pryce',NULL,NULL,NULL),('Andru Pozzatron',916,319,'Influenced and inspired by the hip hop and dance music of the nineties and harboring a slight obsession with robots, Andru Pozzatron is quickly rising to the top of the pool of emerging, cutting-edge dance music DJs and producers. “I think that my attraction to house music is partially due to its ability to bring you out of any funk and my tracks are simply a reflection of this,” Andru says. “I make music to make people dance.”\n \nAnd dance they do. <a href=\"https://www.last.fm/music/Andru+Pozzatron\">Read more on Last.fm</a>'),('Angel Y Khriz',2226896,272443,'Angel y Khriz are Ángel Rivera Guzmán and Christian Colón,They are a Puerto Rican reggaeton duo. They work largely with Luny Tunes.\r\n\r\nThey were introduced in 2002 in the CD MVP, by Hector \"El Father\" with the song \"Cazando Voy\".\r\n\r\nLos MVP’s is Angel y Khriz’s own CD where they present the listener to soulful hits like Ven Baílalo and Te Quiero Ver Hoy, as well as De Casería (featuring Divino) and the up beat Ram Pa Pan Pan.\r\n\r\nIn the year 2005 <a href=\"https://www.last.fm/music/Angel+y+Khriz\">Read more on Last.fm</a>'),('Angelina Mango',3799384,118829,'Angelina Mango (born 10 April 2001) is an Italian singer and songwriter. She first rose to prominence as the runner-up of the 22nd edition of the talent show Amici di Maria de Filippi. She released her debut EP, Monolocale, in 2020. Her second EP,  Voglia di vivere, came out in 2023 and included the three singles Voglia di vivere,  Mani vuote, and  Ci pensiamo domani. She won the Sanremo Music Festival 2024 with her song La noia, and represented Italy in the Eurovision Song Contest 2024. <a href=\"https://www.last.fm/music/Angelina+Mango\">Read more on Last.fm</a>'),('Angus & Julia Stone',45832574,1636050,'Angus & Julia Stone are an Australian acoustic folk-pop duo consisting of siblings Julia Stone and Angus Stone from Sydney, New South Wales, Australia. Their decision to collaborate was taken at the beginning of 2006. Prior to that, both had performed as solo artists at open mic nights but utilised the other as a backing partner.  Ultimately they came up with the same idea, “Why don’t we play together? It kind of made a lot of sense”. In terms of composing the material <a href=\"https://www.last.fm/music/Angus+&+Julia+Stone\">Read more on Last.fm</a>'),('Anika Nilles',NULL,NULL,NULL),('Anitta',145204713,1149050,'Larissa de Macedo Machado, known professionally as Anitta, is a Brazilian singer, songwriter, dancer, businesswoman, and TV presenter. She rose to national fame with the release of her single \"Show das Poderosas\" in 2013.\r\n\r\nAfter achieving commercial success with her debut single \"Meiga e Abusada\" in 2012, she signed a recording contract with Warner Music Brazil in January 2013. In July of the same year, she released her self-titled debut album which produced four successful singles and was certified platinum in Brazil. <a href=\"https://www.last.fm/music/Anitta\">Read more on Last.fm</a>'),('Anna Carina',66241,7502,'Anna Carinna Copello Hora (born August 14,), is a peruvian Latin Pop singer, songwriter, actress,  professionally known only as Anna Carina.\r\n\r\n*Discography\r\n \r\n1.Algo Personal\r\n2.Espiral  <a href=\"https://www.last.fm/music/Anna+Carina\">Read more on Last.fm</a>'),('Anna Gréta',NULL,NULL,NULL),('Anthony Lazaro',NULL,NULL,NULL),('Anthony Smith',NULL,NULL,NULL),('Antílopez',212019,10249,'Antílopez es un dúo de artistas onubenses con un nuevo concepto de canción de autor. Son compositores e intérpretes de sus creaciones y espectáculos, cuya escena es representativa por un toque de post-humorismo. Algunos medios lo han denominado como \"un gen Globetrotter en su música\". Un aire desenfadado dentro de lo virtuoso, cercano y sencillo dentro de lo poético, al que aplican con comicidad una extensión de lo que son abajo del escenario: divagaciones <a href=\"https://www.last.fm/music/+noredirect/Ant%C3%ADlopez\">Read more on Last.fm</a>'),('Antonio José',519876,41416,'There are more than one artist with the name Antonio José:\r\n1) Antonio José - Spanish singer.\r\n2) Antonio José - Spanish composer and folklorist.\r\n\r\n1. Antonio José Sánchez Mazuecos is a Spanish singer who represented Spain at Junior Eurovision Song Contest 2005, at the age of 11, with the song Te Traigo Flores and placed 2nd.\r\n\r\nThe song then became the title of his debut album \"Te Traigo Flores\", which merged flamenco with Latin rhythms.\r\n\r\nIn the summer of 2007 <a href=\"https://www.last.fm/music/+noredirect/Antonio+Jos%C3%A9\">Read more on Last.fm</a>'),('Antonio Machín',217567,33477,'Antonio Machín (born Antonio Abad Lugo-Machín on February 11, 1903 in Sagua la Grande, Cuba - died August 4, 1977 in Madrid, Spain) was a Cuban singer of boleros and ballads. He is best known for singing El Manisero, Dos Gardenias, and Angelitos Negros. His version of El Manisero, recorded in 1930, was the first million record seller for a Cuban artist. <a href=\"https://www.last.fm/music/+noredirect/Antonio+Mach%C3%ADn\">Read more on Last.fm</a>'),('Antonio Orozco',1425738,117984,'Antonio Orozco is a Spanish singer-songwriter from Barcelona, Spain.\r\nHe has won several prizes like the Premio Onda and sold lots of records, his first album sold more than 100,000 copies, whereas his second album titled Semilla del Silencio sold over 300,000 copies.\r\nIn 2005 he released a self titled album Antonio Orozco, which was a compilation of his best songs (twelve in total) that eventually propelled him into stardom outside Spain, mainly in Latin America and other parts of the world. <a href=\"https://www.last.fm/music/Antonio+Orozco\">Read more on Last.fm</a>'),('Antonio Vivaldi',40854490,1929333,'Antonio Lucio Vivaldi (4 March 1678 – 28 July 1741) was an Italian composer, virtuoso violinist, impresario of Baroque music, and Roman Catholic priest. He is regarded as one of the leading Baroque composers, with a significant influence across Europe during his lifetime. Vivaldi contributed to developments in orchestration, violin technique, and programmatic music. He played a key role in consolidating the concerto form, particularly the solo concerto, into a widely recognised musical idiom. <a href=\"https://www.last.fm/music/Antonio+Vivaldi\">Read more on Last.fm</a>'),('Antoñito Molina',70287,6014,' <a href=\"https://www.last.fm/music/Anto%C3%B1ito+Molina\">Read more on Last.fm</a>'),('Anuel AA',29724260,582216,'Emmanuel Gazmey Santiago, known professionally as Anuel AA, is a Puerto Rican rapper and singer, a pioneer of the Latin trap movement. Gazmey\'s music addresses topics such as street life, violence, sex, and drugs. He is seen as a controversial figure in the Latin music scene for his legal troubles and feuds with fellow Puerto Rican rappers Cosculluela and Ivy Queen and with American rapper 6ix9ine.  His music often contains samples and interpolations of songs that were popular during his youth. <a href=\"https://www.last.fm/music/Anuel+AA\">Read more on Last.fm</a>'),('Apocalyptica',69510376,1620651,'Apocalyptica is a band from Helsinki, Finland consisting of three classically-trained cellists and a drummer. Their speciality is heavy metal music on cellos, though they also play classical music.\r\n\r\nThey started in 1993 by playing covers of Metallica, but once the concept became popular they wrote their own original works, maintaining the thrash metal influences on their albums Inquisition Symphony (mainly covers as well) and Cult. Since Reflections they have added drums to their recordings and live performances. <a href=\"https://www.last.fm/music/Apocalyptica\">Read more on Last.fm</a>'),('Aponte Elegant',179,60,' <a href=\"https://www.last.fm/music/Aponte+elegant\">Read more on Last.fm</a>'),('Arcade Fire',222581489,3064291,'Arcade Fire is a Canadian indie rock band formed in Montreal, Quebec, Canada in 2001. The band consists of Win Butler (vocals, guitar, piano), Régine Chassagne (vocals, accordion, keyboards, hurdy gurdy, drums), Richard Reed Parry (bass, guitar), Tim Kingsbury (bass), and Jeremy Gara (drums). Montreal percussionist Dane Mills performed on the EP and in early live shows.  Will Butler (keyboards, guitar) left the band in 2022 to focus on his solo career. The touring band includes horn players and violinists. <a href=\"https://www.last.fm/music/Arcade+Fire\">Read more on Last.fm</a>'),('Arcángel',12622503,405072,'Austin Santos, conocido como Arcangel, nació en Nueva York el 23 de diciembre de 1985. Honrando su ascendencia puertorriqueño-dominicana, se trasladó a Puerto Rico en 1999 para dedicarse al reggaetón.\r\n\r\nEn 2007, Arcangel comenzó su carrera solo trabajando en un sencillo con DJ Nelson, considerado el padrino del reggaetón. La canción, “Chica Virtual”, apareció en el álbum de recopilación de Nelson “Flow La Discoteka 2” y se hizo popular en las radios urbanas. <a href=\"https://www.last.fm/music/+noredirect/Arc%C3%A1ngel\">Read more on Last.fm</a>'),('Arde Bogotá',1534090,27468,'Arde Bogotá is a Spanish alternative rock band from Cartagena, Murcia, formed in 2017. The group\'s name originates from the Colombian city of Bogotá, where their first recordings were initially heard. The band is composed of Antonio García, Dani Sánchez, Pepe Esteban, and José Ángel Mercader.\r\n\r\nTheir music is characterized by a strong sound, with often incisive lyrics that carry a sense of strength and emotion. The band\'s influences include groups such as Arctic Monkeys, Foo Fighters, and Héroes del Silencio. <a href=\"https://www.last.fm/music/Arde+Bogot%C3%A1\">Read more on Last.fm</a>'),('ARGENTI & ROSA',18,4,' <a href=\"https://www.last.fm/music/Argenti+&+Rosa\">Read more on Last.fm</a>'),('Ari Joshua',NULL,NULL,NULL),('Ariana Grande',1029317380,4279870,'Ariana Grande-Butera, better known professionally as simply Ariana Grande, is an American singer, songwriter and actress. She is a multi-platinum, Grammy Award-winning recording artist. Born in Boca Raton, Florida, Grande began her career in 2008 in the Broadway musical \"13\". She rose to prominence for her role as Cat Valentine in the Nickelodeon television series, Victorious (2010–2013) and in its spin-off, Sam & Cat (2013–2014). As she grew interested in pursuing a music career <a href=\"https://www.last.fm/music/Ariana+Grande\">Read more on Last.fm</a>'),('Ariis',4413613,347855,' <a href=\"https://www.last.fm/music/ariis\">Read more on Last.fm</a>'),('Arnold Jarvis',98301,24152,'Throughout his career, Arnold Jarvis has been nothing but consistent - consistent when it comes to getting noticed. His is a brilliant career that began at the prime of his youth. While only a teenager, his voice and talent landed him front and center of the Baltimore Gospel Choir for whom he was a prodigious soloist.\n\nIn 1984, modest academic pursuits led him to New York City. However, his talent and love of music did not lie dormant for long. He was drawn to music industry circles and was quickly embraced by them. <a href=\"https://www.last.fm/music/Arnold+Jarvis\">Read more on Last.fm</a>'),('Arturo Garces',5305,1781,' <a href=\"https://www.last.fm/music/Arturo+Garces\">Read more on Last.fm</a>'),('Astora',151397,25142,'Astora hails from the small state of Maryland, and is composed of four 20-something boys. \n\nOriginally Astora was The Duals, consisting of only Kevin Sullivan and Josh Cook, two long time friends. Josh took care of the guitar and bass, while Kevin lended the band his drum and vocal skills. \n\nDuring late summer/early fall The Duals acquired Brian Flora on bass, and thus became known as \'Vice\'. Sadly after a few gigs, both Kevin and Brian left for college <a href=\"https://www.last.fm/music/Astora\">Read more on Last.fm</a>'),('Atlantic Five Jazz Band',NULL,NULL,NULL),('Auudi',3099,461,' <a href=\"https://www.last.fm/music/Auudi\">Read more on Last.fm</a>'),('AVDI',1,1,' <a href=\"https://www.last.fm/music/Avdi\">Read more on Last.fm</a>'),('Avenged Sevenfold',218173719,2794560,'Avenged Sevenfold (often abbreviated to A7X) is a heavy metal/hard rock band which formed in 1999 in Huntington Beach, California, United States. The band consists of vocalist M. Shadows, lead guitarist Synyster Gates, rhythm guitarist Zacky Vengeance, bassist Johnny Christ, and former Bad Religion and Suicidal Tendencies drummer Brooks Wackerman (2016-present). Heartbreakingly, the band\'s best friend and original drummer James \"The Rev\" Sullivan passed away in 2009. <a href=\"https://www.last.fm/music/Avenged+Sevenfold\">Read more on Last.fm</a>'),('Avery*Sunshine',NULL,NULL,NULL),('Avromi Basch',NULL,NULL,NULL),('Axolotes Mexicanos',1402432,28696,'This Asturian trio, signed to the legendary Elefant Records, career from crazy punk to the most playful, DIY electro-pop with energy, muscle, strength and ferocity.  Olaya, Stephen and Juan evoke the wildest and most fun moments of the indie explosion that happened in the early 80s in Spain. The band’s first  release, “Infectados”, is Helen Love  and Pegamoides pogo-dancing in celebration of one of the group’s biggest passions – zombies! <a href=\"https://www.last.fm/music/Axolotes+Mexicanos\">Read more on Last.fm</a>'),('AYYBO',1486576,171761,'AYYBO (Aaron Bonnema) is a house producer and DJ from Southern California, known for his high-energy tech-house tracks and viral hits like “Hypnosis”, which even earned an official Pitbull remix. Starting as a drummer and school DJ, AYYBO turned his passion into a career, blending hip-hop, bass, and house influences. His catchphrase “GDB” (“Goddamn, baby”) became a symbol of positivity among fans. With a playful, visual approach to music and social media, he’s now touring and expanding his GDB Records label. <a href=\"https://www.last.fm/music/AYYBO\">Read more on Last.fm</a>'),('B.o.B',44834373,3066559,'Bobby Ray Simmons (born November 15, 1988 in Decatur, Georgia, USA), better known by his stage name B.o.B, is a Grammy Award-nominated American rapper, singer, producer and conspiracy theorist, signed to T.I.\'s Grand Hustle Label and Atlantic Records. In 2007 he released his debut EP, Eastside, and has since released another EP, 12th Dimension, and five mixtapes. His debut album, B.o.B Presents The Adventures of Bobby Ray, was released in April 2010 and debuted at #1 on the Billboard 200. <a href=\"https://www.last.fm/music/B.o.B\">Read more on Last.fm</a>'),('Babasonicos',9167954,171128,'Babasónicos\' name is based on a tribute to Hindu prophet Baba combined with the name of a popular cartoon from the \'70s. Singer Adrián Rodríguez, keyboardist Uma-T, guitarist Mariano Roger Sónico, bassist Gabo, percussionist Diego Uma, and drummer Diego Castellano recorded Pasto in 1992. That album included their hit song called \"De-generación.\" As the popularity of this Latin rock group was growing, chances to play along with major bands came soon. <a href=\"https://www.last.fm/music/+noredirect/Babasonicos\">Read more on Last.fm</a>'),('Baby Colby',NULL,NULL,NULL),('Baby Lores',48236,10179,' <a href=\"https://www.last.fm/music/Baby+Lores\">Read more on Last.fm</a>'),('Bad Bunny',333490458,2122954,'Benito Antonio Martínez Ocasio (born March 10, 1994), known professionally as Bad Bunny, is a Puerto Rican rapper and singer. He is recognized as a leading figure in Latin trap and has played a significant role in popularizing Spanish-language rap in global mainstream music. Bad Bunny became the first non-English-language artist to be Spotify\'s most-streamed artist of the year, achieving this distinction in three consecutive years from 2020 to 2022. His 2022 album \"Un Verano Sin Ti\" holds the record as the most-streamed album on Spotify. <a href=\"https://www.last.fm/music/Bad+Bunny\">Read more on Last.fm</a>'),('Bad Gyal',23162948,418986,'Alba Farelo Solé (born 7 March 1997), known professionally as Bad Gyal, is a Spanish singer, songwriter, DJ and model. Known for her distinctive overall use of Auto-Tune, Bad Gyal has developed a strong cult following ever since her musical career began in 2016, with her uploading an interpretation of Rihanna\'s \"Work\", sung in Catalan, to YouTube. She continued to make music as an independent artist, releasing records like \"Indapanden\", \"Jacaranda\" and the popular \"Fiebre\". <a href=\"https://www.last.fm/music/Bad+Gyal\">Read more on Last.fm</a>'),('BADBADNOTGOOD',NULL,NULL,NULL),('BadBoe',118934,12591,'Break beat music: http://www.myspace.com/djbadboe <a href=\"https://www.last.fm/music/BadboE\">Read more on Last.fm</a>'),('Bagua Records',NULL,NULL,NULL),('Baka G',17348,4591,' <a href=\"https://www.last.fm/music/Baka+G\">Read more on Last.fm</a>'),('Balu Brigada',6912966,414191,'Hailing from the North Shore of Auckland, New Zealand, Balu Brigada is an alt-pop duo led by brothers Henry and Pierre Beasley. Their eclectic sound blends groovy basslines, smooth vocals, and genre-blurring production with expressive storytelling—an approach that has earned them international attention, including a coveted opening slot on Twenty One Pilots’ 2024–25 “Clancy” World Tour.\r\n\r\nMusic has always been a cornerstone in the Beasley household. <a href=\"https://www.last.fm/music/Balu+Brigada\">Read more on Last.fm</a>'),('Banda Aca',1416,365,'Disco act produced by Alessandro Terzi, A. Saba and Claudio Mingardi*\r\nSingles: \"Jesahel\" and \"Barbarella\". <a href=\"https://www.last.fm/music/Banda+Aca\">Read more on Last.fm</a>'),('Banda Durisima',11224,3169,' <a href=\"https://www.last.fm/music/Banda+Durisima\">Read more on Last.fm</a>'),('Banda Full',573,133,' <a href=\"https://www.last.fm/music/BANDA+FULL\">Read more on Last.fm</a>'),('Banda Solida',469,87,' <a href=\"https://www.last.fm/music/Banda+Solida\">Read more on Last.fm</a>'),('Barney Gombo',86903,4019,' <a href=\"https://www.last.fm/music/Barney+Gombo\">Read more on Last.fm</a>'),('Battle Jazz Big Band',NULL,NULL,NULL),('Baya Baye MGT Los Sosis',53952,2150,' <a href=\"https://www.last.fm/music/Baya+Baye+MGT+Los+Sosis\">Read more on Last.fm</a>'),('beabadoobee',291744881,2465600,'Beatrice Kristi Ilejay Laus (born 3 June 2000), known professionally as Beabadoobee, is a Filipino-British singer-songwriter. Between 2018 and 2021, she released five extended plays (EPs) on the independent label Dirty Hit: \"Lice\" (2018), \"Patched Up\" (2018), \"Loveworm\" (2019), \"Space Cadet\" (2019), and \"Our Extended Play\" (2021). Her debut studio album, \"Fake It Flowers,\" was released in October 2020 and received critical acclaim. Her second studio album, \"Beatopia,\" was released on 15 July 2022 and included the single \"The Perfect Pair. <a href=\"https://www.last.fm/music/beabadoobee\">Read more on Last.fm</a>'),('Beach House',232867750,3384232,'Beach House is an American dream pop band that formed in 2004 in Baltimore, Maryland, United States. The group consists of Victoria Legrand  (vocals, organ), who is the niece of French composer Michel Legrand, Alex Scally, and as of 2022,  James Barone (drums, percussion, bass guitar). Since their formation, the group has released eight studio albums: Beach House (2006), Devotion (2008), Teen Dream (2010), Bloom (2012), Depression Cherry (2015), Thank Your Lucky Stars (2015), 7 (2018), and Once Twice Melody (2022). <a href=\"https://www.last.fm/music/Beach+House\">Read more on Last.fm</a>'),('bear bear & friends',407221,43685,'bear bear & friends is a LA-based electronic music producer <a href=\"https://www.last.fm/music/bear+bear+&+friends\">Read more on Last.fm</a>'),('Beéle',4184926,189238,'Brandon De Jesús López Orozco, mejor conocido como Beéle, es un cantante y autor enfocado en sonidos del caribe y el mundo urbano. Nacido en Barranquilla, Colombia, el cantante de 17 años empezó su carrera a los 13 años.\r\n\r\nEn el 2019, fue firmado por DJ Luian y Mambo Kingz: Hear This Music, con el tema “Loco” como su debut. Beéle ha colaborado con otros artistas, como Montano, Totoy, Farruko, Natti Natasha, Manuel Turizo, entre otros. <a href=\"https://www.last.fm/music/Be%C3%A9le\">Read more on Last.fm</a>'),('Belinda',10910745,475523,'Belinda Peregrín Schüll, known by artistic name Belinda (born August 15, 1989 in Madrid, Spain), is a Latin Grammy Award nominated Spanish-Mexican singer, songwriter, dancer and actress, who debuted in 2003 with the self-titled album, Belinda, under Sony BMG and RCA Records. Her international self-titled album Belinda as released in Mexico City, Mexico by BMG and RCA Records on August 5, 2003 and became a great a success in many different countries including Mexico, selling 2.5 million copies worldwide.  <a href=\"https://www.last.fm/music/Belinda\">Read more on Last.fm</a>'),('Beluga\'s Trio',NULL,NULL,NULL),('Ben L\'Oncle Soul',3056772,248912,'Benjamin Duterde (born 1984), a.k.a. Ben L\'Oncle Soul (\'Ben the Soul Uncle\'), is a French nu-soul singer from the town of Tours, France, who has released seven full-length studio albums and a live album since 2010.\n\nDuterde first gained prominence in his home country with the Soul Wash EP (2009), which featured six covers (Gnarls Barkley, The White Stripes, Spice Girls and the like).  Ben\'s first full-length album, entitled simply Ben L\'Oncle Soul was released in 2010 and was put out internationally on the Motown label. <a href=\"https://www.last.fm/music/Ben+l%27Oncle+Soul\">Read more on Last.fm</a>'),('BENJIxScarlett',506678,40932,' <a href=\"https://www.last.fm/music/BENJIxScarlett\">Read more on Last.fm</a>'),('Berk & The Virtual Band',NULL,NULL,NULL),('berlioz',NULL,NULL,NULL),('Bert Kaempfert',1492757,168842,'Bert Kaempfert (also Kämpfert) (b. 16 October 1923 - d. 21 June 1980) was a German orchestra leader and songwriter. He made easy listening and jazz-oriented records, and wrote the music for a number of well-known songs, such as \"Strangers in the Night\" (originally recorded by Ivo Robić) and \"Spanish Eyes\".\r\n\r\nHe was born in Hamburg, Germany, and studied at the School of Music there. A multi-instrumentalist, he was hired by Hans Busch to play with his orchestra before serving as a bandsman in the German Navy during World War II. <a href=\"https://www.last.fm/music/Bert+Kaempfert\">Read more on Last.fm</a>'),('Besmaya',343387,24859,'Besmaya is a Spanish indie-pop duo founded in February 2020 by friends Javier \"Javi\" Echávarri and Javier \"Javi\" Ojanguren. Both are from Santander, Spain, and have known each other since childhood. The group\'s name, \"Besmaya,\" is derived from a military base in Iraq where Ojanguren\'s mother was once stationed.\r\nThe band\'s musical style is characterized by a blend of alternative and electronic pop, incorporating instrumental and sampled sounds. Since their formation <a href=\"https://www.last.fm/music/Besmaya\">Read more on Last.fm</a>'),('Beto Cuevas',413850,41191,'Luis Alberto Cuevas Olmedo (Santiago, September 12, 1967) is the former lead singer of the now-defunct Chilean rock band, La Ley. He grew up in Montréal, Quebec, and is fluent in French, English, and Spanish. He was Born in Santiago, Chile, and now resides in Los Angeles, California.\r\n\r\nHis family moved to Montreal, Canada to escape Pinochet\'s dictatorship. During a 1988 trip to Santiago, Beto met La Ley’s drummer, Mauricio Claveria. The drummer invited Beto to join the band, which had just seen the departure of two of its founding members. <a href=\"https://www.last.fm/music/Beto+Cuevas\">Read more on Last.fm</a>'),('Betty Says',NULL,NULL,NULL),('beyond pluto',NULL,NULL,NULL),('Big One',2368411,141548,'Daniel Ismael Real (Necochea, January 22, 1993), known artistically as Big One, is an Argentine record producer and DJ. He is known for having worked with María Becerra, TINI, LIT Killah, Duki, Emilia, Rusherking, Tiago PZK and FMK. In addition, he is the co-founder of the record label Fifty One Music.\r\nDaniel Ismael Real was born on January 22, 1993 in Necochea, province of Buenos Aires. His interest in music was sparked during his adolescence when he began listening to hip hop and at the age of 17 he began producing music <a href=\"https://www.last.fm/music/Big+One\">Read more on Last.fm</a>'),('Big Yamo',638396,88293,' <a href=\"https://www.last.fm/music/Big+Yamo\">Read more on Last.fm</a>'),('Bigpoppa',28,16,' <a href=\"https://www.last.fm/music/BigPoppa\">Read more on Last.fm</a>'),('Bill Laurance',NULL,NULL,NULL),('Bill Withers',38977360,2620603,'William Harrison Withers Jr. (July 4, 1938 – March 30, 2020) was an American singer and songwriter known for a series of influential hits during a career spanning 18 years. His best-known songs include \"Ain\'t No Sunshine\" (1971), \"Grandma\'s Hands\" (1971), \"Use Me\" (1972), \"Lean on Me\" (1972), \"Lovely Day\" (1977), and \"Just the Two of Us\" (1980), the latter recorded in collaboration with Grover Washington Jr. Withers won three Grammy Awards from nine nominations. <a href=\"https://www.last.fm/music/Bill+Withers\">Read more on Last.fm</a>'),('Billie Eilish',784677826,4047011,'Billie Eilish Pirate Baird O\'Connell (born December 18, 2001), known professionally as Billie Eilish, is a Grammy and Academy Award-winning American singer and songwriter signed to Darkroom/Interscope Records.\r\n\r\nBorn and raised in Los Angeles, Eilish grew up in a household of actors and musicians and was homeschooled along with her brother Finneas O\'Connell. At the age of eight, she joined the Los Angeles Children\'s Choir, developing the soulful vocals that would later appear on her early singles. <a href=\"https://www.last.fm/music/Billie+Eilish\">Read more on Last.fm</a>'),('Billie Holiday',NULL,NULL,NULL),('Billy Ocean',8647113,951722,'Billy Ocean (born Leslie Sebastian Charles, 21 January 1950, Fyzabad, Trinidad) is a Grammy Award-winning British popular music performer who had a string of rhythm and blues-tinged international pop hits in the 1970s and 1980s. He was the main British R&B singer / songwriter of the 1980s. He waited seven years after scoring his first four UK top 20 successes, before accumulating a series of transatlantic successes, including three U.S. number ones. <a href=\"https://www.last.fm/music/Billy+Ocean\">Read more on Last.fm</a>'),('Bizarrap',43628752,880684,'Gonzalo Julián Conde, known artistically as Bizarrap, is an Argentine music producer and DJ. \r\n\r\nHe specialises in genres such as trap, electronic music and rap. He is known for his Bzrp Music Session and his Bzrp Freestyle Sessions, which he performs with different artists. <a href=\"https://www.last.fm/music/Bizarrap\">Read more on Last.fm</a>'),('Biznaga',494972,14484,'Biznaga is a Spanish punk band formed in 2012 by Álvaro García and Jorge Navarro, later joined by Jorge Ballarín and Pablo Garnelo. They\'ve released 5 LPs: Centro dramático nacional (2014), Sentido del espectáculo (2017), Gran pantalla (2020), Bremen no existe (2022) y ¡Ahora! (2024). Their lyrics are very progressive, activist and vindictive, dealing with serious issues with humor, as in the song Benzodiazepinas, or without sweetening reality, as in El Entusiasmo. <a href=\"https://www.last.fm/music/Biznaga\">Read more on Last.fm</a>'),('BLACK BERRY TIMES',NULL,NULL,NULL),('Black Drawing Chalks',1530695,31142,'Black Drawing Chalks is a Brazilian hard rock/stoner rock founded in the city of Goiânia, Brazil in 2005. Its members are Victor Rocha as guitarist/vocalist, Renato Cunha as guitarist, Dênis de Castro as bass guitarist and Douglas de Castro as drummer.\r\n\r\nThe name came from a German trademark of drawing material, which was of great influence in the life of the band members.\r\n\r\nIn 2007, they released their debut album, Big Deal, on the label Monstro Discos. <a href=\"https://www.last.fm/music/Black+Drawing+Chalks\">Read more on Last.fm</a>'),('Black Eyed Peas',144276508,5540105,'Black Eyed Peas is an American hip hop/pop group formed in Los Angeles in 1995. The group\'s current line-up consists of will.i.am, Taboo and apl.de.ap. Black Eyed Peas have so-far sold an estimated 56 million albums and singles worldwide.\r\n\r\nBlack Eyed Peas went to centenary state high school and got their start in 1988 when will.i.am (born 1975 William James Adams Jr.) and apl.de.ap (born 1974 Allan Pineda) began rapping and performing together around Los Angeles. <a href=\"https://www.last.fm/music/Black+Eyed+Peas\">Read more on Last.fm</a>'),('Black Gryph0n',NULL,NULL,NULL),('Blake Aaron',NULL,NULL,NULL),('BLANKO',143724,14695,'UK Drum & Bass producer.\r\nDancefloor styles all the way.\r\n\r\nThese tracks are mostly unreleased but a couple are available on vinyl and mp3.\r\n\r\nShout to anyone who loves this scene. Hope you enjoy my tracks.\r\n\r\nBiggup!!\r\n\r\nBlanko\r\n\r\n\r\n\r\n---------------------------------------------------\r\n\r\n\r\nBlanko is also name of one Finnish band, whose songs Alone, Bad Dream and Revolution are. They have released one EP in 2007. <a href=\"https://www.last.fm/music/Blanko\">Read more on Last.fm</a>'),('blaze',2507671,289563,'There are multiple artists called Blaze: two British heavy metal bands, an American house band, an American MC, two Japanese bands one playing hardcore and the other Heavy Metal .\r\n\r\n1. For the heavy metal band started by the former Iron Maiden singer, see Blaze Bayley. Blaze (sometimes written as B L A Z E for disambiguation) was the former name of Bayley\'s solo project until 2007.\r\n\r\n2. Blaze (New Jersey, USA), a house production team from 1984 onwards. <a href=\"https://www.last.fm/music/Blaze\">Read more on Last.fm</a>'),('Blessd',9323427,242725,'Stiven Mesa Londoño (Itagüí, January 27, 2000), known by his stage name Blessd, is a Colombian singer, songwriter and sports manager.\r\n\r\nIn October 2021, he signed with Warner Music Latina and released his first studio album called \"Hecho en Medellín\". One of his songs was inspired by Octavio Mesa. His most popular song from the album, titled \"MEDALLO\", reached number 1 in Colombia and has more than 431 million views on YouTube. In March 2022, he was nominated for three Heat Latin Music Awards <a href=\"https://www.last.fm/music/Blessd\">Read more on Last.fm</a>'),('Blnko',600304,21198,' <a href=\"https://www.last.fm/music/Blnko\">Read more on Last.fm</a>'),('Blue Rhapsody Trio',NULL,NULL,NULL),('Blur',188319328,4655782,'Blur is an English rock band formed in London in 1988, consisting of singer Damon Albarn, guitarist Graham Coxon, bassist Alex James, and drummer Dave Rowntree. Their debut album, \"Leisure\" (1991), incorporated elements of Madchester and shoegaze. Following a stylistic change influenced by British guitar pop groups such as the Kinks, the Beatles, and XTC, Blur released \"Modern Life Is Rubbish\" (1993), \"Parklife\" (1994), and \"The Great Escape\" (1995). <a href=\"https://www.last.fm/music/Blur\">Read more on Last.fm</a>'),('Bob Salmieri Bastarduna Quintet',NULL,NULL,NULL),('Bob Sinclar',16183833,1543285,'Bob Sinclar, born in 1969, real name Christophe Le Friant (French pronunciation : kʁistɔf lə fʁijɑ̃), is a French record producer, DJ, remixer and co-owner (with DJ Yellow) of the label Yellow Productions. Sinclar started DJing in 1986, when he was just 18 years old, specializing in funk and hip-hop music, with the name Chris The French Kiss. His first club hit was Gym & Tonic, a track produced by Thomas Bangalter of Daft Punk, featuring unauthorized vocals taken from a Jane Fonda fitness tape. <a href=\"https://www.last.fm/music/Bob+Sinclar\">Read more on Last.fm</a>'),('Bolden.',NULL,NULL,NULL),('Boney James',NULL,NULL,NULL),('Bongo Botrako',431407,37838,'Bongo Botrako is a ska and punk band from Madrid, Spain. They are known for their energetic live performances and socially conscious lyrics. Their music often incorporates elements of reggae, ska, punk, and Latin American rhythms. The band was formed in 2009 and has released several albums, including \"Raro\" (2013) and \"Revoltoso\" (2017). They have gained a dedicated following in Spain and have played at many major music festivals around the country. <a href=\"https://www.last.fm/music/Bongo+Botrako\">Read more on Last.fm</a>'),('Bonobo',NULL,NULL,NULL),('Bop Alloy',NULL,NULL,NULL),('Boston Bun',1144996,156022,'Boston Bun discovered electronic music on TV when he was 16 years old. He watched video clips by The Chemical Brothers, The Detroit Grand Pubahs or Basement Jaxx. It became obvious to him: he would be a director of strange videos. While learning how to be a director, he discovered music production.\n\nA few years later, producing tracks in his bedroom and looking for vinyl nuggets on YouTube were his main activity. In 2012, Boston Bun completed work on his first official remix, and started mixing at the Social Club twice a month. <a href=\"https://www.last.fm/music/Boston+Bun\">Read more on Last.fm</a>'),('Boulevard Pacific',NULL,NULL,NULL),('Boy Wonder CF',770293,113498,' <a href=\"https://www.last.fm/music/Boy+Wonder+Cf\">Read more on Last.fm</a>'),('Boza',2030078,176151,' <a href=\"https://www.last.fm/music/Boza\">Read more on Last.fm</a>'),('Brandon Flowers',16390918,617564,'Brandon Richard Flowers (born June 21, 1981 in Henderson, Nevada, United States) is the vocalist and keyboardist in the American indie rock band The Killers. His older brother Shane, got him into music like The Smiths and Morrissey, The Beatles, The Cure and Queen. Brandon has played with U2, New Order, Pet Shop Boys, Bruce Springsteen and other bands of which he is a fan. \r\n\r\nWhile listening to the radio in his car after his very first college class, Flowers heard the song \"Changes\" by David Bowie. <a href=\"https://www.last.fm/music/Brandon+Flowers\">Read more on Last.fm</a>'),('Breakbot',11099691,791661,'Breakbot aka Thibaut Berland is a French producer and DJ born in 1981. After studying at the School of Graphic Supinfocom, he made short films (with Oury Atlan and Damien Ferrié called \"Overtime.\"), advertising and videos (David Hallyday - Satellite, Peter von Poehl - The Story of the Impossible). He is also a CG artist with credits including Arthur and the Invisibles. In may 2009 he was signed by Ed Banger Records.\n\nHere\'s his bio on the Moshi Moshi Records site: <a href=\"https://www.last.fm/music/Breakbot\">Read more on Last.fm</a>'),('Brian Berdwell',NULL,NULL,NULL),('Brian Culbertson',NULL,NULL,NULL),('Brian Simpson',NULL,NULL,NULL),('Briella',36803,5184,'Briella es una artista de origen venezolano que incursiona en el género del reggaetón con un sonido fresco e innovador adquirir su popularidad en las redes sociales mostrando su capacidad de composición, en el 2021 decide dar el paso de lanzar sus canciones inéditas. Su música y sus videos musicales han llegado a las tendencias de Colombia y consecutivamente a las de Venezuela, dándole la oportunidad de ser invitada especial en los conciertos de Mora en su país natal <a href=\"https://www.last.fm/music/Briella\">Read more on Last.fm</a>'),('Briston Maroney',12903300,596946,'Briston Lee Maroney is an American singer, songwriter, and guitarist from Knoxville, Tennessee who is signed to Canvasback Music and Atlantic Records. He has released two EPs through the labels, including his most recent collection, \"Sunflower” which was partially released and the full album was released April 9, 2021.\r\n\r\nBriston Maroney largely grew up in Knoxville, Tennessee. In August 2013, at age 15, Maroney tried out for the 13th season of American Idol at one of its audition bus stops in Knoxville. <a href=\"https://www.last.fm/music/Briston+Maroney\">Read more on Last.fm</a>'),('Broken Bells',34449323,1379814,'Broken Bells is an American indie rock duo which formed in 2009 in Los Angeles. The band consists of James Mercer (vocals, guitar) and Brian \"Danger Mouse\" Burton (multiple instruments, production). Mercer is a member of the indie rock band The Shins and Burton is a member of Gnarls Barkley and Dangerdoom, as well as being a respected producer for such artists as Beck, Gorillaz, The Rapture and The Black Keys.\r\n\r\nThe debut self-titled album by Broken Bells was released on Columbia Records on March 9, 2010. <a href=\"https://www.last.fm/music/Broken+Bells\">Read more on Last.fm</a>'),('Brray',1474190,106120,'Bryan García Quinones (19 de septiembre de 1992), más conocido como Brray, es un cantante y compositor puertorriqueño del género urbano, hip hop y trap. Autor de temas como La Curiosa, Machuqueo y Flow, Brray llegó a la escena con el lanzamiento de Me siento bien en 2014. <a href=\"https://www.last.fm/music/Brray\">Read more on Last.fm</a>'),('Bruce Andrews',NULL,NULL,NULL),('Bruno Bar',5816,1902,' <a href=\"https://www.last.fm/music/Bruno+Bar\">Read more on Last.fm</a>'),('Bruno Mars',267949055,4991414,'Peter Gene Hernandez (born October 8, 1985 in Honolulu, Hawaii, USA), known professionally as Bruno Mars, is an American singer, songwriter, record producer, musician, and dancer. He is known for his stage performances, retro showmanship, and for performing in a wide range of musical styles, including pop, R&B, funk, soul, reggae, disco, and rock. Mars is accompanied by his band, the Hooligans, who play a variety of instruments, such as electric guitar, bass, piano, keyboards, drums, and horns, and also serve as backup singers and dancers. <a href=\"https://www.last.fm/music/Bruno+Mars\">Read more on Last.fm</a>'),('Bryant Myers',6332443,185042,'Bryan Robert Rohena Pérez, known professionally as Bryant Myers, is a Puerto Rican Latin trap and reggaeton singer and songwriter. Rohena was born in Loma Alta, Puerto Rico. He began sampling and making his own songs in 2013 and launched them on social media via his SoundCloud, Instagram and YouTube accounts. <a href=\"https://www.last.fm/music/Bryant+Myers\">Read more on Last.fm</a>'),('Bryce Janey',142353,25748,'Bryce Janey began his career at age thirteen in a blues trio called “The Janeys.” His mother on drums and his father BillyLee on guitar. The Janey’s played regionally and nationally from Chicago to Los Angeles. Between 1991 and 1993 they performed with over 50 national acts including. \nAfter the Janey’s achieved some regional success, Bryce began a solo career and released his first CD in 1995. He has released three additional CD’s since 1996. <a href=\"https://www.last.fm/music/Bryce+Janey\">Read more on Last.fm</a>'),('Brytiago',3587024,189141,' <a href=\"https://www.last.fm/music/Brytiago\">Read more on Last.fm</a>'),('Bulldog',290263,11154,'Bulldog is a name used by different artists\r\n\r\n(1) An Argentinean punk band consisting of Guillermo \"Willy\" Tagliarini in guitar, Hernán \"Mantu\" Mantoani in guitar and vox, Luis \"Bebe\" Gindre in drums and Ramiro \"Rata\" España in bass.\r\n\r\n(2) A Polish hardcore band from the southern city of Krakow, who have made some name as defenders of working class values and old school hardcore (in the vein of early Agnostic Front) by means of songs like \"the working minority,\" \"in the bar\" and \"Saturday night fight\". <a href=\"https://www.last.fm/music/Bulldog\">Read more on Last.fm</a>'),('Bunbury',5260706,147349,' <a href=\"https://www.last.fm/music/+noredirect/Bunbury\">Read more on Last.fm</a>'),('C Marí',838110,13937,' <a href=\"https://www.last.fm/music/C+Mar%C3%AD\">Read more on Last.fm</a>'),('C.R.O',11450685,112298,'Tomás Manuel Campos (11/09/1998), conocido artísticamente como C.R.O, es un cantante del genero urbano nacido en la provincia de Neuquén, Argentina.\r\n\r\nPertenece a la Crew de Bardero$ y junto a Homer el Mero Mero se formo un dúo que da de que hablar cuando sacan canciones juntos.\r\n\r\nSus comienzos se basan en las competencias de Rap bajo el nombre de “Crackero”, aunque no logro tanto reconocimiento como muchos cantantes, Tomas empezó a hacer música mucho antes de que la escena lograra crecer. <a href=\"https://www.last.fm/music/+noredirect/C.R.O\">Read more on Last.fm</a>'),('Cada Cual',354,34,' <a href=\"https://www.last.fm/music/Cada+Cual\">Read more on Last.fm</a>'),('Cal Harris Jr.',NULL,NULL,NULL),('Caleb Calloway',501288,37100,' <a href=\"https://www.last.fm/music/Caleb+Calloway\">Read more on Last.fm</a>'),('Calibre 50',3998614,153493,' <a href=\"https://www.last.fm/music/Calibre+50\">Read more on Last.fm</a>'),('Calle 24',4959148,178684,' <a href=\"https://www.last.fm/music/Calle+24\">Read more on Last.fm</a>'),('Calle Ciega',104805,12742,'Calle Ciega is a reggaeton boy band from Venezuela. It started early in 1998 with merengue hip hop, ending its evolution in a mix of dance reggaeton with a unique Venezuelan \"flow\". The group has five elements: Nacho, El Chino, Luifer, Kent and Emilio. All of them coming from different cities in Venezuela and from other musical proyects.\r\n\r\nTheir hit single \"Mi Cachorrita\" has been number one for more than 23 weeks in Venezuela, and for more than 35 in the top 20 of that country\'s Record Report. <a href=\"https://www.last.fm/music/Calle+Ciega\">Read more on Last.fm</a>'),('Caloncho',2520720,143845,'Óscar Alfonso Castro (born December 20, 1986 in Obregón, Sonora), better known as Caloncho, is a Mexican musician and singer.\r\n\r\nAs a child, Caloncho lived in Guadalajara where his favorite activity was playing the drums, until he later decided to experiment with melody. At the same time, he started playing the guitar that his grandfather had left for him years before, and soon learned to play songs from artists such as Bob Marley and Sublime.\r\n\r\nBased on his own confession <a href=\"https://www.last.fm/music/Caloncho\">Read more on Last.fm</a>'),('Camellos',391497,12074,' <a href=\"https://www.last.fm/music/Camellos\">Read more on Last.fm</a>'),('Cameo',4252386,655237,'Cameo is a funk group that was formed in 1974 in New York City, New York, United States. The band\'s lineup has constantly fluctuated since its formation, with the only constant being singer-songwriter Larry Blackmon, yet they continue to tour to this day. An outlandish, in-your-face stage presence, a strange sense of humor, and a hard-driving funky sound that criss-crossed a few musical boundaries earned Cameo countless initial comparisons to Parliament/Funkadelic. <a href=\"https://www.last.fm/music/Cameo\">Read more on Last.fm</a>'),('Cameron Jack',4282,1537,' <a href=\"https://www.last.fm/music/Cameron+Jack\">Read more on Last.fm</a>'),('Camila',10374095,492411,'There are 2 artists that perform under the name \"Camila\":\r\n\r\n1. A Mexican soft rock group.\r\n2. An English speaking VTuber.\r\n\r\n1. Camila is a Mexican soft rock group formed in 2005 which reached success in their home country and all over Latin America upon the release of their debut album Todo Cambió. (Not to be confused with South Korean pop group Camila, which can be found here: 카밀라)\r\n\r\nThe group includes Mario Domm (producer and composer) from Mexico City <a href=\"https://www.last.fm/music/Camila\">Read more on Last.fm</a>'),('Camilo',7071823,352465,'Camilo Echeverri was the winner of XS Factor 2007 in Colombia. Camilo was born on the 16th March 1994 in Medellin, Colombia, but when he was 4 years old he moved to Monteria. <a href=\"https://www.last.fm/music/Camilo\">Read more on Last.fm</a>'),('Candidate',107292,8494,'1. Candidate are a folk-influenced indie band from the UK, comprising brothers Joel and Alex Morris, and Ian Painter; the band previously included drummer Chris White.  They released five albums on their own record label, Snowstorm.  Their debut album, Taking On The Enemy\'s Sound, came out in April 2000 and was followed by Tiger Flies in January 2002.  Nuada, the band’s third album, was released in October 2002.  Inspired by the soundtrack to the film The Wicker Man <a href=\"https://www.last.fm/music/Candidate\">Read more on Last.fm</a>'),('Canelita',235139,21084,'Canelita (born Jonathan Vera in 1990) is a Spanish flamenco singer. He hails from the barrio of Bajadilla, in Algeciras, southeastern Spain. He was discovered by another native of Algeciras, Paco de Lucia, when he was a boy and began recording as a teenager, with early releases such as Vivo Errante (2004) and Canelita por mi calle (2005). His album, Vuelvo, released in November 2010, alternates traditional flamenco singing ballads and pop tunes, seeking to reach a mass audience. <a href=\"https://www.last.fm/music/Canelita\">Read more on Last.fm</a>'),('Cano',706146,28639,'CANO is a Franco-Ontarian folk-pop collective which was active from 1975 until 1985. While Wikipedia claims that CANO was \"progressive\", the band itself describes its style as a mix of folk, rock, and jazz (see www.canomusique.com).\r\n\r\nThe name comes from the Coopérative des artistes du Nouvel Ontario (CANO), an agricultural and artistic commune established in Sudbury, Ontario.\r\n\r\nOn stage, CANO was able to produce a level of intensity only comparable to a symphonic orchestra. <a href=\"https://www.last.fm/music/Cano\">Read more on Last.fm</a>'),('Caramelos De Cianuro',2192486,60187,'Caramelos de Cianuro is a Latin rock band from Venezuela. The band was formed in 1991, and recorded their first songs, \"Nadando a Traves De la Galaxia\" and \"Tu Mama Te Va a Pegar\", in 1992. A year later, the group signed up to CNR and released an EP called Las Paticas de la Abuela, followed by the band\'s first album, Cuentos Para Adultos, in 1994. Performing a mixture of Latin ska and pop rock, Caramelos de Cianuro returned in 1996 with Harakiri City, released by Polygram. <a href=\"https://www.last.fm/music/Caramelos+de+Cianuro\">Read more on Last.fm</a>'),('Caribou',47078060,1371425,'There is more than one artist with this name, including: \r\n1) Caribou is Canadian Dan Snaith (b. 1978); \r\n2) Caribou was a French band active in the 1970s; \r\n3) Caribou is a New Zealand band from Dunedin/Ōtepoti.  \r\n\r\n1) Caribou is Canadian Dan Snaith (born Daniel Victor Snaith on 29 March 1978), who formerly recorded under the moniker Manitoba. Known for altering his sound with each subsequent release, he incorporates electronic psychedelia, krautrock rhythms, and breakbeat drums and creates a swirling, lush, musical panorama. <a href=\"https://www.last.fm/music/Caribou\">Read more on Last.fm</a>'),('Carín León',971145,77286,'Carín León, cuyo nombre real es: Óscar Armando Díaz De León Huez, es un cantante, guitarrista y compositor mexicano, que nació el 26 de Julio de 1989, en Hermosillo, Sonora, México. Sus géneros musicales son: regional mexicana, norteña, ranchera, corridos, banda y música de la Sierra.\r\nCarín León se ha revelado como uno de los nuevos talentos de la música regional mexicana. Por ello, desde que inició sus actividades como solista en 2018 y en lo que va de 2019 <a href=\"https://www.last.fm/music/Car%C3%ADn+Le%C3%B3n\">Read more on Last.fm</a>'),('Carla Morrison',8221107,372264,'Carla Patricia Morrison Flores  (Tecate, Baja California, July 19, 1986), better known as Carla Morrison, is an independent Mexican alternative pop singer-songwriter, winner of three Latin Grammy Awards: two for her album \"Déjenme llorar\", which has been certified Platinum, and one for her song “Vez primera”, from the album \"Amor supremo\" in 2012.\r\n\r\nCarla Morrison has three studio albums: \"Dejenme Llorar\" (2012), \"Amor supremo\" (2015) and \"El renacimiento\" (2022). <a href=\"https://www.last.fm/music/Carla+Morrison\">Read more on Last.fm</a>'),('Carlos Ares',340048,18589,'Carlos Ares comes stomping though trembling. This young Galician presents his first single: Tiemblo, a pop melody that is mixed with his characteristic voice. He has just turned 20 years old. Although he is still a boy, he has put on the face of an artist. They tell me that next Friday will be the release of their debut single (how old it sounds), a song called Tiemblo. I had the opportunity to listen to it in the showcase (at night you learn everything, even English) organized for that reason in the Garufa club of A Coruña. <a href=\"https://www.last.fm/music/Carlos+Ares\">Read more on Last.fm</a>'),('Carlos Baute',2511202,277049,'Carlos Roberto Baute Jiménez (born March 8, 1974; Caracas, Venezuela), best known as Carlos Baute, is a Venezuelan singer and television host. His music is mostly in the Latin pop genre, with some ballads and Bachata.\r\n\r\nHe is the son of Alfonso Baute and Clara Jiménez and he is of Spanish (his father is from Tenerife and his maternal great-grandparents are from Galicia), Cuban (his maternal grandmother) and Venezuelan descent. At age 13, he started a band called \"Los Chamos\" and released an album entitled \"Con un poco de Amor\". <a href=\"https://www.last.fm/music/Carlos+Baute\">Read more on Last.fm</a>'),('Carlos Perrota',5,3,' <a href=\"https://www.last.fm/music/Carlos+Perrota\">Read more on Last.fm</a>'),('Carmen 113',82938,5575,'All what\'s been gathered by this band from Girona, CARMEN 113, during the last years is concentrated in their second album \"Intenta respirar\" (113 Records/El Diablo, 2008). An album created, composed and recorded conscientiously, because this time, CARMEN 113, has been able to spread all their musical charms without any big effort - experience is a degree- and they\'ve managed to capture 12 songs which allowed them to surf with no fear within the waves of  the darkest rock reaching even the vitality of hip hop and funk. <a href=\"https://www.last.fm/music/Carmen+113\">Read more on Last.fm</a>'),('Carmen Cuesta',NULL,NULL,NULL),('Carmesí',4017,1056,' <a href=\"https://www.last.fm/music/Carmes%C3%AD\">Read more on Last.fm</a>'),('Caro Emerald',NULL,NULL,NULL),('Carolina Durante',4493146,60552,'Carolina Durante es una banda madrileña formada en 2017, cuya música puede catalogarse dentro de géneros como el punk, el pop o el indie. La agrupación musical está compuesta por Diego Ibáñez, Martín Vallhonrat, Juan Pedrayes y Mario del Valle.​ <a href=\"https://www.last.fm/music/Carolina+Durante\">Read more on Last.fm</a>'),('CASIOPEA-P4',NULL,NULL,NULL),('Celso Mendes',NULL,NULL,NULL),('Celtas Cortos',1655625,106073,'Spanish music group of celtic rock.\r\n\r\nIt was formed in Valladolid (Castilla y León) in 1986. Eight friends, four of which played in the group Almenara decided to participate in a music contest under the name \"Colectivo Eurofolk\". They won the first prize and continued to play together changing their name to Celtas Cortos.\r\n\r\nThey won another contest in April 1987, the prize was the production of an album. They shared the prize with two other winners, so they contributed three songs to the album Así es como suena: Folk joven. <a href=\"https://www.last.fm/music/Celtas+Cortos\">Read more on Last.fm</a>'),('Cepeda',465632,15915,' <a href=\"https://www.last.fm/music/Cepeda\">Read more on Last.fm</a>'),('Cesar AC',5838,1381,' <a href=\"https://www.last.fm/music/Cesar+AC\">Read more on Last.fm</a>'),('Champ Jr.',49430,4234,' <a href=\"https://www.last.fm/music/Champ+Jr.\">Read more on Last.fm</a>'),('Chance Peña',14597262,754708,'Chance is a singer-songwriter from Tyler, Texas who loves telling stories through his music. He is currently writing music for an upcoming album. \r\n \r\nIn 2015, at 15 years of age, Chance was a contestant on The Voice season 9. During the blind auditions, Adam Levine turned his chair for this budding star, and Blake Shelton stole him during the battle rounds. He went home after the knockout rounds, but for the first time in The Voice history, four artists were chosen to come back for the Live Playoffs. <a href=\"https://www.last.fm/music/Chance+Pe%C3%B1a\">Read more on Last.fm</a>'),('Changes',NULL,NULL,NULL),('Chappell Roan',305810220,2408323,'Kayleigh Rose Amstutz (born February 19, 1998), known professionally as Chappell Roan, is a Grammy award-winning American singer and songwriter. Working with long-time collaborator Dan Nigro, her music is inspired by \'80s synth-pop and early 2000s pop hits. Her music is heavily influenced by drag queens and is often described as \"campy.\"\r\n\r\nWhen she was 17 years old, Roan uploaded a song titled \"Die Young\" to YouTube, leading Atlantic Records to sign her to the label. <a href=\"https://www.last.fm/music/Chappell+Roan\">Read more on Last.fm</a>'),('Charlie Jeer',NULL,NULL,NULL),('Charo',108180,19058,'Maria Rosario Pilar Martinez Molina Baeza (born January 15, 1945), better known as Charo, is a Spanish-American actress, comedienne, and flamenco guitarist, best known for her flamboyant stage presence, her provocative outfits, and her trademark phrase (\"cuchi-cuchi\").\r\n\r\n <a href=\"https://www.last.fm/music/Charo\">Read more on Last.fm</a>'),('Chase Baird',NULL,NULL,NULL),('Chayanne',6955813,496973,'Chayanne (born June 29, 1969)is a Latin Pop singer who was born as Elmer Figueroa de Arce in San Lorenzo, Puerto Rico.\r\n\r\nFigueroa began using the artistic name of \"Chayanne\" when he was a little kid. He auditioned for Menudo, but was told that at the time that he was too young for the group. He didn\'t give up and he heard that Titi Soto was trying to create a new group that would compete with Menudo, and so he went and tried out. He was chosen for the group and his meteoric rise to the top began. <a href=\"https://www.last.fm/music/Chayanne\">Read more on Last.fm</a>'),('Chencho Corleone',1089723,91119,'Orlando Javier Valle Vega (Guayama, Puerto Rico; 19 de febrero de 1979),4​5​ conocido artísticamente como Chencho Corleone o simplemente Chencho, es un cantante, compositor y productor discográfico puertorriqueño de  reggaeton <a href=\"https://www.last.fm/music/Chencho+Corleone\">Read more on Last.fm</a>'),('Chet Baker',50163673,1805728,'Chesney Henry \"Chet\" Baker, Jr. (December 23, 1929 – May 13, 1988) was an American jazz trumpeter, flugelhornist and vocalist.\nBaker earned much attention and critical praise through the 1950s, particularly for albums featuring his vocals (Chet Baker Sings, It Could Happen to You). Jazz historian David Gelly described the promise of Baker\'s early career as \"James Dean, Sinatra, and Bix, rolled into one.\" His well-publicized drug habit also drove his notoriety and fame <a href=\"https://www.last.fm/music/Chet+Baker\">Read more on Last.fm</a>'),('Chick Corea',NULL,NULL,NULL),('Chick Flick',5681,595,'\"CHICK FLICK\" – это музыкальная группа, живые выступления которой можно увидеть в самых популярных заведениях города, а также на модных закрытых тусовках. Исполняемая группой музыка варьируется от дискотечного танцевального драйва до мягкого лаунжа. <a href=\"https://www.last.fm/music/Chick+Flick\">Read more on Last.fm</a>'),('Chilled Blues',NULL,NULL,NULL),('Chino & Nacho',2352304,233407,'Chino & Nacho is a Venezuelan pop duo, consisting of Jesús Alberto Miranda Perez (Chino - born November 15, 1984) and Miguel Ignacio Mendoza (Nacho - born August 22, 1983). In 2010, the group won the Latin Grammy Award under the category of Best Urban Music Album for their album, Mi Niña Bonita.\r\n\r\nBefore making a duo, Chino and Nacho were both part of a boy band Calle Ciega. That was where they started their musical career, and released five albums, and had their hit single, Mi Cachorrita. <a href=\"https://www.last.fm/music/Chino+&+Nacho\">Read more on Last.fm</a>'),('chipbagov',1311852,118449,' <a href=\"https://www.last.fm/music/chipbagov\">Read more on Last.fm</a>'),('ChocQuibTown',856553,88544,'Choc Quib Town es una agrupación que conjuga el sonido rural con el hip hop. Rumba, flow y mucha energía, eso es lo que proyectan estos jóvenes que vienen desde el pacifico en cada aparición. Un sonido autentico lleno de calle y alegría, de bembé y matices de la selva espesa afro colombiana. Choc Quib Town (Chocó Quibdo Nuestro pueblo). Con su nombre rinden homenaje a la tierra donde nacieron, Chocó, zona de sabor y de corazones abiertos, de lagrimas y de mucha lucha y de gente con deseos de superación. <a href=\"https://www.last.fm/music/+noredirect/ChocQuibTown\">Read more on Last.fm</a>'),('Chris Geith',NULL,NULL,NULL),('Chris Jedi',2358861,170121,' <a href=\"https://www.last.fm/music/Chris+Jedi\">Read more on Last.fm</a>'),('Chris Joss',2059640,124412,'Frenchman Chris Joss is a self-taught multi-instrumentalist and autonomous studio producer. Having lived in London most of the 90\'s, Joss digested the vibrant music scenes of the city while working as a sound engineer and playing bass & guitar in bands.\n\nin 96 he records his first album The Man With a Suitcase, the soundtrack to an imaginary 60\'s TV series, a tribute to Lalo Schifrin, John Barry, Quincy Jones, Laurie Johnson. Released in \'99 on indie label Pulp Flavor with the Bombay By Bus EP. <a href=\"https://www.last.fm/music/Chris+Joss\">Read more on Last.fm</a>'),('Chris Standring',NULL,NULL,NULL),('Christmas Jazz',NULL,NULL,NULL),('Cigarettes After Sex',284448738,2730293,'Cigarettes After Sex is an American dream pop band formed in El Paso, Texas, in 2008 by Greg Gonzalez. The band is known for its ethereal and often dream-like musical style, lyrics focused on love and romance, and Gonzalez\'s androgynous voice. While frequently categorized as ambient pop, the band is also associated with shoegaze, slowcore, and indie rock.\r\n\r\nThe band\'s debut extended play, \"I.,\" was released in 2012, with the song \"Nothing\'s Gonna Hurt You Baby\" gaining popularity through commercial licensing. <a href=\"https://www.last.fm/music/Cigarettes+After+Sex\">Read more on Last.fm</a>'),('Cios',90991,4539,'\r\nCios are punk rock band from Ukraine.\r\nhttp://cios.bandcamp.com\r\n <a href=\"https://www.last.fm/music/Cios\">Read more on Last.fm</a>'),('Clairo',322110026,2785150,'Claire Elizabeth Cottrill (born August 18, 1998), known professionally as Clairo, is an American singer-songwriter. She began sharing music online at age 13.\r\n\r\nClairo gained widespread attention following the viral success of the music video for her lo-fi single \"Pretty Girl\" in 2017. She subsequently signed with Fader Label and released her debut EP \"Diary 001\" in 2018. Her first studio album, \"Immunity\" (2019), included the singles \"Bags\" and \"Sofia,\" with the latter becoming her first entry on the Billboard Hot 100. <a href=\"https://www.last.fm/music/Clairo\">Read more on Last.fm</a>'),('Class Actress',3541595,365453,'Class Actress is a synthpop band formed in 2009 in Brooklyn, New York City, USA. The group consists of the singer-songwriter Elizabeth Harper and the producers Scott Rosenthal and Mark Richardson. Their music has been compared with artists like Depeche Mode, The Human League, OMD and Madonna.\r\n\r\nElizabeth Harper is a former drama student from Los Angeles, USA. Harper also pursued a solo career as an indie rock singer-songwriter. She released a studio album Elizabeth Harper in 2004 (2005 in the UK and 2006 in Japan). <a href=\"https://www.last.fm/music/Class+Actress\">Read more on Last.fm</a>'),('Cloudsurfin\'',NULL,NULL,NULL),('Cocoon',5322023,292698,'There are at least six bands called Cocoon:\r\n\r\n1. Cocoon is a two-piece French band formed in 2006 by Mark Daumail (born 1984, composition, lead vocals, acoustic guitar, ukelele, banjo, beatbox, etc.) and Morgane Imbeaud (born 1987, vocal harmonies, keyboards, arrangements).\r\n\r\n\"I wanted it to be a male-female duet. A duo like the White Stripes are in rock — we wanted to be the equivalent in folk music,\" Daumail says. Their songs are entirely sung in English. <a href=\"https://www.last.fm/music/Cocoon\">Read more on Last.fm</a>'),('Codec',187815,27381,'There exist at least 5 different artists named Codec, including an unsigned rock band and an electronic duo active between 1999-2003. \n1. Progressive rock band: Codec is a band that makes music that is at once dangerous and beautiful, that channels the future through the past to compress and make sense of life and death. Their work deciphers the immense data of our uncertain existence and presents it on a soul level.\n\nBand members:\nBrian C. Andrews <a href=\"https://www.last.fm/music/Codec\">Read more on Last.fm</a>'),('Cody Hobart',NULL,NULL,NULL),('Coffee Jazz Melody',NULL,NULL,NULL),('Colectivo Oriente Drums',55,23,' <a href=\"https://www.last.fm/music/Colectivo+Oriente+Drums\">Read more on Last.fm</a>'),('ColorJaxx',20003,4757,' <a href=\"https://www.last.fm/music/ColorJaxx\">Read more on Last.fm</a>'),('Comida Para Llevar',NULL,NULL,NULL),('Copenhagen untd.',NULL,NULL,NULL),('Cory Wong',NULL,NULL,NULL),('Cosculluela',4520430,291143,'Born in Humacao, Puerto Rico, Jose Cosculluela a.k.a Cosculluela discovered at a young age that his passion was music. He got into rap music at age 12, listening to cassettes from Vico C and singing his songs. After listening to the underground album Playero 37, he and his brother bought some recording equipment and he knew at that moment that the only thing he ever wanted to do was music. He started writing, recording and selling underground mixed cassettes in Humacao, meeting new friends and eventually formed the group KnockOut Trax. <a href=\"https://www.last.fm/music/Cosculluela\">Read more on Last.fm</a>'),('cosmic collective',NULL,NULL,NULL),('Covenants',19501,5821,'We are Covenants, a Technical Metal band from Los Angeles. We have a 4 song EP titled \"World Of Augury\" that is out now. You can pick it up on our Bandcamp page! We are going to be playing shows very soon so be check our Facebook page and if you like our stuff don\'t hesitate to spread the word!\n\nVictor Lara-Guitar\nZakk Perez-Drums\nGus Ornelas-Vocals\nDillon Shamma-Bass\nAnthony Gamboa-Guitar\n\nhttp://www.facebook.com/covenantsla\nhttp://covenants.bandcamp.com <a href=\"https://www.last.fm/music/Covenants\">Read more on Last.fm</a>'),('Cozy Coffee Shop',NULL,NULL,NULL),('Crate Classics',60089,16672,' <a href=\"https://www.last.fm/music/Crate+Classics\">Read more on Last.fm</a>'),('Cris MJ',27038336,508325,'Christopher Andrés Álvarez García , better known as Cris MJ, is a Chilean singer and songwriter, born on 16 September 2001; who achieved great international popularity in 2022 for the success of his song \"Una noche en Medellín\". He has managed to make collaborations and participations with other Chilean rappers and singers such as Pablo Chill-E, Pailita, among others.\r\n\r\nHis start in music began in 2019 and has been becoming popular in music since then, because he already had several highly successful songs. <a href=\"https://www.last.fm/music/Cris+Mj\">Read more on Last.fm</a>'),('Cristian Castro',4170244,241945,'Cristian Castro (born Cristian Sáenz Castro on December 8th, 1974 in Mexico City) is a Grammy Award-nominated Mexican pop singer, songwriter and actor. He is sometimes simply known as Cristian or \"el Gallito Feliz\" (Spanish: \"The Happy Little Rooster\"). He is also the lead singer of Mexican heavy metal band La Esfinge (under the pseudonym \"Lügh Draculea\"), formed in 2014 along with ex-Maná and ex-Jaguares guitarist César \"Vampiro\" López.\r\n\r\nCastro added the \"h\" to his first name for the release of his successful album <a href=\"https://www.last.fm/music/Cristian+Castro\">Read more on Last.fm</a>'),('Croixx',185269,29671,' <a href=\"https://www.last.fm/music/Croixx\">Read more on Last.fm</a>'),('Croni-K',54097,10247,'Cróni-K is a Chilean reggaeton group. <a href=\"https://www.last.fm/music/Croni-K\">Read more on Last.fm</a>'),('Crossfire',377881,49398,'There are at least 17 bands that have used the name Crossfire.\r\n\r\n01. A metal band from Belgium\r\n02. A metal band from Ankara, Turkey\r\n03. Drum and Bass DJ from Europe\r\n04. A jazz fusion band from Australia\r\n05. A blues band from Northern Ireland\r\n06. A metal band from Ecuador\r\n07. A glam metal band from Israel\r\n08. A punk/ska band from Scotland\r\n09. A straight edge punk band from the United Kingdom\r\n10. An Alternative/Punk Rock band from the UK\r\n11. A psychobilly/punkabilly band from Japan. <a href=\"https://www.last.fm/music/Crossfire\">Read more on Last.fm</a>'),('Crystal Castles',230137120,3066480,'Crystal Castles was an experimental /  electronic band which formed in 2003 in Toronto, Ontario, Canada and last consisted of Ethan Kath and vocalist Edith Frances. Alice Glass served as the lead vocalist for the group since its foundation until 2014.\r\n\r\nThey are named after the lyrics \"The fate of the world is safe in Crystal Castles\" and \"Crystal Castles, the source of all power\" both from the theme song for She-Ra\'s fortress. They are known for their melancholic lo-fi sound and their explosive live shows. <a href=\"https://www.last.fm/music/Crystal+Castles\">Read more on Last.fm</a>'),('Crystal Fighters',16183606,805011,'Crystal Fighters are an English/Spanish electronic band who formed in London, United Kingdom in 2007. They are Sebastian (lead vocals, guitar), Gilbert (electronics, guitars, txalaparta, percussion) and Graham (guitar/ txalaparta), plus Laure and Mimi (vocals).\r\n\r\nSebastian and Gilbert were old friends, while Gilbert and Graham met through various parties. The three then began making music under various guises before being joined by Laure and Mimi. The band now play with a live drummer. <a href=\"https://www.last.fm/music/Crystal+Fighters\">Read more on Last.fm</a>'),('Curtis Mayfield',20104522,1420770,'Curtis Mayfield (June 3, 1942 – December 26, 1999) was an American soul, funk and rhythm and blues, singer-songwriter and guitarist from Chicago, Illinois.\n\nMayfield is probably best known for his anthemic music with The Impressions and for the soundtrack to the blaxploitation film Superfly.\n\nPerhaps because he didn\'t cross over to the pop audience as heavily as Motown\'s stars, it may be that the scope of Curtis Mayfield\'s talents and contributions have yet to be fully recognized. <a href=\"https://www.last.fm/music/Curtis+Mayfield\">Read more on Last.fm</a>'),('Cyrille Aimee',NULL,NULL,NULL),('D-Vision',14239,2707,' <a href=\"https://www.last.fm/music/D-vision\">Read more on Last.fm</a>'),('d4vd',108513611,2207124,'David Anthony Burke (born March 28, 2005), known professionally as d4vd, is an American singer and songwriter. He is a content creator for the gaming and lifestyle brand 100 Thieves. He is best known for his songs \"Romantic Homicide\" and \"Here with Me\", both of which experienced international chart success.\r\n\r\nBurke\'s career in music started when he made montage videos of the video game Fortnite and decided to make his own music to prevent himself from receiving copyright strikes. <a href=\"https://www.last.fm/music/d4vd\">Read more on Last.fm</a>'),('Da Damn Phreak Noize Phunk',33162,3543,'The DDPNP \n\nhttp://www.combination-rec.de/index.php?id=43\n\nOliver Bondzio and Ramon Zenker aka Hardfloor dedicate themselves under their alias Dadamnphreaknoizphunk to the more relaxed sides of our existence.\n\nThey rock your soul with their smart and unique mix of hiphop beats and electroid sounds: deep`n`dope stuff with a befitting portion of 303.\n\nAs Hardfloor, Oliver Bondzio and Ramon Zenker are firmly cemented in the history of music. They are the longest-serving <a href=\"https://www.last.fm/music/Da+Damn+Phreak+Noize+Phunk\">Read more on Last.fm</a>'),('Daddy Yankee',47732472,2107910,'Ramón \"Raymond\" Luis Ayala Rodríguez (born February 3, 1977), known artistically as Daddy Yankee, is a Latin Grammy Award winning Puerto Rican reggaeton recording artist. Ayala was born in Río Piedras, the largest district of San Juan, Puerto Rico, where he became interested in music at a young age. In his youth he was interested in baseball, and aspired to become a Major League Baseball player. He was unable to continue this sport when he got shot in the leg by being mistaken for his friend by a unknown man <a href=\"https://www.last.fm/music/Daddy+Yankee\">Read more on Last.fm</a>'),('Dale Pututi',24445,3653,' <a href=\"https://www.last.fm/music/Dale+Pututi\">Read more on Last.fm</a>'),('Dam Swindle',521287,81318,'It was in 2011 that Dutch pair Lars Dales and Maarten Smeets quickly broke through in the electronic music scene. Since then they have become known for their widescreen approach to making and playing club-ready grooves. From deep to disco, tech to soul, they join the dots between the past and the present with their own sense of storytelling and do so in clubs around the world, as well as in their own studio. House might be the root of the Dam Swindle sound, but it takes nourishment from a much wider world of music. <a href=\"https://www.last.fm/music/Dam+Swindle\">Read more on Last.fm</a>'),('Damián Córdoba',101160,6329,' <a href=\"https://www.last.fm/music/Dami%C3%A1n+C%C3%B3rdoba\">Read more on Last.fm</a>'),('Damian Wilson',195117,6348,'Damian Wilson is a very talented singer in the progressive rock & metal genre. He is the lead singer for Threshold, Headspace and Maiden United, and used to be for Landmarq. Damian also recorded four solo albums. He performed on many Ayreon albums and toured with Arjen Anthony Lucassen\'s project Star One. He played the lead role of Jean Valjean in the Les Miserables UK National Tour and did a European tour with Arjen Anthony Lucassen\'s Stream of Passion. <a href=\"https://www.last.fm/music/Damian+Wilson\">Read more on Last.fm</a>'),('Dana Masters',NULL,NULL,NULL),('Dane Emerson',NULL,NULL,NULL),('Dani Fernández',845422,31377,'Daniel Fernández Delgado was born December 11, 1991 in a town of Ciudad Real, Alcázar de San Juan, where at present lives. It studies in the Secondary School Juan Bosco.  It has a sister of 18 years old, Noelia, and its parents are named Marcial, and Mª Carmen.\r\n\r\nIt charms to come out with its friends or to be connected to Internet.  Is a great lover of the soccer and its team is the Athletic of Madrid.  Its favorite player is Sergio Agüero and many say that seems to Fernando Torres <a href=\"https://www.last.fm/music/Dani+Fern%C3%A1ndez\">Read more on Last.fm</a>'),('Dani Martín',807214,44076,'Best known as the frontman of Spain\'s biggest power pop group, El Canto del Loco, singer/actor Dani Martín proved he could go it alone after juggling a music career with several critically acclaimed acting roles. Born Daniel Martín Garcia in Madrid in 1977, he regularly entertained his family with impersonations of his favorite singers as a child and received his first taste of exposure as a 14-year-old on the TVE show Rock Out. \r\n\r\nAfter attending the Cristina Rota and William Layton drama schools <a href=\"https://www.last.fm/music/+noredirect/Dani+Mart%C3%ADn\">Read more on Last.fm</a>'),('Daniel Michael Cherrier',7,3,' <a href=\"https://www.last.fm/music/Daniel+Michael+Cherrier\">Read more on Last.fm</a>'),('Daniele Ravaioli',1299,469,'Daniele Ravaioli – Producer Artsits Manager In 1986 the passion of the deejay explodes in me, immediately introducing the use of the sampler in live performances, an absolute novelty then emerging. This makes me discover the world of music production. After moving to Rome my DJ Producer activity is very prolific: I divide the consoles of Goa, Akab and Alibi, with Roman DJs including Andrea Torre, Marco Trani, Farfa. I collaborate with radio programs in the capital (Radio Centro Suono <a href=\"https://www.last.fm/music/Daniele+Ravaioli\">Read more on Last.fm</a>'),('Danny Ocean',12107024,499168,'Daniel Alejandro Morales Reyes (born 5 May 1992), known by his stage name Danny Ocean, is a Venezuelan singer, songwriter and record producer born in Caracas, Venezuela. He began his professional music career in 2009 with the creation of his YouTube channel. Daniel  is best known for his song \"Me Rehúso\", the first Latin solo artist song to reach 1 billion streams on Spotify, which it did in 2020. <a href=\"https://www.last.fm/music/Danny+Ocean\">Read more on Last.fm</a>'),('Darell',2067434,197250,'One of the most sought-after artists from the latest wave of the Urban Latin movement, Puerto Rico native Darell emerged as both a sought-after composer in 2018, playing a definitive role in numerous hits and attracting a rapid fan base back home. Among many smashes, Nío García, Casper Mágico y Bad Bunny’s “Te Boté REMIX” [feat. Ozuna, Nicky Jam y Darell] stood out as one of the year’s most heard and streamed songs, spending 41 weeks on the Latin Airplay chart and peaking at #2. <a href=\"https://www.last.fm/music/Darell\">Read more on Last.fm</a>'),('DarWin',NULL,NULL,NULL),('David Bisbal',5172598,354261,'\r\nDavid Bisbal Ferre (born June 5, 1979 in Almería, Spain) is a Latin Grammy-winning Spanish pop singer. He gained his initial fame as a runner up on the interactive reality television show Operación Triunfo produced by Television Española.\r\n\r\nHe has since released five studio albums, all of which topped the Spanish Albums Chart, in addition to recording a number of live albums. He\'s toured throughout Europe and Latin America and is now considered to be a crossover international artist. <a href=\"https://www.last.fm/music/David+Bisbal\">Read more on Last.fm</a>'),('David Bowie',389634591,5433917,'David Robert Jones (8 January 1947 – 10 January 2016), known professionally as David Bowie, was an English singer-songwriter and actor. A leading figure in the music industry, he is regarded as one of the most influential musicians of the 20th century. Bowie was acclaimed by critics and musicians, particularly for his innovative work during the 1970s. His career was marked by reinvention and visual presentation, and his music and stagecraft had a significant impact on popular music. <a href=\"https://www.last.fm/music/David+Bowie\">Read more on Last.fm</a>'),('David Courtin',6279,501,' <a href=\"https://www.last.fm/music/David+Courtin\">Read more on Last.fm</a>'),('David Ehrlin',NULL,NULL,NULL),('David Guetta',179690099,5049639,'Pierre David Guetta is a French DJ and music producer. He has sold over 10 million albums and 65 million singles globally, with more than 14 billion streams. In 2011, 2020, and 2021, Guetta was voted the number one DJ in the DJ Mag Top 100 DJs poll. In 2013, Billboard crowned \"When Love Takes Over\" as the number-one dance-pop collaboration of all time, with singer Kelly Rowland.\r\n\r\nHe released his first album, Just a Little More Love, in 2002. Later, he released Guetta Blaster (2004) and Pop Life (2007). <a href=\"https://www.last.fm/music/David+Guetta\">Read more on Last.fm</a>'),('Dazed',NULL,NULL,NULL),('De Jeugd Van Tegenwoordig',9373671,178816,'De Jeugd van Tegenwoordig (\"Today\'s Youth\") is a hip-hop group formed in Amsterdam, The Netherlands in 2005.\r\n\r\nThe group is a 4-piece made up of Vieze Fur a.k.a. Vieze Freddie (Freddie Tratlehner), P. Fabergé (Pepijn Lanen) a.k.a. Faberyayo, Willie Wartaal a.k.a. WiWa (Ollicio Locadia) and \'de Neger des Heils\' (Bas Bron, Majoor Vloshard, Bastian, Seymour Bits,  Fatima Yamaha). \r\n\r\nThey are known most notably for their chart-topping single Watskeburt?!, which then became Dutch slang for \"what\'s up?!\". <a href=\"https://www.last.fm/music/De+Jeugd+van+Tegenwoordig\">Read more on Last.fm</a>'),('De La Rose',1279631,67556,' <a href=\"https://www.last.fm/music/De+la+rose\">Read more on Last.fm</a>'),('Death Cab for Cutie',246503149,3738450,'\r\nDeath Cab for Cutie is an American indie rock band formed in Bellingham, Washington in 1997. The band consists of Ben Gibbard (vocals, guitar, piano), Nicholas Harmer (bass), Jason McGerr (drums), Dave Depper (guitar) and Zac Rae (keyboards).\r\n\r\nDeath Cab began as a solo project of Ben Gibbard, now the band\'s vocalist and guitarist. Gibbard took the band name from the satirical song Death Cab for Cutie, performed by The Bonzo Dog Band in The Beatles\' 1967 experimental film Magical Mystery Tour. <a href=\"https://www.last.fm/music/Death+Cab+for+Cutie\">Read more on Last.fm</a>'),('Debi Nova',298713,29872,'Debi Nova is a multi-talented female vocalist from Escazu, Costa Rica who calls Los Angeles, California home. A graduate of The Los Angeles Music Academy, Nova has graced her signature voice on various projects from jazz artist Boney James to rapper Q-Tip to Sergio Mendes and Will.I.AM of the Black Eyed Peas. Her single CD, \"One Rhythm\", has an English version, Spanish version, and six mixes, all in advance of her anticipated 13 song future CD.\r\n\r\nShe also callaborated with Ricky Martin in his english album \"Life\" <a href=\"https://www.last.fm/music/Debi+Nova\">Read more on Last.fm</a>'),('Decai',152144,20519,' <a href=\"https://www.last.fm/music/Decai\">Read more on Last.fm</a>'),('Deep Blast',1481,538,' <a href=\"https://www.last.fm/music/Deep+Blast\">Read more on Last.fm</a>'),('Deep Fried Green Tomatos',13,9,' <a href=\"https://www.last.fm/music/Deep+Fried+green+Tomatos\">Read more on Last.fm</a>'),('Deep Roger',927,308,' <a href=\"https://www.last.fm/music/Deep+Roger\">Read more on Last.fm</a>'),('Deepmore',1689,706,' <a href=\"https://www.last.fm/music/Deepmore\">Read more on Last.fm</a>'),('DEEPSYSTEM',31048,4171,'Deep System\n\nA meteoric climb to success is something that most artists dream of, but few enjoy. Even fewer artists get to have any type of control of that rise, or how long the success lasts. “Deep System” is an artist that is still enjoying the ride, and reaping the benefits along the way. \n\nAt the age of 16, Deep System (known then only as Andrei S.) got his start as a club mc and hip-hop artist.  During this time, he released 4 mix tapes. <a href=\"https://www.last.fm/music/DeepSystem\">Read more on Last.fm</a>'),('Deftones',523845150,4052773,'Deftones is an American metal band from Sacramento, California, formed in 1988, consisting of Chino Moreno (lead vocals and guitar), Stephen Carpenter (guitar), Frank Delgado (keyboards and turntables), and Abe Cunningham (drums and percussion). Vega (formerly of Quicksand) took on bass duties from mid-2009 to ca. 2021 in substitution for Chi Cheng, who was seriously injured in an automobile accident in Santa Clara, California on November 4, 2008. <a href=\"https://www.last.fm/music/Deftones\">Read more on Last.fm</a>'),('Dei V',7215144,124231,' <a href=\"https://www.last.fm/music/Dei+V\">Read more on Last.fm</a>'),('DELACOUR',589468,103103,' <a href=\"https://www.last.fm/music/Delacour\">Read more on Last.fm</a>'),('Delegation',3340878,471965,'1- Delegation is a disco band consisting of Ricky Bailey, Len Coley, Ray Patterson and Roddy Harris.\nThey started their career in the late 70s with the singles «The Promise Of Love» and \"Put A Little Love On Me\". Later on, Delegation released the albums «Delegation», «Eau De Vie», «Delegation II», «Deuces High» and «Encore». \n\nRicky Bailey & Delegation... delivering all that\'s great about British 70\'s, 80\'s & 90\'s Soulful Funk!\n\nDelegation one of the foremost recording and touring soul funk bands of the 70\'s <a href=\"https://www.last.fm/music/Delegation\">Read more on Last.fm</a>'),('Delux',0,0,NULL),('Demi Lovato',190835659,3237571,'Demetria Devonne Lovato, professionally known as Demi Lovato, is an American singer, songwriter and actress. After appearing on the children\'s television series Barney & Friends (2002–2004), Lovato rose to prominence for playing Mitchie Torres in the musical television film Camp Rock (2008) and its sequel Camp Rock 2: The Final Jam (2010); the former film\'s soundtrack contained \"This Is Me\", Lovato\'s debut single and duet with Joe Jonas, which peaked at number nine on the Billboard Hot 100. <a href=\"https://www.last.fm/music/Demi+Lovato\">Read more on Last.fm</a>'),('Demir',5782,1537,'ozgur demir was born in 1982 in bielefeld, germany. early in his life he showed an interest in electronic music and soon began experimenting with his father\'s keyboard and a 4 track tape recorder. at the age of 16, demir discovered computer based music production using sequencers and software and started producing his own tracks. when he moved to berlin in 2002 he began spinning vinyl and his sound developed into a mix of electro, minimal and tech-house. <a href=\"https://www.last.fm/music/Demir\">Read more on Last.fm</a>'),('Denis Solee',NULL,NULL,NULL),('Dennis Ferrer',1288664,223508,'As one-half of Sfere Recordings along with house legend Kerri Chandler, Dennis Ferrer’s name has rapidly built momentum over the past five years amongst house music aficionados. Ferrer\'s soulful and afro-house influenced productions have appeared on leading house music labels stateside and in Europe.   With a discography of original productions that extend from respected labels such as Sfere, Ibadan, Large, and King Street to Basic Recordings, Madhouse and Chillifunk, Ferrer is poised at the very top of the game. <a href=\"https://www.last.fm/music/Dennis+Ferrer\">Read more on Last.fm</a>'),('Depedro',924525,48032,'Depedro is the musical project of Spanish singer and guitar player Jairo Zavala, who is also front man and co-founder of rock band Vacazul. In its first album (also named Depedro, published in 2008) Depedro mixes latin music, border fusion, folk, african music, reggae and blues.\r\n\r\nDepedro\'s official site is at http://www.myspace.com/myspacedepedro <a href=\"https://www.last.fm/music/DePedro\">Read more on Last.fm</a>'),('Depresión Sonora',6114406,155832,'Marcos Crespo Garcia, AKA as Markusiano, is a Spanish music solo artist and producer based in Madrid, Spain (originally from Cuenca, Castilla-La Mancha, Spain). His current project, Depresión Sonora, has post-punk, rap and pop influences that touch themes about depression, existentialism, nihilism, current issues and technology. Some of his influences include Molchat Doma, Black Marble and Human Tetris.\r\n\r\n\"Hasta que llegue la muerte\" was the first single that was shared on April <a href=\"https://www.last.fm/music/Depresi%C3%B3n+Sonora\">Read more on Last.fm</a>'),('Desakato',689474,13169,'Desakato is a band from Llanera (Asturias, Spain), formed in 2003 as an initiative from Pablo and Mario (singer/rythm guitar and bass respectively) who had been leaping from group to group not finding a sound they liked. They teamed up with guitarist Gabri and started playing covers and writing their own songs. Drumless, Pablo asked his brother Héctor to join up. Falu joined up as songwriter and helped with composition, as well as backup vocals and some solo songs. <a href=\"https://www.last.fm/music/Desakato\">Read more on Last.fm</a>'),('Deuce',NULL,NULL,NULL),('Dhafer Youssef',NULL,NULL,NULL),('Diamante Ayala',28326,2921,' <a href=\"https://www.last.fm/music/Diamante+Ayala\">Read more on Last.fm</a>'),('Diazpora',50778,7573,'Diazpora is a nine-piece funk band from Hamburg, Germany, founded in 2002. It consists of Hans-Christian Stephan (trumpet), Jonathan Krause (baritone saxophone, flute), Alexander \"Kimo\" Eiserbeck (alto saxophone), Lucas Kochbeck (drums), David Nesselhauf (bass), Thomas Neitzel (percussion), Legbo (guitar), Christoph Hinrichsen (keyboards) and Axel Feige (vocals). <a href=\"https://www.last.fm/music/Diazpora\">Read more on Last.fm</a>'),('Diego Torres',2583618,267605,'Diego Antonio Caccia Torres (born March 9, 1971 in Buenos Aires, Argentina) is an Argentine pop singer and composer. He launched his first album, \"Diego Torres\", produced by Cachorro López. This album was rewarded 3 times platinum.\r\n\r\nTwo years later, and a little distant from TV, he launched his second album called \"Tratar de estar mejor\" which received 5 platinum albums in Argentina and gold and platinum albums in other Latin American countries. This album launched Torres to the international scene. <a href=\"https://www.last.fm/music/Diego+Torres\">Read more on Last.fm</a>'),('Difuntos Correa',207253,21469,'Difuntos Correa is a Chilean rock band. Difuntos Correa appeared in the Chilean rock ambient in 2002. The band, composed by 7 young musicians started performing in pubs where the public was mainly composed by their friends. In 2004 they released the debut album Tramposo Amor gaining mainstream popularity at local level. <a href=\"https://www.last.fm/music/Difuntos+Correa\">Read more on Last.fm</a>'),('Dinah York',NULL,NULL,NULL),('Dionigi',31420,6465,' <a href=\"https://www.last.fm/music/Dionigi\">Read more on Last.fm</a>'),('Dipo',NULL,NULL,NULL),('Dirty Loops',NULL,NULL,NULL),('Divino',298626,58061,'Divino Biography Conveying heartfelt emotion through richly textured songs has always been a priority for Puerto Rican reggaetón sensation Daniel Divino Velazquez, whose confessional lyrics and impressive vocal range have made him rise to superstar status throughout the Caribbean and Central America. \r\n\r\nWith the release of Todo A Su Tiempo: Platinum Edition, the pioneering artist will doubtless conquer U.S. audiences and establish himself as one of the most versatile performers in the genre.  <a href=\"https://www.last.fm/music/Divino\">Read more on Last.fm</a>'),('Dizzy K Falola',8656,3958,'Dizzy K Falola (born Kunle Falola) is a London-based Nigerian singer, currently performing as a gospel artist, but is perhaps best known as a former eighties pop star, famed for the hit \"Baby Kilode\".\nDizzy K Falola became a household name as a professional secular musician under EMI/HMV and latert turned Pastor and Preacher when he encountered Jesus Christ. He has since released eight gospel albums to date.Write something about Dizzy K.\n <a href=\"https://www.last.fm/music/Dizzy+K+Falola\">Read more on Last.fm</a>'),('DJ Bryanflow',109611,22406,' <a href=\"https://www.last.fm/music/Dj+BryanFlOw\">Read more on Last.fm</a>'),('DJ DANLIVE',74863,11771,' <a href=\"https://www.last.fm/music/Dj+Danlive\">Read more on Last.fm</a>'),('DJ Dark',331044,40659,'Biografie\nIn 2008 lanseaza primul track produs in studioul Whiteeffect Studio ce se intituleaza “You gonna Fight” ce inregistreaza un succes neasteptat pe vremea aceea.In acelasi an o cunoaste si pe Dora care accepta sa fie vocea pentru al doilea single semnat “Dj Dark ft Dora – Someday”.\nLa inceputul anului 2010 incepe colaborarea cu postul de radio VIBE FM unde devine din ce in ce mai apreciat datorita dorintei sale de a oferi seturi cat mai pozitive ascultatorilor. <a href=\"https://www.last.fm/music/Dj+Dark\">Read more on Last.fm</a>'),('Dj General',355,169,' <a href=\"https://www.last.fm/music/DJ+General\">Read more on Last.fm</a>'),('DJ Icey',442139,59220,'DJ Icey (born Eddie Pappa), once referred to as the \"King of Funky Breaks\" (Mixmag April 1998) is the multi platinum Moonshine Records recording artist responsible for defining Funky Breaks and Florida Breaks.\n\nBorn and raised in Florida, DJ Icey first got interested in music in his teens. He was especially fond of early 1980s new wave synth pop, industrial, and hip-hop music. The boom in club music during the late 1980s hooked him and when he began DJing early in the 1990s, he usually played out acid house and funky breaks. <a href=\"https://www.last.fm/music/DJ+Icey\">Read more on Last.fm</a>'),('Dj La Touche & Pruess',5,4,' <a href=\"https://www.last.fm/music/Dj+La+Touche+&+Pruess\">Read more on Last.fm</a>'),('DJ Lopo',970,322,' <a href=\"https://www.last.fm/music/DJ+Lopo\">Read more on Last.fm</a>'),('DJ Lvov',12188,1083,' <a href=\"https://www.last.fm/music/DJ+Lvov\">Read more on Last.fm</a>'),('DJ Maddog',10271,2290,'Youre looking for Dj Mad Dog. <a href=\"https://www.last.fm/music/DJ+Maddog\">Read more on Last.fm</a>'),('DJ ORCUN',16935,5613,'Orçun Ağaçdan (b. 04/22/1991, Ankara), also known as DJ ORCUN, is a Turkish DJ and music producer. He is known for his work in house music and its sub-genres. He remixed songs of prominent Turkish singers such as Müslüm Gürses and Ferdi Tayfur.\n\nCareer\nOrçun took his first steps in his musical career by remixing popular songs in 2004 and publishing these on online music platforms. The remixes he produced were highly welcomed in Turkiye and Germany, which was a huge milestone for his musical career. <a href=\"https://www.last.fm/music/DJ+ORCUN\">Read more on Last.fm</a>'),('DJ Paulinho Mondi Da Baixa Baviera',899691,106368,' <a href=\"https://www.last.fm/music/DJ+Paulinho+Mondi+Da+Baixa+Baviera\">Read more on Last.fm</a>'),('Dj Peligro',191388,31229,' <a href=\"https://www.last.fm/music/Dj+Peligro\">Read more on Last.fm</a>'),('Dj Pruess & Moritz, Cristian, DJ Pruess, Moritz',6,2,' <a href=\"https://www.last.fm/music/Dj+Pruess+&+Moritz,+Cristian,+DJ+Pruess,+Moritz\">Read more on Last.fm</a>'),('DJ RITMO DIVINO',65643,11232,' <a href=\"https://www.last.fm/music/DJ+RITMO+DIVINO\">Read more on Last.fm</a>'),('DJ Sanny J',28808,5569,'Santo Finocchiaro aka Dj Sanny j, born in 1973 in Biancavilla in the province of Catania.\r\nHe began his career as a Dj at only 13 years. His debut song was \"Feel the emotion.\" <a href=\"https://www.last.fm/music/DJ+Sanny+J\">Read more on Last.fm</a>'),('DJ Unic',35371,3389,' <a href=\"https://www.last.fm/music/DJ+Unic\">Read more on Last.fm</a>'),('DJ Viral BR',3462,725,' <a href=\"https://www.last.fm/music/DJ+Viral+BR\">Read more on Last.fm</a>'),('Doc Powell',NULL,NULL,NULL),('Don Chezina',149724,33751,'Don Chezina (real name Ricardo Garcia Ortiz), born in Georgia, U.S. in 1976, is a singer, producer, and talent scout of reggaeton music.He is known throughout the world for his high, nasal voice and fast rapping style (known as \"Puerto Rico\'s Machine Gun Rapper\"), along with his most famous song \"Tra Tra Tra\". Don Chezina is perhaps best known for the first use of the word \"Reggaeton\" in a hit song.\r\n\r\n\r\nDon chezina cantante , compositor del genero del Reggaeton desde 1994 <a href=\"https://www.last.fm/music/Don+Chezina\">Read more on Last.fm</a>'),('Don Miguelo',986713,124434,'Don Miguelo is a Dominican rapper in the Reggaeton genre. He became famous with his smash hit \"La Cola De Motora\" and \"Ay Que Tu Quiere\". He has recently traveled to the United States in hopes that his new album will be an even better seller than before\r\n\r\nDon Miguelo is a new singer in the Dominican Republic and he is from San Francisco De Macoris. Despite his lack of experience, he has already enjoyed some measure of success with his first hit song <a href=\"https://www.last.fm/music/Don+Miguelo\">Read more on Last.fm</a>'),('Don Omar',31424443,1704144,'William Omar Landrón (born February 10, 1978 in Puerto Rico), better known as Don Omar, is a reggaeton singer. He is one of the most well known reggaeton artists in Latin America. His cross over success in the U.S. has given him more exposure to English speaking Reggaeton fans, making him one of the more recognizable faces of Reggaeton along with Daddy Yankee and Tego Calderón. Don Omar\'s popularity is currently rising and he recently appeared on MTV. <a href=\"https://www.last.fm/music/Don+Omar\">Read more on Last.fm</a>'),('Don Peake',18631,445,'Prolific and multitalented composer, musician & record producer DON PEAKE wrote the original soundtrack for Wes Craven’s THE HILLS HAVE EYES (1977) where his eerie soundtrack punched up some of the films most unnerving scenes.\n\nDon started his music career in 1961 as the lead guitarist for The Everly Brothers and played guitar for ten years in the Ray Charles Orchestra. Don played guitar on Phil Spector’s Righteous Brothers hit “You’ve Lost That Loving Feeling <a href=\"https://www.last.fm/music/Don+Peake\">Read more on Last.fm</a>'),('Don Thomas',84521,16675,'There is more than one artist with this name.\n\n1. Don Thomas (born Charles Thomas) is an African-American soul singer. He was a member of The Drifters between 1969 and 1971. He is best remembered for his 1973 single \'Come On Train\' which achieved massive popularity on the UK Northern Soul scene.\n\n2. Don Thomas. Acoustic, new age, instrumental music (1995 to the  present).  Known cd\'s include \"Sounds of Autumn\", \"Sounds of Summer\", \"Sounds of Spring\", \"Sounds of Winter\".  <a href=\"https://www.last.fm/music/Don+Thomas\">Read more on Last.fm</a>'),('Donny Hathaway',9469041,1116445,'Donny Edward Hathaway (October 1, 1945 – January 13, 1979) was a Grammy Award-winning American soul musician. He signed with Atlantic Records in 1969, and with his first single \"The Ghetto\" (1970), Rolling Stone magazine marked him as \"a major new force in soul music.\" His collaborations with Roberta Flack took him to the top of the charts and won him the Grammy Award for Best Pop Performance by a Duo or Group with Vocal for the duet \"Where Is the Love\" in 1973. <a href=\"https://www.last.fm/music/Donny+Hathaway\">Read more on Last.fm</a>'),('Doug Gomez',8823,2719,' <a href=\"https://www.last.fm/music/Doug+Gomez\">Read more on Last.fm</a>'),('Dousk',601825,58633,'John Ntouskos, aka Dousk, is a new artist from Greece. \nBorn in Athens in 1979, he completed his classical music studies in 1999. The studies included classical piano, jazz and electronic music production/engineering. \n\nDousk, along with Jose Zamora, is the founder of the JDK Project. \n\nHe is currently studying economics at the University of Patras in Greece, though most of his time is spent in front of a computer in his home studio. dousk has also produced music for radio and TV ads during the past two years.  <a href=\"https://www.last.fm/music/Dousk\">Read more on Last.fm</a>'),('DR Big Band',NULL,NULL,NULL),('Dr. Dog',36049435,1732807,'Dr. Dog is a indie rock group from Philadelphia, Pennsylvania which formed in 1999. The current lineup consists of Scott \"Taxi\" McMicken (vocals, guitar), Toby \"Tables\" Leaman (vocals, bass),  Zach \"Text\" Miller (keyboards, guitar), Frank \"Thanks\" McElroy (guitar) and Eric \"Teach\" Slick (drums).\r\n\r\n\"There\'s a little folk, blues, indie rock, soul, bluegrass--and a whole lot of down-home harmonizing. It conjures images of old friends sitting on a porch swapping instruments and just letting the tape recorder run.\" - Doug Wallen <a href=\"https://www.last.fm/music/Dr.+Dog\">Read more on Last.fm</a>'),('Dragon & Caballero',120630,16457,' <a href=\"https://www.last.fm/music/Dragon+&+Caballero\">Read more on Last.fm</a>'),('Drizabone Soul Family',NULL,NULL,NULL),('Du Nord',11481,3681,' <a href=\"https://www.last.fm/music/du+nord\">Read more on Last.fm</a>'),('Dua Lipa',306411477,3141325,'Dua Lipa (born 22 August 1995) is an English, Albanian, and Kosovar singer, songwriter and actress. She began her career as a model before signing with Warner Bros. Records in 2014. Her self-titled debut studio album was released in 2017 and peaked at number three on the UK Albums Chart. The album included the singles \"Be the One\", \"IDGAF\", and the UK number-one single \"New Rules\". In 2018, she received Brit Awards for British Female Solo Artist and British Breakthrough Act. <a href=\"https://www.last.fm/music/Dua+Lipa\">Read more on Last.fm</a>'),('Dualbox',NULL,NULL,NULL),('Duan Wasi',NULL,NULL,NULL),('Duki',39815351,283554,'Mauro Ezequiel Lombardo Quiroga, conocido artísticamente como Duki, es uno de los artistas más influyentes y populares en la escena del trap y la música urbana en Argentina y América Latina. Nació el 24 de junio de 1996 en Almagro, Buenos Aires.\r\n\r\nInicios en la música\r\n\r\nDuki empezó a ganar notoriedad en la escena del freestyle argentino, particularmente en la competencia \"El Quinto Escalón\", junto a otros artistas emergentes como Ysy A y Neo Pistea. <a href=\"https://www.last.fm/music/Duki\">Read more on Last.fm</a>'),('Dumpstaphunk',260046,46256,'Dumpstaphunk is a New Orleans funk band formed in 2002 and fronted by Ivan Neville. \n\nNeville, a multi-instrumentalist, singer and songwriter, is the son of Aaron Neville and nephew to members of the Neville Brothers.\n\nAbout Dumpstaphunk\n\nA decade evolved from their debut at 2003′s New Orleans Jazz & Heritage Festival, Dumpstaphunk offers fans an unforgettable live experience steeped in the Big Easy tradition of a good time. The quintet features Ivan Neville on vocals <a href=\"https://www.last.fm/music/Dumpstaphunk\">Read more on Last.fm</a>'),('Dverso',2013,297,' <a href=\"https://www.last.fm/music/DVERSO\">Read more on Last.fm</a>'),('DYGO',1149060,103605,' <a href=\"https://www.last.fm/music/Dygo\">Read more on Last.fm</a>'),('Dyland & Lenny',563374,78656,'Dyland (Carlos Castillo Cruz) & Lenny (Julio Manuel González Tavarez), originally from Puerto Rico, have formed a duo that is shaping up to be a true surprise in urban music. Dyland & Lenny  come to the genre with another vision, with a sound that reflects the youth that characterizes them and the feeling of a whole generation.\r\n\r\nIn early 2010, fans of urban music and other styles that came from the streets, will find the original and innovative rhythms of Dyland & Lenny in their debut CD, My World. <a href=\"https://www.last.fm/music/Dyland+&+Lenny\">Read more on Last.fm</a>'),('Eamon',1985320,335666,'There are at least two artists named Eamon\n\n1. Staten Island vocalist Eamon appeared in late 2003, when his bold single \"F**k It \" took urban radio by storm. With its spare melody and stripped-down production — not to mention its profanity-laced dismissal of a two-timing lover — the song stood out immediately, and blew up request lines nationwide. Jive jumped on the fervor, fast-tracking a video for \"F**k It,\" and slating a full-length LP for January \'04. <a href=\"https://www.last.fm/music/Eamon\">Read more on Last.fm</a>'),('Earth, Wind & Fire',46411748,2839946,'Earth, Wind & Fire (EW&F or EWF) is an American band whose music spans the genres of jazz, R&B, soul, funk, disco, pop, Latin, and Afro-pop. They are among the best-selling bands of all time, with sales of over 90 million records worldwide. The band was formed in Chicago by Maurice White in 1969, growing out of the Salty Peppers. Prominent members have included Verdine White, Philip Bailey, Ralph Johnson, Larry Dunn, Al McKay, Roland Bautista, Robert Brookins, Sonny Emory, Fred Ravel, Ronnie Laws, Sheldon Reynolds, and Andrew Woolfolk. <a href=\"https://www.last.fm/music/Earth,+Wind+&+Fire\">Read more on Last.fm</a>'),('Eddy Mendez',138,73,' <a href=\"https://www.last.fm/music/Eddy+Mendez\">Read more on Last.fm</a>'),('Ekathé',NULL,NULL,NULL),('El Arrebato',586918,63347,'Javier Labandón, más conocido por su nombre artístico El Arrebato, es un cantautor español de rumba-pop y flamenco.\r\n\r\nComenzó su carrera artística sobre 1985 y su carrera discográfica en 1988 sacando su primer disco con el grupo Piel morena en el que le acompañaban 2 grandes amigos de su Sevilla natal . Con ellos cosechó sus primeros éxitos hasta el 8 de septiembre de 1998, cuando Piel Morena se disolvió definitivamente tras varios cambios en la formación. <a href=\"https://www.last.fm/music/El+Arrebato\">Read more on Last.fm</a>'),('El Bogueto',3104247,141532,'Armando Antonio Toledo Rosas (Nezahualcóyotl, 27 de diciembre de 1997) conocido artísticamente como El Bogueto es un cantante y compositor mexicano de reguetón.\r\n\r\nEl artista fue influenciado por Almighty, Héctor & Tito, Daddy Yankee, Tego Calderón, Don Omar, Nicky Jam y Plan B en su carrera. <a href=\"https://www.last.fm/music/El+BOGUETO\">Read more on Last.fm</a>'),('El Clooy',81126,7945,' <a href=\"https://www.last.fm/music/El+Clooy\">Read more on Last.fm</a>'),('El Guincho',4354988,211511,'El Guincho is Pablo Díaz-Reixa, a native of Las Palmas de Gran Canaria living in Barcelona, Spain. Also a member of Coconot, Díaz-Reixa rose to prominence with his 2007 album, Alegranza. His musical style relies heavily on the use of sampling and incorporates elements of Afrobeat, dub, Tropicália and Rock. <a href=\"https://www.last.fm/music/El+Guincho\">Read more on Last.fm</a>'),('El Joey',10381,1457,' <a href=\"https://www.last.fm/music/El+Joey\">Read more on Last.fm</a>'),('El Predicador',12489,2278,' <a href=\"https://www.last.fm/music/El+Predicador\">Read more on Last.fm</a>'),('Eladio Carrion',32436548,377749,'Eladio Carrion (14 de noviembre de 1994) Cantante y personalidad de Internet. Nació en Kansas, Estados Unidos. Se le conoció en redes por sus vídeos cómicos. Antes de lanzarse como solista trabajo como compositor y colaborador de otros artistas. Algunos de sus éxitos pre-debut fueron 2×2 con Flowsito y No quiero más amigos nuevos con Rawenz. Finalmente debutó en 2017 con Me enamoré de una Yal, tema al que siguieron Si tú te vas, Mi Cubana y Ave María, entre otros. <a href=\"https://www.last.fm/music/Eladio+Carrion\">Read more on Last.fm</a>'),('ELENA ROSE',757500,81711,'Andrea Elena Mangiamarchi (Miami, 23 de marzo de 1995),1​ conocida por su nombre artístico Elena Rose, es una cantante, productora y compositora estadounidense-venezolana. Ha trabajado conBecky G, Rauw Alejandro, TINI, CNCO, Selena Gomez, Sech, entre otros. Su sencillo « Caracas en el 2000» junto a Danny Ocean y Jerry Di, alcanzó el puesto #3 en Spotify Venezuela. <a href=\"https://www.last.fm/music/Elena+Rose\">Read more on Last.fm</a>'),('Elikai',11660,1123,' <a href=\"https://www.last.fm/music/Elikai\">Read more on Last.fm</a>'),('Elniko Arias',5005,1180,' <a href=\"https://www.last.fm/music/Elniko+Arias\">Read more on Last.fm</a>'),('Eloy',5197678,342025,'Eloy is a progressive rock band from Germany, whose musical style includes symphonic and space rock, the latter being more prevalent on earlier albums. The band took their name from the Eloi, a futuristic race of people in the H.G. Wells novel The Time Machine.\r\n\r\nFounded in 1969 by guitarist Frank Bornemann, the band has endured several line-up changes, with Bornemann being the only consistent member. In the 1980s, after a series of major splits in the group (which disbanded in 1984 and reformed in 1988) <a href=\"https://www.last.fm/music/Eloy\">Read more on Last.fm</a>'),('Ely Bruna',NULL,NULL,NULL),('Embusteros',31764,2768,' <a href=\"https://www.last.fm/music/Embusteros\">Read more on Last.fm</a>'),('EMEKA',23244,2314,' <a href=\"https://www.last.fm/music/Emeka\">Read more on Last.fm</a>'),('Emile Londonien',NULL,NULL,NULL),('Emilia',17311956,481068,'María Emilia Mernes, better known as Emilia, is an Argentine singer, actress and model born on October 29, 1996 in the town of Nogoyá, Entre Ríos.\r\n\r\nFrom a very young age she showed a great interest in music, participating in local events and contests. In 2016, Emilia, along with Fer Vázquez, joined the Uruguayan cumbia pop group, Rombai, thus making a place for herself on the scene. She decided in 2018 to leave the group to launch her solo career. <a href=\"https://www.last.fm/music/Emilia\">Read more on Last.fm</a>'),('Emilie-Claire Barlow',NULL,NULL,NULL),('Emily Has Fallen',11494,660,' <a href=\"https://www.last.fm/music/Emily+Has+Fallen\">Read more on Last.fm</a>'),('Emma Smith',NULL,NULL,NULL),('Enol',447560,14145,' <a href=\"https://www.last.fm/music/Enol\">Read more on Last.fm</a>'),('Enrique Iglesias',52170589,2616158,'Enrique Miguel Iglesias Preysler (born 8 May 1975) is a Spanish singer and songwriter. He started his recording career in the mid-1990s on the Mexican label Fonovisa and became the bestselling Spanish-language act of the decade. By the turn of the millennium, he made a successful crossover into the mainstream English-language market. He signed a multi-album deal with Universal Music Group for US$68 million with Universal Music Latino to release his Spanish albums and Interscope Records to release English albums. <a href=\"https://www.last.fm/music/Enrique+Iglesias\">Read more on Last.fm</a>'),('Eric Clapton',NULL,NULL,NULL),('Eru Flow Flame',31182,5501,' <a href=\"https://www.last.fm/music/Eru+Flow+Flame\">Read more on Last.fm</a>'),('Erwin Do',NULL,NULL,NULL),('Esteman',3506690,172215,'www.esteman.com\r\n\r\nEsteban Mateus Williamson, better known as Esteman (born May 4, 1984) is a Colombian singer and songwriter.\r\nEsteman has been developing his interest in music since the age of 12, as he attended several music and theatre academies, acting classes and college education in Electronic Media Arts. At a prodigiously young age Esteman started writing songs and school plays involving musical theatre for his elementary school and ever since, writing and performing has become one of his favorites activities. <a href=\"https://www.last.fm/music/Esteman\">Read more on Last.fm</a>'),('Estopa',8667868,304325,'Estopa is a pop/flamenco duo founded in 1999 by brothers José and David Muñoz of Cornellà de Llobregat (Baix Llobregat), Catalonia. Their first album, Estopa, has sold well over 1,000,000 copies to date (the equivalent of an American platinum album) and their latest, Voces de Ultrarumba, sold more than 200,000 copies on its first day of release. Their playful, Rumba-tinged compositions have made them one of the most successful pop groups in Spanish history, in terms of both album sales and critical acclaim. <a href=\"https://www.last.fm/music/Estopa\">Read more on Last.fm</a>'),('Eternxlkz',5238629,311433,'Nurbek Myssiyev, professionally known as Eternxlkz (or \'Eternal\'), is an electronic producer from Kazakhstan most known for his chill/atmospheric Brazilfunk works, his most notable examples being the likes of \"SLAY!\", \"BRODYAGA FUNK\", & \"ENOUGH!\". His unique style has reached multiple Billboard and Shazam charting positions, and he is among the leading figures of the Brazilfunk movement. <a href=\"https://www.last.fm/music/Eternxlkz\">Read more on Last.fm</a>'),('Eumir Deodato',NULL,NULL,NULL),('Eve St. Jones',NULL,NULL,NULL),('Expulsados',285204,9823,'Expulsados are an Argentine punk rock band from Banfield, Buenos Aires. The band\'s original line-up was composed of lead singer Sebastián (who is the only original member left), guitarist Miguel Montiel, bassist Juan Novoa, and drummer Guillermo Beatriche. Their first show was on May 25, 1993 at Paideia High School in Temperley. Expulsados have released seven studio albums.\r\n\r\nLike the Ramones, each band member uses the same last name, in this case \"Explusado\". <a href=\"https://www.last.fm/music/Expulsados\">Read more on Last.fm</a>'),('Éxtasis',10028,1883,' <a href=\"https://www.last.fm/music/%C3%89xtasis\">Read more on Last.fm</a>'),('Eze Remix',213566,22289,' <a href=\"https://www.last.fm/music/Eze+Remix\">Read more on Last.fm</a>'),('Ezra Collective',NULL,NULL,NULL),('Fabrices',9974,2659,' <a href=\"https://www.last.fm/music/Fabrices\">Read more on Last.fm</a>'),('Falco',12267958,826091,'Johann \"Hans\" Hölzel (19 February 1957 – 6 February 1998), better known by his stage name Falco (from Falko Weißpflog), was an Austrian singer and musician. He had several international hits, including \"Der Kommissar\" (1981), \"Rock Me Amadeus\", \"Vienna Calling\", \"Jeanny\", \"The Sound of Musik\", \"Coming Home (Jeanny Part II, One Year Later)\", and posthumously \"Out of the Dark\".\r\n\r\n\"Rock Me Amadeus\" reached No. 1 on the Billboard charts in 1986, making <a href=\"https://www.last.fm/music/Falco\">Read more on Last.fm</a>'),('Fall Out Boy',400349097,4913347,'Fall Out Boy is a pop punk band formed in 2001 in Wilmette, Illinois after good friends Joe Trohman and Pete Wentz met high schooler Patrick Stump. Stump originally auditioned as a drummer, but soon became the lead singer. The following year, the band debuted with a self-released demo and followed it up with the May 28, 2002 release of Split EP, which featured Project Rocket, on Uprising Records. The group released a mini-LP, Evening Out With Your Girlfriend, also on Uprising Records, in 2003. <a href=\"https://www.last.fm/music/Fall+Out+Boy\">Read more on Last.fm</a>'),('Falling In Reverse',65060770,1302663,'Falling in Reverse is an American rock band based in Las Vegas, Nevada and formed in 2008, signed to Epitaph Records. The band is led currently by vocalist Ronnie Radke alongside guitarists Christian Thompson and Marc Okubo, bassist Daniel \"DL\" Laskiewicz and drummer Luke Holland.\r\n\r\nIn 2008, lead singer Ronnie Radke was involved in an altercation in Las Vegas that resulted in the fatal shooting of 18-year-old Michael Cook. While Radke did not shoot Cook, he was indicted on battery charges. <a href=\"https://www.last.fm/music/Falling+in+Reverse\">Read more on Last.fm</a>'),('Fangoria',3500007,105884,'Fangoria is an electro-pop band from Madrid, Spain, the brainchild of Alaska and Nacho Canut. In 1977 Alaska, along with Nacho Canut and Carlos Berlanga formed the band Alaska y los Pegamoides. Later, in 1982, they changed the name to Alaska y Dinarama. In 1989 Carlos Berlanga left, and the band transformed once again, this time adopting the name of the American horror film magazine Fangoria — they had already made clear their fascination with US <a href=\"https://www.last.fm/music/Fangoria\">Read more on Last.fm</a>'),('Fannel',1439,449,' <a href=\"https://www.last.fm/music/Fannel\">Read more on Last.fm</a>'),('Fanny Lu',1653818,160678,'Actress and musician Fanny Lú was born in Cali, Colombia, where she attended the Bolivar High School before moving to France to finish her primary education. Upon returning to Latin America, she studied at the University of the Andes, graduating with a degree in industrial engineering. While still in college, Lú maintained a television career, beginning in 1994 as a presenter on the popular show Locomotora. Her experience on the show gave her countless opportunities to work around musicians and even make forays into production work <a href=\"https://www.last.fm/music/+noredirect/Fanny+Lu\">Read more on Last.fm</a>'),('Far East Movement',23790396,2124534,'The Far East Movement (also known as FM), hailing from the clubs and streets of Los Angeles, California, United States, are one of the freshest crews representing the next generation of artists and “fly music.” Members Kev Nish, Prohgress, J-Splif, and DJ Virman have created a huge industry buzz with major companies, radio stations, and club DJs worldwide through their international appeal and energetic live shows. \r\n\r\nFinding their inspiration from the diverse city blocks and night club scene of Southern California <a href=\"https://www.last.fm/music/Far+East+Movement\">Read more on Last.fm</a>'),('Farruko',10398638,772913,'Farruko is a reggaeton and Latin pop singer from Puerto Rico. His given name is Carlos Efren Reyes, and he was born in Bayamon, Puerto Rico in 1991. At the age of 16, he began to post his songs under his stage name to MySpace. His first single, \"Sexo Fuera del Planeta,\" gained thousands of followers, and from there he explored the potential of other social media networks. Due to his massive success on the Internet, he came to the attention of Puerto Rican radio and music industry executives, who enlisted his vocal talents for other artists. <a href=\"https://www.last.fm/music/Farruko\">Read more on Last.fm</a>'),('Feid',54694703,605010,'Salomón Villada Hoyos, also known as Ferxxo or Feid, is a prominent Colombian singer and songwriter in urban music. Born on August 19, 1992, in Medellín, Colombia, he developed a passion for music from a young age and participated in music extension courses with his parents. Starting with the clarinet, he later shifted his focus to his voice and became a member of the University of Antioquia choir.\r\n\r\nSince 2015, Feid has dedicated himself to singing and songwriting <a href=\"https://www.last.fm/music/Feid\">Read more on Last.fm</a>'),('Felipe Conde',4386,733,' <a href=\"https://www.last.fm/music/Felipe+Conde\">Read more on Last.fm</a>'),('Felipe Peláez',339584,39145,' <a href=\"https://www.last.fm/music/+noredirect/Felipe+Pel%C3%A1ez\">Read more on Last.fm</a>'),('Fernando Rey',710,70,' <a href=\"https://www.last.fm/music/Fernando+Rey\">Read more on Last.fm</a>'),('Fi-Asko',20018,2047,'PUNK band started in 1999 by 5 young musicians who lived (and live still) in Sarrià de Ter, Catalonia (Spain). Since then they have recorded 4 albums with very high quality sound and production. Their lyrics doesn´t deal about \"chaos\", \"disorder\" or \"nihilism\" but totally the opposite: anarchism, animal rights, feminism, etc. Apart music, they are also the libertarian collective  \"Apaga la TV\".\r\nhttp://fi-asko.bandcamp.com/\r\nhttps://myspace.com/fiaskosarri <a href=\"https://www.last.fm/music/Fi-asko\">Read more on Last.fm</a>'),('Fidel Nadal',650577,64839,'Descendant of slaves from Angola Fidel started in music in the middle 80\'s listening to singers such as Peter Tosh,Bob Marley,Skatalites,...\r\n\r\nHe formed Todos Tus Muertos a band that mixed reggae,ska and punk. He has edited six lp\'s with them. After Todos Tus Muertos he also formed part of Lumumba. \r\n\r\nIn the year 2000 he started a single career as singer and producer. <a href=\"https://www.last.fm/music/Fidel+Nadal\">Read more on Last.fm</a>'),('Figa Flawas',612832,16645,'Figa Flawas és un grup de música català originari de Valls (Alt Camp) que combina sons llatins i reggaeton amb sons més urbans. Està format per Pep Velasco i Xavier Cartanyà. L\'estiu del 2020 van publicar el seu primer single a Youtube titulat 100graus, el qual apostava pel reggaeton en català i lletres plenament estivals. Es van iniciar en els escenaris en la Festa Major de Valls de 2021, compartint cartell amb bandes com Zoo, la Pegatina i Stay Homas, entre d\'altres. <a href=\"https://www.last.fm/music/Figa+Flawas\">Read more on Last.fm</a>'),('Filarmónica União Sertaginense',41,5,' <a href=\"https://www.last.fm/music/Filarm%C3%B3nica+Uni%C3%A3o+Sertaginense\">Read more on Last.fm</a>'),('FIRZA',8952,2087,' <a href=\"https://www.last.fm/music/Firza\">Read more on Last.fm</a>'),('Floorplan',562306,73996,'Floorplan is the father-daughter duo of Robert & Lyric Hood who have re-positioned the euphoric feel of gospel into their disco, funk and soul styled house across the world’s dancefloors.\n\nTheir latest album ‘Victorious’, the second Floorplan album that fell hot on the heels of the hit single ‘Music/Tell You No Lie’, was released in June 2016 on Robert Hood’s own M-Plant imprint. The album is the follow up to 2013’s ‘Paradise’ which spawned ‘Let’s Ride, ‘Baby Baby’ and the massive ‘Never Grow Old’. <a href=\"https://www.last.fm/music/Floorplan\">Read more on Last.fm</a>'),('FloyyMenor',15541381,646718,'Alan Felipe Galleguillos, known professionally as FloyyMenor, is a Chilean singer and songwriter. After self-releasing singles since 2022, he eventually gained international prominence with his hit single \"Gata Only\" with Cris MJ, where he released it through UnitedMasters. <a href=\"https://www.last.fm/music/FloyyMenor\">Read more on Last.fm</a>'),('Foals',109686793,2103167,'Foals are a rock band which formed in Oxford, England in 2005.  The band consists of Yannis Philippakis (vocals, guitar), Jimmy Smith (guitar), Walter Gervers (bass) and Jack Bevan (drums). The band has released seven albums: \"Antidotes\" (2008), \"Total Life Forever\" (2010), \"Holy Fire\" (2013), \"What Went Down\" (2015), \"Everything Not Saved Will Be Lost, Pt. 1\" (2019) , \"Everything Not Saved Will Be Lost, Pt. 2\" (2019), and \"Life is Yours\" (2022). In January 2018, it was announced that Walter Gervers (bass) was leaving the band. <a href=\"https://www.last.fm/music/Foals\">Read more on Last.fm</a>'),('Fondo Flamenco',809154,61437,'Fonco Flamenco is a group from Sevilla, Spain composed by Astola, Antonio and Rafael. The group started with Astola and Rafael at their early age of 13. Antonio came later on. Astola writes and composes the songs for the group. He is also the one credited for the idea of naming the group Fondo Flamenco. The name came as result of a comment that he made to Rafael while they were taking pictures of themselves in a tipical sevillian courtyard and he told Rafael \"Let\'s take a picture of us with this flamenco backgroung (fondo flamenco)\". <a href=\"https://www.last.fm/music/Fondo+Flamenco\">Read more on Last.fm</a>'),('Fourplay',NULL,NULL,NULL),('Foxy Shazam',6392051,228807,'Foxy Shazam is an American rock band from Cincinnati, Ohio, formed in 2004. The band consists of lead vocalist Eric Nally, guitarist Loren Turner, pianist Sky White, and bass player Daisy. After forming the band immediately recorded The Flamingo Trigger independently, then committed to an extensive national touring regimen. Shortly there after Foxy signed with Ferret Records and recorded their second album, Introducing Foxy Shazam, which was produced by Casey Bates (Chiodos, Portugal. <a href=\"https://www.last.fm/music/Foxy+Shazam\">Read more on Last.fm</a>'),('Fran C',552101,24929,' <a href=\"https://www.last.fm/music/Fran+C\">Read more on Last.fm</a>'),('Fran Morin',0,0,NULL),('Francesco Demegni',NULL,NULL,NULL),('Franck Roger',169390,37681,'DJ since 13 years now and producer since 7 years Franck Roger has fully understood that making music and spread\nworldwide the House Music message is the most important thing in his life...\n\nIndeed, Franck has multiplied the releases on labels as prestigious and well respected on the international scene as Kenlou (Kenny Dope and Louie Vega / USA) Versatile (Dj Gilb\'r / France), Crash (Dino & Terry / Canada), Flowers (Japan), Needs (Germany), BBE (UK), Defected rds, Sole Channel, King Street,Especial (Japan), Spacekat (UK). <a href=\"https://www.last.fm/music/Franck+Roger\">Read more on Last.fm</a>'),('Frank Mercer',NULL,NULL,NULL),('Freak Da Funk',932,251,' <a href=\"https://www.last.fm/music/Freak+da+Funk\">Read more on Last.fm</a>'),('Fred Wesley',265350,47125,'Fred Wesley (born 1943) is an American jazz and funk trombonist, best known for his work with James Brown in the 1960s and 1970s.\n\nWesley was born in Mobile, Alabama, the son of a high school teacher and big band leader. During the 1960s and 1970s he was a pivotal member of James Brown\'s bands, playing on many hit recordings including \"Say it Loud - I\'m Black and I\'m Proud\", \"Mother Popcorn\" and co-writing tunes such as \"Hot Pants\". His slippery riffs and pungent <a href=\"https://www.last.fm/music/Fred+Wesley\">Read more on Last.fm</a>'),('FreeTEMPO',NULL,NULL,NULL),('Fuego',2334628,239341,'There are several artists with this name:\r\n---\r\n1) Miguel Duran:\r\nHearing the sounds of his father\'s instrumental harmonies and melodic tunes before his birth would only make it natural for Miguel Duran to bear the innate ability to follow in his own father\'s footsteps as a musician. On September 24th, 1981 in Washington DC, Miguel Duran was born. His father would make it a point to teach Miguel everything he knew about music. He knew it wouldn\'t be an easy task to raise a kid in a cruel harsh world <a href=\"https://www.last.fm/music/Fuego\">Read more on Last.fm</a>'),('Fuerza Regida',35616320,504157,'\r\nFuerza Regida are a media-savvy, chart-topping Mexican regional quartet. They are progenitors of the \"requinto urbano\" style, alongside their Rancho Humilde labelmates Legado 7. This is acoustic music played in rural style with gritty urban lyrics. Their narrative folk-ballad approach, with acoustic guitars and lead and harmony vocals and brass, has played an iconic role in the Mexican cultural canon since the early 19th century, but Fuerza Regida\'s topics focus on the hardships, the bawdy joys, and the sufferings of the city streets. <a href=\"https://www.last.fm/music/Fuerza+Regida\">Read more on Last.fm</a>'),('Fun Lovin\' Criminals',7428242,537165,'Fun Lovin\' Criminals are an American rap rock band from New York City. They are best known for the song \"Scooby Snacks\", which includes samples from Quentin Tarantino films, and \"Love Unlimited\", which references the vocal group associated with Barry White. The band\'s lyrics frequently center on life in New York City and urban experiences more broadly, often addressing themes such as organized crime and urban violence. Their lyrical style ranges from gritty and existential to humorous and satirical. <a href=\"https://www.last.fm/music/Fun+Lovin%27+Criminals\">Read more on Last.fm</a>'),('Funk Amp',177,60,' <a href=\"https://www.last.fm/music/Funk+Amp\">Read more on Last.fm</a>'),('Funk Boutique',1374,311,' <a href=\"https://www.last.fm/music/+noredirect/Funk+Boutique\">Read more on Last.fm</a>'),('FUNK BREED',140,73,' <a href=\"https://www.last.fm/music/FUNK+BREED\">Read more on Last.fm</a>'),('Funk Cartel',34990,7693,' <a href=\"https://www.last.fm/music/Funk+CarteL\">Read more on Last.fm</a>'),('Funk Hit Band',827,258,' <a href=\"https://www.last.fm/music/Funk+Hit+Band\">Read more on Last.fm</a>'),('Funkadeluxe',2623,999,' <a href=\"https://www.last.fm/music/Funkadeluxe\">Read more on Last.fm</a>'),('Funkda',3541,644,' <a href=\"https://www.last.fm/music/Funkda\">Read more on Last.fm</a>'),('Funkerman',925745,190869,'http://www.facebook.com/funkerman\nhttp://www.youtube.com/funkermantube/  \n\nFunkerman, known to his postman as Ardie van Beek, (born 1975, Breda, The Netherlands), is a well known DJ/producer and founder of Flamingo Recordings.\n\nFrom his first love of pioneering US hip hop, through obsessive crate digging for classic soul, Disco and Funk, to riding on the first waves of US house; he has always been on a quest to find, make and play new and exciting music.   <a href=\"https://www.last.fm/music/Funkerman\">Read more on Last.fm</a>'),('Funki Porcini',6215705,536254,'Funki Porcini is composer and film maker James Braddell (a.k.a Giacomo Braddellini). His swirling mixtures of downtempo breaks, smooth ambiance, and disjointed drum\'n\'bass helped put the London-based Ninja Tune label on the map. His latest album is \"Modern Hymns for Modern Things\" (September 2025, self-release).\n\nFunki Porcini began making music in San Francisco when he moved into The Residents\' old warehouse. After much experimentation with early <a href=\"https://www.last.fm/music/Funki+Porcini\">Read more on Last.fm</a>'),('Funky 4 + 1',112,52,' <a href=\"https://www.last.fm/music/Funky+4+++1\">Read more on Last.fm</a>'),('Funky Bijou',56316,8626,' <a href=\"https://www.last.fm/music/Funky+Bijou\">Read more on Last.fm</a>'),('Funky DL',2122468,172955,'Back in 1995 a 17-year-old MC took to the hip-hop scene in the UK. Armed only with a few demos and oblivious of how to prosper in the music industry, little did he know he would end up being one of the few pioneers of hip-hop in the UK.\n\nFunky DL started earning props when his music received regular air play on stations such as Kiss FM, Choice FM and Radio one by the likes of veteran Jockeys such as DJ 279, Max LX and Dave VJ and Tim Westwood.\n\nIn <a href=\"https://www.last.fm/music/Funky+DL\">Read more on Last.fm</a>'),('Funky Harry',381,90,' <a href=\"https://www.last.fm/music/Funky+Harry\">Read more on Last.fm</a>'),('Funky Junction',11838,2396,'Back in 1972, Phil Lynott of Thin Lizzy made a tribute album to Deep Purple with Eric Bell, Brian Downey, Benny White and Dave Lennox. They called that project Funky Junction. <a href=\"https://www.last.fm/music/Funky+Junction\">Read more on Last.fm</a>'),('Funky Junction & KC Flightt',508,197,' <a href=\"https://www.last.fm/music/Funky+Junction+&+KC+Flightt\">Read more on Last.fm</a>'),('Funky Times',NULL,NULL,NULL),('Gabb.',NULL,NULL,NULL),('Gabrielle Chiararo',NULL,NULL,NULL),('Gaby Music',553323,61308,' <a href=\"https://www.last.fm/music/Gaby+Music\">Read more on Last.fm</a>'),('Garrafa Social',1495,288,' <a href=\"https://www.last.fm/music/Garrafa+Social\">Read more on Last.fm</a>'),('GATC',98230,16909,'“Same band, same sound, slightly new name. Gypsy & The Cat is back in a new incarnation, \'GATC\'. After 7 years, we have been in the studio recording new music together” <a href=\"https://www.last.fm/music/+noredirect/GATC\">Read more on Last.fm</a>'),('Gecko Turner',330446,63568,'Gecko Turner (Fernando Echave) was born and raised in the San Roque district of Badajoz, Spain, a town about halfway between Madrid and Lisbon, Portugal. As a teenager, he fell in love with The Beatles, Bob Dylan, and The Rolling Stones. The Stones led him back to Elmore James, Leadbelly, Muddy Waters, Jimmy Reed and other blues greats. He picked up his guitar in his teens and eventually formed a cover band that played an eclectic mix of American and British pop. <a href=\"https://www.last.fm/music/Gecko+Turner\">Read more on Last.fm</a>'),('Gentleman (DJ)',16153,2188,' <a href=\"https://www.last.fm/music/Gentleman+(DJ)\">Read more on Last.fm</a>'),('Geordie Greep',NULL,NULL,NULL),('George Benson',12807523,1108417,'George Benson is a jazz guitarist born in Pittsburgh, Pennsylvania, USA on 22 March 1943. He started out playing straight-ahead instrumental jazz with organist Jack McDuff. Benson got his first experience playing with his several-year stint with McDuff\'s group. In 1964, at the age of 21, Benson recorded his first album as leader, The New Boss Guitar, with Brother Jack McDuff on organ.\n\nBenson\'s next recording was It\'s Uptown with the George Benson Quartet with Lonnie Smith on organ and Ronnie Cuber on baritone sax. <a href=\"https://www.last.fm/music/George+Benson\">Read more on Last.fm</a>'),('George McCrae',1780733,328181,'George McCrae (born October 19, 1944) is a Soul and Disco singer. McCrae was born in West Palm Beach, Florida. He formed his own singing group, the Jivin\' Jets, before joining the United States Navy in 1963. Four years later, he reformed the group, with his wife Gwen joining the line-up, but soon afterwards they decided to work as a duo, recording for Henry Stone\'s Alston record label. Gwen then won a solo contract, with George acting as her manager as well as doing some singing on sessions and in clubs. <a href=\"https://www.last.fm/music/George+McCrae\">Read more on Last.fm</a>'),('George White Group',NULL,NULL,NULL),('Gerardo Ortiz',3062122,118664,'En los últimos meses, Gerardo Ortiz ha estremecido el mundo de la música regional mexicana con sus propuestas musicales y sus letras absolutamente innovadoras, pero también al imponer toda una moda entre los jóvenes.\r\n\r\nEste fenómeno musical nacido en Los Ángeles y criado en Sinaloa, está dejando boquiabierta a toda la industria de la música, al no solamente llenar sino además dejar gente fuera en todas sus presentaciones tanto en Estados Unidos como en México. <a href=\"https://www.last.fm/music/Gerardo+Ortiz\">Read more on Last.fm</a>'),('Ghinzu',3815962,139410,'Ghinzu is an Alternative rock band from Belgium. They were formed in 1999 by a group of musicians who had been on the Belgian rock scene for a number of years, named after a Japanese knife-brand. The current line-up consists of John Israel (also known as \"John Stargasm\") (vocals, keyboard), Mika Nagazaki (bass), Greg Remy (guitar), Antoine Michel (drums), Jean Waterlot (keyboard, guitar). Former members include Kris Dane (keyboard, guitar), Fabrice Georges (drums) and Sanderson Poe (contrabass). <a href=\"https://www.last.fm/music/Ghinzu\">Read more on Last.fm</a>'),('Ghost-Note',NULL,NULL,NULL),('Gianluigi Toso',4003,832,' <a href=\"https://www.last.fm/music/Gianluigi+Toso\">Read more on Last.fm</a>'),('Gloria Trevi',5246482,274810,'Gloria de los Ángeles Treviño Ruiz, known as Gloria Trevi is a Mexican singer, songwriter, dancer, actress, television hostess, music video director and businesswoman known as \"The Supreme Diva of Mexican Pop\". <a href=\"https://www.last.fm/music/Gloria+Trevi\">Read more on Last.fm</a>'),('Gold Record',1026,488,' <a href=\"https://www.last.fm/music/Gold+Record\">Read more on Last.fm</a>'),('Golden Ganga',198029,12708,'Golden Ganga es una banda de música Libre, con influencia principalmente en los géneros Reggae, Dancehall, Hip Hop, Rock, Ska fundada en el año 2006 por el cantautor Adan Nuñez en Zapopan Jalisco.\r\nDiscografía: Golden Ganga (2008), Música Libre (2012), Energía Libre (2014), Siempre Libre (2016).\r\nCon más de 1,500 shows en vivo, destaca por sus exitosas presentaciones llenas de energía en mas de 20 estados de la república mexicana y países como Estados Unidos, Costa Rica, Colombia, Argentina, Panamá. <a href=\"https://www.last.fm/music/Golden+Ganga\">Read more on Last.fm</a>'),('Goldfrapp',64247950,2072967,'Goldfrapp are an English electronic band from London, formed in 1999 which consists of Alison Goldfrapp (vocals, synthesizer) and Will Gregory (synthesizer). Despite favourable reviews and a short-listing for the Mercury Prize, the début studio album Felt Mountain did not chart highly. Goldfrapp\'s second album Black Cherry, which incorporated glam rock and synthpop sounds, was released in 2003. The album influenced the same dance-oriented sound of their third album Supernature. <a href=\"https://www.last.fm/music/Goldfrapp\">Read more on Last.fm</a>'),('Gønza',7538,2291,' <a href=\"https://www.last.fm/music/G%C3%B8nza\">Read more on Last.fm</a>'),('Gonzy',1294918,60373,' <a href=\"https://www.last.fm/music/Gonzy\">Read more on Last.fm</a>'),('Good Kid',26826615,529658,'Good Kid is a five-member indie rock band from Toronto, Ontario. The band consists of Nick Frosst as the lead vocalist, Jon Kereliuk as the drummer, Michael Kozakov as the bassist, and David Wood and Jacob Tsafatinos as guitarists. Their mascot, Nomu Kid, is prominently featured in their marketing and social media.\r\nThey released their first single, Nomu in October 2015, introducing Nomu Kid. Over the next few years, they released more singles, eventually releasing their debut EP - Good Kid - in June of 2018. <a href=\"https://www.last.fm/music/Good+Kid\">Read more on Last.fm</a>'),('Gorillaz',482769687,6653491,'Gorillaz is a British virtual band created in 1998 by musician Damon Albarn and artist Jamie Hewlett. The band currently consists of four animated members: Murdoc Niccals (bass guitar) who formed the band, 2-D (lead vocals, keyboards), Noodle (guitar, vocals) and Russel Hobbs (drums and percussion). Their fictional universe is explored through animated music videos, interviews and animated shorts. In reality, Albarn is the only permanent musical contributor and often collaborates with other musicians. <a href=\"https://www.last.fm/music/Gorillaz\">Read more on Last.fm</a>'),('Gotan Project',NULL,NULL,NULL),('Gracie Abrams',267895201,1714115,'Gracie Abrams (born September 7, 1999) is an American pop singer/songwriter from Los Angeles, California, and the daughter of the filmmaker and composer J.J. Abrams.\r\n\r\nAfter having only three tracks publically available on her Soundcloud (\'And She Will Miss You\', \'blue\', \'i kinda miss you\') Gracie released her first debut track \'Mean It\' along with an accompanying music video.\r\n\r\nShortly after, Gracie released two other songs, \'Stay\' and \'21\', the latter <a href=\"https://www.last.fm/music/Gracie+Abrams\">Read more on Last.fm</a>'),('Gramatik',NULL,NULL,NULL),('Greeicy',1961298,119968,'Greeicy Yeliana Rendón Ceballos (born 30 October 1992) is a Colombian actress and singer.\r\n\r\nShe remained in Cali for the first five years of her childhood, until her parents, Luis Alberto Rendón and Lucy Ceballos, decided to move to Bogota. Since she was a child, she has an interest in interpretation and music, and took classes in acting, piano, flute, guitar and singing.\r\n\r\nHer first participation in the screens, was in the 2007 edition of the reality show for talents children\'s Factor Xs <a href=\"https://www.last.fm/music/Greeicy\">Read more on Last.fm</a>'),('Green and Redd Duo',NULL,NULL,NULL),('Green Day',427045695,6410614,'Green Day is an American rock band formed in Rodeo, California, in 1987, by lead singer and guitarist Billie Joe Armstrong and bassist and backing vocalist Mike Dirnt, with drummer Tré Cool joining in 1990. The band’s major-label debut, \"Dookie,\" released through Reprise Records in 1994, achieved commercial success, eventually shipping over 20 million copies in the United States, and has been credited with renewing mainstream interest in punk rock. <a href=\"https://www.last.fm/music/Green+Day\">Read more on Last.fm</a>'),('Greg Spero',NULL,NULL,NULL),('Gregory Porter',NULL,NULL,NULL),('Groove Da Praia',NULL,NULL,NULL),('Groovy Waters',NULL,NULL,NULL),('Grupo Niche',3766721,268242,'Grupo Niche is one of the world\'s best known salsa and cumbia groups from Colombia and it enjoys great popularity throughout Latin America. It was formed in 1980 by Jairo Varela, who became producer, director, songwriter, vocalist and guiro player. It also included Nicolas Cristanelo, on the piano; Alexis Lozano, on the trombone; Francisco Garcia, on the bass; Luis Pacheco, on the congas; as well as vocalists Jorge Bassam and Hector Viveros.\r\n\r\nGrupo Niche\'s first album: \"Al Pasito\" was released that same year <a href=\"https://www.last.fm/music/Grupo+Niche\">Read more on Last.fm</a>'),('Gruuve',24217,5593,' <a href=\"https://www.last.fm/music/Gruuve\">Read more on Last.fm</a>'),('Guías y Scouts de Chile',763,73,' <a href=\"https://www.last.fm/music/Gu%C3%ADas+y+Scouts+de+Chile\">Read more on Last.fm</a>'),('Guitar Shorty',318863,43761,'There are two artists with the name \'Guitar Shorty\': \n1) Guitar Shorty was American blues guitarist, singer and songwriter David William Kearney  (born on 8 September 1934 ; died 20 April 2022) who was known for his explosive guitar style and wild stage antics. \n2) Guitar Shorty was American acoustic blues guitarist John Henry Fortescue (born on 24 January 1923; died 26 May 1976). \n\nI. Guitar Shorty (born David William Kearney on  8 September 1934 ; died 20 April 2022), was an American blues guitarist. <a href=\"https://www.last.fm/music/Guitar+Shorty\">Read more on Last.fm</a>'),('h6itam',1419150,94140,' <a href=\"https://www.last.fm/music/h6itam\">Read more on Last.fm</a>'),('Hank Mobley Quartet',10517,3049,' <a href=\"https://www.last.fm/music/+noredirect/Hank+Mobley+Quartet\">Read more on Last.fm</a>'),('Hans Ulrik',NULL,NULL,NULL),('Hard Forces',643,152,' <a href=\"https://www.last.fm/music/Hard+Forces\">Read more on Last.fm</a>'),('HawaiiHockey',NULL,NULL,NULL),('He Is We',7316507,457661,'He Is We is the solo project of singer/songwriter Rachel Taylor. Since 2020, Taylor has been releasing music on InVogue Records. Her first single was Amazing Grace, followed up in 2021 by three new singles, Treehouse, Finish Line and Frankenstein.  In February 2022, Taylor released her first album, Treehouse, as He Is We.\r\n\r\nInitially formed as an indie pop band in Tacoma, WA, the original line-up consisted of Taylor and Trevor Kelly. The band\'s first and only full length album, My Forever, was released November 2010. <a href=\"https://www.last.fm/music/He+Is+We\">Read more on Last.fm</a>'),('HE3 Project',4177,751,' <a href=\"https://www.last.fm/music/HE3+Project\">Read more on Last.fm</a>'),('Heaven Tracks Vibes',440,107,' <a href=\"https://www.last.fm/music/Heaven+Tracks+Vibes\">Read more on Last.fm</a>'),('Herbie Hancock',NULL,NULL,NULL),('Hernández Nos Ganó',218,14,' <a href=\"https://www.last.fm/music/Hern%C3%A1ndez+Nos+Gan%C3%B3\">Read more on Last.fm</a>'),('Heróis de Brinquedo',483,30,' <a href=\"https://www.last.fm/music/Her%C3%B3is+De+Brinquedo\">Read more on Last.fm</a>'),('Hidria Spacefolk',NULL,NULL,NULL),('Hippiehaus',85333,19085,' <a href=\"https://www.last.fm/music/Hippiehaus\">Read more on Last.fm</a>'),('Hiromasa Suzuki',NULL,NULL,NULL),('Hobo Bob',91,12,' <a href=\"https://www.last.fm/music/Hobo+Bob\">Read more on Last.fm</a>'),('Hod O\'Brien',3536,541,'Walter Howard \"Hod\" O\'Brien (January 19, 1936 in Chicago – November 20, 2016) was an American jazz pianist.\n\nO\'Brien attended The Hotchkiss School and then studied at the Oberlin Conservatory and at the Manhattan School of Music (1954–57). He began playing professionally in 1950, and substituted for Randy Weston in 1955. He led his own group in Lenox, Massachusetts during 1956–57, then joined Oscar Pettiford in 1957–58, and J.R. Monterose/Elvin Jones in 1958–59. <a href=\"https://www.last.fm/music/Hod+O%27brien\">Read more on Last.fm</a>'),('Homson',NULL,NULL,NULL),('Hoobastank',47384685,2827443,'Hoobastank (sometimes stylized as h∞bastank, and originally known as Hoobustank) is an American rock band formed in 1994 in Agoura Hills, California. The founding members include lead vocalist Doug Robb, guitarist Dan Estrin, drummer Chris Hesse, and original bassist Markku Lappalainen. The group initially began as a Talking Heads cover band.\r\n\r\nHoobastank was signed to Island Records from 2001 to 2012 and has released six studio albums and one extended play. <a href=\"https://www.last.fm/music/Hoobastank\">Read more on Last.fm</a>'),('Hot Toddy',329322,58451,'There are two artists with the name Hot Toddy.\n\n1. \"Hot Toddy\" is the solo moniker for Chris Todd, better known for my work with Crazy P formerly known as Crazy Penis, but has been writing music under the name of Hot Toddy since around 1998. His first releases were on the Nottingham based label Neon Heights and on  the Manchester based label, Paperecordings (the album \"Super Magic\", in 2001).  As Crazy P (at that time Crazy Penis) began to tour the <a href=\"https://www.last.fm/music/Hot+Toddy\">Read more on Last.fm</a>'),('Huntertones',NULL,NULL,NULL),('Ibiza Royal Drums',231,102,' <a href=\"https://www.last.fm/music/Ibiza+Royal+Drums\">Read more on Last.fm</a>'),('Ibrahim Maalouf',NULL,NULL,NULL),('ILYAA',313138,52095,' <a href=\"https://www.last.fm/music/ilyaA\">Read more on Last.fm</a>'),('Imagine Dragons',243334038,3947269,'Imagine Dragons is an American pop band formed in 2008, based in Las Vegas, Nevada. The band currently consists of lead singer Dan Reynolds, guitarist Wayne Sermon, and bassist Ben McKee. \r\n\r\nThey first gained exposure with the release of their single \"It\'s Time\", followed by their debut album Night Visions (2012), which resulted in the chart-topping singles \"Radioactive\" and \"Demons\". \r\n\r\nRolling Stone named \"Radioactive\", which held the record for most weeks charted on the Billboard Hot 100, the \"biggest rock hit of the year\". <a href=\"https://www.last.fm/music/Imagine+Dragons\">Read more on Last.fm</a>'),('Inaya Day',255089,55192,'Inaya Day (born Inaya Davis, January 17, 1977, New York) is an American singer. Inaya Day began singing in church as a young child, where she got her first experience in performing. She attended the prestigious High School of Music and the Performing Arts, and went on to study musical theater at the University of Bridgeport in Bridgeport, Connecticut. Day has also appeared on Broadway, notably as understudy to Stephanie Mills as \"Dorothy\" in The Wiz, and stepped into the lead role in Washington, D.C. and St. Louis, Missouri. <a href=\"https://www.last.fm/music/Inaya+Day\">Read more on Last.fm</a>'),('Incognito',NULL,NULL,NULL),('India Martinez',618854,52627,'Born in Córdoba, she started studying flamenco while she was just 5 under the guidance of teacher Nieves Camacho. The family moved to Roquetas de Mar (Almería) when she was 11 years old. She sang on the local fishing port area, becoming popular as \"La Niña del Puerto\". In 1998, at age 13, she took part in the children talent show Veo, Veo hosted by Teresa Rabal, reaching the Andalusian finals. She was offered a scholarship by the Fundación Cristina Heeren to learn flamenco in Seville. <a href=\"https://www.last.fm/music/India+Martinez\">Read more on Last.fm</a>'),('iñigo quintero',2566455,211642,'Íñigo Quintero Dolz del Castellar,​ más conocido por su nombre artístico Íñigo Quintero, es un cantante y compositor español. Se hizo popular con el tema \"Si no estás\" en 2023, alcanzando el número uno en las listas de España, Francia, Alemania, Austria, Países Bajos y Suiza, entre otros.\r\n​ Estudió en el Colegio de Fomento Peñarredonda de la capital coruñesa, vinculado al Opus Dei.​ Realiza sus estudios universitarios de Psicología y Magisterio en el Centro Universitario Villanueva (CUV) <a href=\"https://www.last.fm/music/i%C3%B1igo+quintero\">Read more on Last.fm</a>'),('INNA',21652144,1050316,'Inna, real name Elena Alexandra Apostoleanu, was born on 16 October, 1986, in Mangalia, Romania. Blessed with singing talent, she had been singing from a very early age. \r\nApostoleanu spent her childhood in the Romanian village Neptun. After graduating from high school, she started studying at Constanta University.\r\nAt October 12, 2008 Apostoleanu\'s first single Hot was released. This dance song immediately gained a #1 chart spot in eight different countries, only to continue this success in 2009 in rest of the world.  <a href=\"https://www.last.fm/music/Inna\">Read more on Last.fm</a>'),('INOHA',4437159,244768,' <a href=\"https://www.last.fm/music/INOHA\">Read more on Last.fm</a>'),('Irma Neumüller',NULL,NULL,NULL),('Irokz',1418030,89671,' <a href=\"https://www.last.fm/music/Irokz\">Read more on Last.fm</a>'),('Isaac Hayes',8742475,969504,'Isaac Lee Hayes (August 20, 1942 – August 10, 2008) was a trailblazing soul singer, songwriter, composer, musician, producer, and actor whose groundbreaking contributions left an indelible mark on music and culture. Born in Covington, Tennessee, Hayes was raised by his grandparents in Memphis after the loss of his parents. From an early age, he showcased musical talent, singing in church choirs and mastering instruments such as the piano and saxophone. <a href=\"https://www.last.fm/music/Isaac+Hayes\">Read more on Last.fm</a>'),('Itty Bitty',2492,1130,' <a href=\"https://www.last.fm/music/ITTY+BITTY\">Read more on Last.fm</a>'),('Iván Troyano',2833,583,' <a href=\"https://www.last.fm/music/Iv%C3%A1n+Troyano\">Read more on Last.fm</a>'),('Ivy Queen',2445212,293598,'Ivy Queen (born Martha Ivelisse Pesante on March 4, 1972 in Añasco, Puerto Rico) is a composer and singer known as \"La Diva\", \"La Gata\", \"La Caballota\", and \"La Reina del Reggaeton\", \"The Queen of Reggaeton\". Ivy\'s third album \"Diva\", was released in 2003. The songs were originally written by her and performed with the participation of various artists.\r\n\r\nAt a young age Ivy\'s parents moved to New York where she was raised. When she was in her teens, her parents returned to their hometown, Añasco. <a href=\"https://www.last.fm/music/Ivy+Queen\">Read more on Last.fm</a>'),('iZaak',1631145,71807,'Isaac Ortiz , mejor conocido como por su nombre artístico es iZaak, es un joven cantante y compositor boricua oriundo de Gurabo, Puerto Rico. Nació en el 1992. Ortiz comenzó a los tres (3) años a cantar en la Iglesia, ahí fue cuando descubrió su gran pasión por la música. <a href=\"https://www.last.fm/music/Izaak\">Read more on Last.fm</a>'),('IZAL',2990503,64907,'In 2010, with more than 10 years of experience behind them, five musicians came together to form IZAL. A band made up of Mikel Izal (vocals, composer, guitar, ukulele), Emanuel Pérez “Gato” (bass), Alejandro Jordá (drums and percussion), Alberto Pérez (guitar, Lap Steel) and Iván Mella (piano, keyboards, synthesizers ). Coming from different geographical locations, Madrid became their \"base\" of operations, which is why the name \"Madrid band\" has been highly honored since its inception, despite not being originally from the capital. <a href=\"https://www.last.fm/music/Izal\">Read more on Last.fm</a>'),('Izumi Kimura',794,141,' <a href=\"https://www.last.fm/music/Izumi+Kimura\">Read more on Last.fm</a>'),('J Abdiel',1295191,69955,' <a href=\"https://www.last.fm/music/J+Abdiel\">Read more on Last.fm</a>'),('J Alvarez',3271240,210726,'Javid David Alvarez Fernandez conocido en el mundo artistico como “J Alvarez”, nacio en Rio Piedras, Puerto Rico un 13 de Diciembre del 1983. Su inspiracion en la musica comenzo en el hip-hop en ingles, en grupos tales como \"A Tribe Called Quest\", “Q-Tip”, \"Busta Rhymes\", entre otros. Todavia no era ni adolecente cuando a los 12 años se atravio a coger un microfono y canto por primera vez en la escuela Luis Muñoz Marin frente a varios estudiantes y profesores. <a href=\"https://www.last.fm/music/J+Alvarez\">Read more on Last.fm</a>'),('J Balvin',59331463,1671097,'José Álvaro Osorio Balvin (born May 7, 1985), known professionally as J Balvin, is a Colombian reggaeton singer. Balvin was born in Medellín, Colombia, where he became interested in music at a young age. At age 17, he moved to the United States and learned English, which influenced the music he would make later. He then returned to Medellín and gained local popularity by performing at various clubs around the city.\r\n\r\nThough his music is primarily reggaeton <a href=\"https://www.last.fm/music/J+Balvin\">Read more on Last.fm</a>'),('J.A.M',NULL,NULL,NULL),('J&M Brothers',4969,1475,' <a href=\"https://www.last.fm/music/J&M+Brothers\">Read more on Last.fm</a>'),('Jaared',NULL,NULL,NULL),('Jacinto',155689,13300,' <a href=\"https://www.last.fm/music/Jacinto\">Read more on Last.fm</a>'),('Jack DeJohnette',NULL,NULL,NULL),('Jack Jezzro',NULL,NULL,NULL),('Jack Lee',NULL,NULL,NULL),('Jackson Browne',14361270,1044797,'Jackson Browne (born Clyde Jackson Browne; October 9, 1948) is an American singer and songwriter. First coming to prominence in the 70s, the rock musician has had a long career and was inducted into the Rock and Roll Hall of Fame in 2004. \r\n\r\nBrowne was born in Heidelberg, Germany, where American serviceman father was stationed. Browne moved to the Highland Park district of Los Angeles, California at an early age and soon began singing folk music locally. In 1966, his major career began as a part of The Nitty Gritty Dirt Band. <a href=\"https://www.last.fm/music/Jackson+Browne\">Read more on Last.fm</a>'),('Jaga Jazzist',NULL,NULL,NULL),('Jaime Cuadra',NULL,NULL,NULL),('Jakob München',NULL,NULL,NULL),('James Brown',36604163,2358140,'James Joseph Brown (May 3, 1933 – December 25, 2006) was an American entertainer, record producer, and bandleader. The central progenitor of funk music and a major figure of 20th century music, he is often referred to by the honorific nicknames \"the Hardest Working Man in Show Business\", \"Godfather of Soul\", \"Mr. Dynamite\", and \"Soul Brother No. 1\". In a career that lasted more than 50 years, he influenced the development of several music genres. <a href=\"https://www.last.fm/music/James+Brown\">Read more on Last.fm</a>'),('James Brown & The Famous Flames',3047482,575210,'James Brown & The Famous Flames was an American rhythm and blues, soul vocal group founded in Toccoa, Georgia, in 1953 by Bobby Byrd. James Brown first began his career as a member of the Famous Flames, emerging as the lead singer by the time of their first appearance in a professional recording, \"Please, Please, Please\", in 1956.\n\nOn hit songs such as \"Try Me\", \"Bewildered\", \"Think\", \"I Don\'t Mind\", and \"I\'ll Go Crazy\", the Flames\' smooth backing harmonies contrasted strikingly with Brown\'s raw <a href=\"https://www.last.fm/music/James+Brown+&+The+Famous+Flames\">Read more on Last.fm</a>'),('James Earle Trio',NULL,NULL,NULL),('James Farrelli',NULL,NULL,NULL),('James Vincent McMorrow',16398037,952654,'James Vincent McMorrow is an Irish singer-songwriter from Dublin, Ireland. McMorrow began performing under his own name in 2007, releasing an EP entitled The Sparrow and the Wolf in 2008. His debut album, Early in the Morning, was released in February 2010 via Believe Recordings in Ireland. The album\'s momentum was initially slow, but the use of one of the album\'s songs on Grey\'s Anatomy sparked interest in the US and in Europe. The album was released to the rest of the world in March 2011; and charted in the top 30 in Ireland and Norway. <a href=\"https://www.last.fm/music/James+Vincent+McMorrow\">Read more on Last.fm</a>'),('Jamie Jones',NULL,NULL,NULL),('Jamiroquai',98902130,2770951,'Jamiroquai is an English funk and acid jazz band from London. Formed in 1992, they are fronted by vocalist Jay Kay, and were prominent in the London-based funk and acid jazz movement of the 1990s. They built on their acid jazz sound in their early releases and later drew from rock, disco, electronic and Latin music genres. Lyrically, the group has addressed social and environmental justice. Kay has remained as the only original member through several line-up changes. <a href=\"https://www.last.fm/music/Jamiroquai\">Read more on Last.fm</a>'),('JAMP',2730,295,' <a href=\"https://www.last.fm/music/Jamp\">Read more on Last.fm</a>'),('Janaína',NULL,NULL,NULL),('Jansu',137,62,' <a href=\"https://www.last.fm/music/Jansu\">Read more on Last.fm</a>'),('Jarrod Lawson',NULL,NULL,NULL),('Jaso Beat',11670,1168,' <a href=\"https://www.last.fm/music/Jaso+Beat\">Read more on Last.fm</a>'),('Jason Derulo',58077859,3009682,'This is an incorrect tag for Jason Derülo. If you have last.fm Autocorrection turned on, your scrobbles will automatically redirect to the correct artist name. Otherwise, please fix your artist ID3 tags. <a href=\"https://www.last.fm/music/+noredirect/Jason+Derulo\">Read more on Last.fm</a>'),('Jason LaPierre',NULL,NULL,NULL),('Jason Phats',7479,2092,' <a href=\"https://www.last.fm/music/Jason+Phats\">Read more on Last.fm</a>'),('Javi Medina',85553,10283,' <a href=\"https://www.last.fm/music/Javi+Medina\">Read more on Last.fm</a>'),('Javiielo',587901,49406,' <a href=\"https://www.last.fm/music/Javiielo\">Read more on Last.fm</a>'),('Jay Wheeler',5462142,261849,'Reggaeton singer from Puerto Rico.  According to an article by Natacha Andueza:\r\n\r\n\"Jose Angel Lopez Martinez started singing in a church, where he played the piano and then began creating all types of beats with his computer. Wheeler was too scared and shy to sing due to bullying while he was in school. He felt insecure and did not want to show off his talents.\r\n\r\nA few years later, everything changed, he fell in love and had to deal with heartbreak. <a href=\"https://www.last.fm/music/Jay+Wheeler\">Read more on Last.fm</a>'),('Jazz Nouveau Project',NULL,NULL,NULL),('Jazzbois',NULL,NULL,NULL),('Jazzwaves',NULL,NULL,NULL),('Jazzy',NULL,NULL,NULL),('Jazzy-Fi',NULL,NULL,NULL),('Jazzystics',NULL,NULL,NULL),('JC Reyes',3205168,96187,' <a href=\"https://www.last.fm/music/JC+Reyes\">Read more on Last.fm</a>'),('Jean-Luc Ponty',NULL,NULL,NULL),('Jeff Beck',NULL,NULL,NULL),('Jeff Coffin',NULL,NULL,NULL),('Jeff Lorber Fusion',NULL,NULL,NULL),('Jennifer Lopez',70079934,3655722,'Jennifer Lynn Lopez (born July 24, 1969 in New York, NY), popularly nicknamed J.Lo, is a Puerto Rican American pop and R&B singer, dancer, actress, model, fashion and perfume designer and film and television producer.\r\n\r\nStarting in 1999, Lopez has released seven albums, including two #1 albums on the Billboard 200 charts and four Billboard Hot 100 #1 singles. She won the 2003 American Music Award for Favorite Pop/Rock Female Artist and the 2007 American Music Award for Favorite Latin Artist. <a href=\"https://www.last.fm/music/Jennifer+Lopez\">Read more on Last.fm</a>'),('Jeremy Ledbetter Trio',NULL,NULL,NULL),('Jerk',NULL,NULL,NULL),('Jermaine Jackson',1411501,285757,'Jermaine La Jaune Jackson (born December 11, 1954) is an American singer-songwriter and bassist. He is best known for being a member of the Jackson family. From 1964 to 1975, Jermaine was second vocalist after his brother Michael of the Jackson 5, and played bass guitar. Since 1983 he rejoined the group, now known as the Jacksons. Jermaine sang the lead on some of The Jackson 5\'s biggest hits, and featured in \"I\'ll Be There\" and \"I Want You Back\" amongst others. <a href=\"https://www.last.fm/music/Jermaine+Jackson\">Read more on Last.fm</a>'),('Jerry Di',692505,78512,'Omeba Soto (born November 26, 1992), known professionally as Jerry Di, is one of Venezuela\'s most important singers and composers.\r\nusic has always been the best therapy for Jerry Di. He claims that life taught him to compose, while music itself taught him to live. He’s mainly influenced by reggaeton, ballads and hip hop in Spanish. <a href=\"https://www.last.fm/music/Jerry+Di\">Read more on Last.fm</a>'),('Jesse & Joy',9390996,395866,'Jesse & Joy are a Latin Grammy award winning Mexican pop duo formed in 2005 by siblings Jesse Huerta (born December 31, 1982) and Joy Huerta (born June 20, 1986).\r\n\r\nJesse & Joy are two young siblings from Mexico City. They began to show a passion for music from a very young age. In 2001 (when they were 18 and 15 years of age), they began writing lyrics and songs with their father. They were later signed under the Warner label on April 18, 2005.\r\n\r\nJesse plays the piano <a href=\"https://www.last.fm/music/Jesse+&+Joy\">Read more on Last.fm</a>'),('Jesus Msk',0,0,NULL),('JHAYCO',15731377,394846,'Jesús Manuel Nieves Cortez (born April 9, 1993), known professionally as Jhayco (formerly Jhay Cortez), is a Puerto Rican singer and rapper from Río Piedras, San Juan. After releasing multiple EPs, his debut studio album, Famouz, was released in 2019. The album contained features from J Balvin, Bad Bunny, Rafa Pabön, C. Tangana, Almighty, Tainy & Zion y Lennox. The album also contained his breakout songs No Me Conoce and No Me Conoce - Remix.\r\n <a href=\"https://www.last.fm/music/Jhayco\">Read more on Last.fm</a>'),('Jiggy Drama',85138,14716,'Heartan Edward Lever  (June 2, 1983, San Andres Island, Colombia) better known as Jiggy Drama, is a Colombian rapper and songwriter. Is an alternative urban music artist; his career is over 10 years in the interpretation of genres such as Hip-Hop, R & B, Dancehall, and Socca.\r\n\r\nHis first album was called \"Undergroove\" and now under the independient label Rhythm Records, Jiggy Drama prepares his new album \"Nerdside\", which are already successful songs like \"La Flaka\" and \"La Fuga\"\r\n\r\n <a href=\"https://www.last.fm/music/Jiggy+Drama\">Read more on Last.fm</a>'),('JimPhonker',6591,2060,' <a href=\"https://www.last.fm/music/Jimphonker\">Read more on Last.fm</a>'),('Jo Paciello',46699,8676,'Jo Paciello is one of the most talented and intreseting artist in the Jaking House Division. Grown in the 90\'s, the golden age of house, today he\'s always in the Jaking House top Charts. <a href=\"https://www.last.fm/music/Jo+Paciello\">Read more on Last.fm</a>'),('Joana Duah',NULL,NULL,NULL),('Joana Santos',27816,4084,' <a href=\"https://www.last.fm/music/Joana+Santos\">Read more on Last.fm</a>'),('Joanne Shaw Taylor',1015373,75809,'Joanne Shaw Taylor (born 1986, England) is a British blues rock guitarist and singer, who was discovered by Dave Stewart of the Eurythmics at the age of 16.\n\nTaylor has toured Europe with the supergroup D.U.P. with fellow band members Dave Stewart (Eurythmics), Candy Dulfer (Prince), Mudbone Cooper (Parliment-Funkadelic) and Jimmy Cliff. If you can imagine the love child of Stevie Ray Vaughan and Dusty Springfield then you are beginning to get a feel for Taylor\'s mixture of fiery guitar playing, sultry vocals and 100% pure soul. <a href=\"https://www.last.fm/music/Joanne+Shaw+Taylor\">Read more on Last.fm</a>'),('João Gilberto',NULL,NULL,NULL),('Joaquín Sabina',7496747,233003,'Joaquín Ramón Martínez Sabina (Úbeda, Jaén, Spain, 12 February 1949), known artistically as Joaquín Sabina, is a singer - songwriter, and poet. He has released fourteen studio albums, two live albums, and three compilation albums. He has collaborated and composed songs for Ana Belén and Miguel Ríos amongst others.\r\n\r\nJoaquín Sabina, is the second son of Adela Sabina del Campo and Jerónimo Martinez Gallego, which was a policeman. He attended <a href=\"https://www.last.fm/music/+noredirect/Joaqu%C3%ADn+Sabina\">Read more on Last.fm</a>'),('Joaquina',375749,20834,' <a href=\"https://www.last.fm/music/Joaquina\">Read more on Last.fm</a>'),('Joe Cuba',361469,73096,'Born \"Gilberto Miguel Calderón\" in New York City, Cuba\'s parents moved from Puerto Rico to New York City in the late 1920s and settled in Spanish Harlem, a Latino community located in Manhattan. Cuba was raised in an apartment building where his father had become the owner of a candy store located on the ground floor (street level floor). His father had organized a stickball club called the Devils. Stickball was the main sport activity of the neighborhood. <a href=\"https://www.last.fm/music/Joe+Cuba\">Read more on Last.fm</a>'),('Joe Vanditti',20844,4327,' <a href=\"https://www.last.fm/music/Joe+Vanditti\">Read more on Last.fm</a>'),('Joe Zangie',4979,953,' <a href=\"https://www.last.fm/music/Joe+Zangie\">Read more on Last.fm</a>'),('Joey Finnz',30,18,' <a href=\"https://www.last.fm/music/Joey+Finnz\">Read more on Last.fm</a>'),('Joey Montana',1168751,151812,'Joey Montana is one of the hottest newe stars of Latin music. At 23 years of age, he has broken ground in Central and South America, Mexico, the United States and Europe. Armed with his lyrical abilities and explosive personality, he is looking to make a name for himself in the ever so popular and growing urban/Latino market, leaving behind his former group of \"La Factoria\". \r\n\r\nHis real name is Edgardo Antonio Miranda Beiro, and he was born in Panama City, Panama; on May 3rd, 1982. <a href=\"https://www.last.fm/music/Joey+Montana\">Read more on Last.fm</a>'),('John McLaughlin',NULL,NULL,NULL),('Johnny Deep',5337,1251,' <a href=\"https://www.last.fm/music/Johnny+Deep\">Read more on Last.fm</a>'),('Jonathan Faiman',120,21,' <a href=\"https://www.last.fm/music/Jonathan+Faiman\">Read more on Last.fm</a>'),('Jonathan Fritzén',NULL,NULL,NULL),('Jordan Astra',188586,41757,'Jordan Astra is an Indonesian-Canadian singer / songwriter / producer based in Toronto. A student of Soul and R&B, Astra has created a sound that blends the musical stylings of Pharrell and Jamiroquai with subtle influences of Bruno Mars, SG Lewis, and Lucky Daye to create something uniquely his own.\n\nThe last 12 months have been special for Jordan. In late 2023, he independently released ‘Man From East’, an EP that explores the depths of Jordan’s journey from Australia returning back to his home in Canada and starting from scratch. <a href=\"https://www.last.fm/music/JORDAN+ASTRA\">Read more on Last.fm</a>'),('Jorge Drexler',11964707,315378,'Jorge Drexler (n. Montevideo; September 21, 1964), is a critically acclaimed Uruguayan singer/songwriter who resides in Spain, began his recording career in the early 90\'s but didn\'t experience mainstream breakthrough success until his seventh album, Eco (2004), and its Oscar-winning song \'\'Al Otro Lado Del Río\'\'.\r\n\r\nHe comes from a Jewish family that fled persecution in Germany. He studied to become an otolaryngologyst (i.e., ear, throat, and nose doctor) like his parents but ultimately chose to pursue his passion for music.  <a href=\"https://www.last.fm/music/Jorge+Drexler\">Read more on Last.fm</a>'),('Joyce Sims',299680,60462,'Joyce Sims (born August 6, 1959 in Rochester, New York; died October 14, 2022) was an American singer, composer and pianist. Known for her \'80s club anthems, her biggest hit was the soul/dance ballad, \"Come Into My Life\", which was a worldwide top ten hit in early 1988. Her debut album was largely mixed and produced by Kurtis Mantronik of hip hop crew Mantronix. Sims wrote every song on the album except \"Love Makes A Woman.\" She followed the album with the single \"Who\'s Crying Now\" on Warlock Records in 1994. <a href=\"https://www.last.fm/music/Joyce+Sims\">Read more on Last.fm</a>'),('Juan Duque',171231,14552,' <a href=\"https://www.last.fm/music/Juan+Duque\">Read more on Last.fm</a>'),('Juan Luis Guerra 4.40',5478442,243389,'Juan Luis Guerra (born June 7, 1957) is a Dominican singer, songwriter, and self-producer who has sold over 30 million records, and won numerous awards including 15 Latin Grammy Awards, two Grammy Awards, and two Latin Billboard Music Awards. He recently won 3 Latin Grammy Awards in 2010, including Album of the Year.\r\n\r\nHe is one of the most internationally recognized latin artists in decades past. His pop style of merengue and bolero and Afro-pop/Latin fusion have garnered him considerable success outside the Dominican Republic. <a href=\"https://www.last.fm/music/Juan+Luis+Guerra+4.40\">Read more on Last.fm</a>'),('Juanes',20949668,1171467,'Juan Esteban Aristizábal Vásquez (born August 9, 1972), best known as Juanes, is a rock musician from Medellín, Colombia. When he was younger, his father started calling him Juanes, rather than Juan, a contraction of his two first names Juan and Esteban. As his friends grew to know him by this name, he chose to keep it for his musical career, which started when he, Andrés García, Fernando \"Toby\" Tobón and José David Lopera, formed the rock band Ekhymosis in 1988. <a href=\"https://www.last.fm/music/Juanes\">Read more on Last.fm</a>'),('Juanse Laverde',12315,1436,' <a href=\"https://www.last.fm/music/Juanse+Laverde\">Read more on Last.fm</a>'),('Judeline',7558879,182634,'Lara Fernández Castrelo, better known as Judeline, (January 18, 2003) is a Spanish singer. She was born in Jerez de la Frontera, but grew up and spent her entire childhood in Barbate, specifically in Los Caños de Meca. Her mother was from Jerez and her father was born in Madrid, and they emigrated to Venezuela at the age of 12. The latter is a non-professional musician and has been a figure of admiration and inspiration for the artist. From a young <a href=\"https://www.last.fm/music/JUDELINE\">Read more on Last.fm</a>'),('Juhn',593350,52104,' <a href=\"https://www.last.fm/music/Juhn\">Read more on Last.fm</a>'),('Julia St.',NULL,NULL,NULL),('Julian Perretta',801256,95277,'Julian Perretta, born January 13, 1989, is an English singer-songwriter who rose to fame in Europe with the single \'Wonder Why.\' Perretta was born in London, UK to an Italian father and Irish mother. Perretta left school at 16 after gaining a scholarship for Royal Academy of Dramatic Art in London, where he studied Shakespeare. After a year he left to pursue a career as a songwriter. He currently resides in Los Angeles, California.\r\n\r\nShortly after leaving school he met the members of the band Jamiroquai and began working on demos. <a href=\"https://www.last.fm/music/Julian+Perretta\">Read more on Last.fm</a>'),('Julieta Venegas',19893393,779103,'Julieta Venegas (born November 24, 1970) is a successful Mexican singer and songwriter of Latin music. She was born in Long Beach, California, but raised in Tijuana, Baja California and has a twin sister Yvonne who is a photographer. She was a former member of the band \"Tijuana No\". Julieta plays numerous instruments including acoustic guitar, accordion, and keyboard. She won the 2004 Latin Grammy for Best Vocal Rock Album (Sí).\r\nAlbums. She is radicated in Mexico City <a href=\"https://www.last.fm/music/Julieta+Venegas\">Read more on Last.fm</a>'),('Julius Papp',187896,41887,'Julius Papp is a house music producer and DJ whose roots lie in Disco of the \'70s and New Wave of the \'80s.\n\nHe blends various styles together (including Latin, Afro, Disco, Jazz) with such fluidity that it is difficult at times to put a defining stamp on his sound. Contributing to that is his willingness to take a chance. He always tries to push the envelope by introducing music that may or may not go over well, but feels deserves the exposure. He takes his audience on a musical journey with various mood and energy changes. <a href=\"https://www.last.fm/music/Julius+Papp\">Read more on Last.fm</a>'),('Junior',1112523,131710,'There are at least nine acts using the name Junior:\n\n1) Brazilian singer, music producer, musician, composer, multi-instrumentalist, presenter, former actor and dancer. JUNIOR became nationally and internationally known for the duo Sandy & Junior between 1990 and 2007, alongside his sister Sandy, who became the best-selling pop music act in the world history of Brazil and record holder for tour revenue.\n\n2) Pop-punk band from Cardiff Wales, headed by wrestler Mark Andrews. <a href=\"https://www.last.fm/music/Junior\">Read more on Last.fm</a>'),('Junity',NULL,NULL,NULL),('Justin Bieber',294192425,4567579,'Justin Drew Bieber (born March 1, 1994 in London, Ontario, Canada) is a Grammy Award winning Canadian pop singer, songwriter, and multi-instrumentalist. Bieber was discovered in 2008 by American talent manager Scooter Braun, who came across Bieber\'s videos on YouTube and later became his manager. Braun arranged for him to meet with entertainer Usher Raymond in Atlanta, Georgia. Bieber was signed to Raymond Braun Media Group (RBMG), and then to an Island Records recording contract offered by record executive L.A. Reid. <a href=\"https://www.last.fm/music/Justin+Bieber\">Read more on Last.fm</a>'),('Justin Kauflin',NULL,NULL,NULL),('Justin Timberlake',157379377,5359314,'Justin Randall Timberlake (born January 31, 1981) is an American singer, songwriter, actor, record producer, and dancer. He is recognized as a prominent figure in popular music and has sold an estimated 88 million records worldwide.\r\n\r\nBorn and raised in Memphis, Tennessee, Timberlake began his career on musical television programs as a child, including competing on \"Star Search\" and appearing on the Disney Channel\'s \"The All New Mickey Mouse Club\" in the early to mid-1990s. <a href=\"https://www.last.fm/music/Justin+Timberlake\">Read more on Last.fm</a>'),('Kany García',1696571,115059,'Encarnita \"Kany\" García De Jesus (born September 25, 1982 in Toa Baja, Puerto Rico) is a Puerto Rican singer-songwriter. García first appeared on television in 2004 as a contestant on Objetivo Fama. She is widely considered the most successful non-winner in the history of the show.\r\n\r\nKany García is born to a Spaniard father and Puerto Rican mother. García\'s father, Antonio, who gave up the priesthood when he met Shela, Encarnita García de Jesús, or Kany, grew up in a house where music was not only played, but also lived. <a href=\"https://www.last.fm/music/+noredirect/Kany+Garc%C3%ADa\">Read more on Last.fm</a>'),('Kanye West',1445924983,7751041,'Ye, born Kanye Omari West on June 8, 1977, is an American rapper, singer, songwriter, record producer, and fashion designer. He is one of the most prominent figures in hip hop, known for his diverse musical style and polarizing cultural and political commentary. After dropping out of college to pursue a career in music, West began producing for regional artists in the Chicago area. As an in-house producer for Roc-A-Fella Records, he co-produced albums including Jay-Z\'s The Blueprint (2001) before signing with the label as a recording artist. <a href=\"https://www.last.fm/music/Kanye+West\">Read more on Last.fm</a>'),('Kapo',1494514,127557,'The band Kapo was formed in 2006 by Joe Muller and David Gorena. The two were juniors in high school when Kapo was formed. <a href=\"https://www.last.fm/music/Kapo\">Read more on Last.fm</a>'),('Karen Souza',NULL,NULL,NULL),('Karim Ziad',NULL,NULL,NULL),('Karlis',1178,355,' <a href=\"https://www.last.fm/music/Karlis\">Read more on Last.fm</a>'),('KAROL G',69192679,1349898,'Carolina Giraldo Navarro, professionally known as Karol G, is a Colombian singer. She is predominantly described as a reggaeton and Latin trap artist but has experimented with a variety of other genres including reggae and sertaneja. In 2018, she won the Latin Grammy Award for Best New Artist and has been nominated for several Billboard Latin Music Awards and Premios Lo Nuestro awards.\r\n\r\nBorn and raised in Medellín, Giraldo launched her career as a teenager, appearing on the Colombian version of The X Factor at age 14 in 2004. <a href=\"https://www.last.fm/music/KAROL+G\">Read more on Last.fm</a>'),('Kasír',66571,11027,'Kasír are a young Danish trio, who play Irish folk music, both traditional tunes, and their own compositions. Composes of, Oisín Walsh, (1987), bodhrán, Rune Cygan Barslund, (1988), accordion and whistles and Aske Fuglsang Ruhe, (1989), guitar, mandolin and octave mandolin.\n\n\n <a href=\"https://www.last.fm/music/Kas%C3%ADr\">Read more on Last.fm</a>'),('Katherine Plump',3096,1059,' <a href=\"https://www.last.fm/music/Katherine+Plump\">Read more on Last.fm</a>'),('Kathy Brown',101420,25881,'Kathy Brown is a dance music singer from South Carolina. She had #1 success as the lead singer of Praxis before having US dance hits on her own. In 1999 she climbed to #4 on the Hot Dance Music/Club Play chart with \"Joy\" and in 2004 was the credited lead vocalist on the British act Soul Central\'s \"Strings Of Life(Stronger On My Own)\", a track that samples Rhythm Is Rhythm\'s 1989 House classic. <a href=\"https://www.last.fm/music/Kathy+Brown\">Read more on Last.fm</a>'),('Kawai Sprite',2712732,100700,'Isaac Garcia, better known online as Kawai Sprite, is an American musician. He is the composer and sound designer for Friday Night Funkin\'. <a href=\"https://www.last.fm/music/Kawai+Sprite\">Read more on Last.fm</a>'),('Kazumi Watanabe',NULL,NULL,NULL),('Keith Jarrett',NULL,NULL,NULL),('KekoYoma',2256,350,' <a href=\"https://www.last.fm/music/kekoyoma\">Read more on Last.fm</a>'),('Kemmei Adachi',139861,7489,' <a href=\"https://www.last.fm/music/Kemmei+Adachi\">Read more on Last.fm</a>'),('Ken Zazpi',352024,14288,'Commercially successful Basque Pop-Rock project created in 1996 by Mikel Arronategi, former bass player of Exkixu and Eñaut Elorrieta former singer of Lugarri. <a href=\"https://www.last.fm/music/Ken+Zazpi\">Read more on Last.fm</a>'),('Kendall Peña',117962,10302,' <a href=\"https://www.last.fm/music/Kendall+Pe%C3%B1a\">Read more on Last.fm</a>'),('Kenny Die',437288,30960,' <a href=\"https://www.last.fm/music/Kenny+Die\">Read more on Last.fm</a>'),('Kenny G',NULL,NULL,NULL),('Kesha',109100852,2984089,'Fix your tags to Ke$ha. Songs scrobbled under this incorrect tag will scrobble to the correct tag of \"Ke$ha\" if Autocorrect is enabled. However, it is recommended that your ID3 tags are corrected to the correct name of this artist. <a href=\"https://www.last.fm/music/+noredirect/Kesha\">Read more on Last.fm</a>'),('Kevin Pabst',4484,556,' <a href=\"https://www.last.fm/music/Kevin+Pabst\">Read more on Last.fm</a>'),('KEVIN ROLDAN',2208547,159463,'Ronny Kevin Roldán Velasco ​más conocido como Kevin Roldán, es un cantante de reguetón y trap latino colombiano.  <a href=\"https://www.last.fm/music/Kevin+Roldan\">Read more on Last.fm</a>'),('Kevin Yost',842112,120542,'Kevin Yost was a musical child, who at a very early age demonstrated a keen sense of rhythm. This quickly grew into a love of playing drums and soon after keys. Listening to his father\'s Chuck Mangione records, his love of music continued to grow throughout his youth. Yet his small rural farm town in Waynesboro, PA USA had no outlets to develop a child’s skill, and thus he turned to self-instruction over formal education.\n\nThe spark of jazz music was lit inside Kevin at this young age; however growing up in the early 80\'s <a href=\"https://www.last.fm/music/Kevin+Yost\">Read more on Last.fm</a>'),('Kevz',111625,6714,' <a href=\"https://www.last.fm/music/Kevz\">Read more on Last.fm</a>'),('Key-Key',219059,37599,' <a href=\"https://www.last.fm/music/Key-Key\">Read more on Last.fm</a>'),('Kid Creole And The Coconuts',488195,75620,'Kid Creole and the Coconuts are an American band created and led by August Darnell (aka Kid Creole). Their music incorporates styles like big band jazz, disco, and in particular Caribbean/Latin American salsa. The Coconuts are a glamorous trio of female backing vocalists whose lineup changes throughout the years.\n\nThomas August Darnell Browder (aka August Darnell, aka Kid Creole) was born in Montreal, Canada, on 12 August 1950, the son of a French Canadian mother and a father from the Caribbean island of Dominica <a href=\"https://www.last.fm/music/+noredirect/Kid+Creole+And+The+Coconuts\">Read more on Last.fm</a>'),('Kidd Voodoo',10457504,90372,'Kidd Voodoo is a rapper who uses Autotune and synthetizers to blend his voice alongside pre recorded audio tracks of reggaeton, in a style known as \"Latin Trap\". He\'s from Santiago, Chile.\r\nHe\'s a music enthusiast, demonstrating his passion for various musical realms by mastering several instruments. His journey in the music world began in 2016 when he joined the group \"Resonancia Etérea,\" a pivotal step that allowed him to refine his compositions and ideas. <a href=\"https://www.last.fm/music/Kidd+Voodoo\">Read more on Last.fm</a>'),('Kiko Berenguer',NULL,NULL,NULL),('Kinga Glyk',NULL,NULL,NULL),('Kings of Leon',261731799,5028583,'Kings of Leon is an American rock band formed in Nashville, Tennessee, in 1999. The band is composed of brothers Caleb, Nathan and Jared Followill, and their cousin Matthew Followill. The band\'s early music was a blend of Southern rock and garage rock with blues influences, but it has evolved throughout the years to include a variety of genres and a more alternative, arena rock sound. Kings of Leon achieved initial success in the United Kingdom with nine Top 40 singles <a href=\"https://www.last.fm/music/Kings+of+Leon\">Read more on Last.fm</a>'),('KIRAZ',5008,991,' <a href=\"https://www.last.fm/music/kiraz\">Read more on Last.fm</a>'),('Kolya Funk',39830,8469,' <a href=\"https://www.last.fm/music/Kolya+FUNK\">Read more on Last.fm</a>'),('Kool&Klean',NULL,NULL,NULL),('Korey Wade',NULL,NULL,NULL),('Koul Funk',7298,1645,' <a href=\"https://www.last.fm/music/Koul+Funk\">Read more on Last.fm</a>'),('Krafty Kuts',1009600,106185,'Since the late 80\'s Krafty Kuts, a.k.a Martin Reeves, has been one of the world\'s best-known purveyors of breakbeats and old-skool hip-hop.  Hailing from Brighton, he moved from running a record shop to running around the world as he DJs internationally while producing a vast number of mixed albums and original material, including \"Freakshow\", released on his label Against The Grain. He also started the best breakbeat night in the country with Skool of Thought. <a href=\"https://www.last.fm/music/Krafty+Kuts\">Read more on Last.fm</a>'),('Kurt Bowett Trio',NULL,NULL,NULL),('Kurt Rosenwinkel',NULL,NULL,NULL),('La Discothèque',14002,4609,' <a href=\"https://www.last.fm/music/La+discoth%C3%A8que\">Read more on Last.fm</a>'),('La Fúmiga',427245,9648,' <a href=\"https://www.last.fm/music/La+F%C3%BAmiga\">Read more on Last.fm</a>'),('La Habitación Roja',1620302,83764,'La Habitación Roja is an indie rock band from Valencia, Spain. The band was initially composed of Jorge Martí and José Marco, but they were soon joined by Juanjo Espinosa as drummer and  Pau Roca on the guitar. The quartet debuted in 1995 with the demo \"Play Pop vol.1\", which placed first in the local music contest \"Circuit Rock\". They are currently under the label Mushroom Pillow and have released several albums:\r\n\r\n    * La Habitación Roja (1998) <a href=\"https://www.last.fm/music/+noredirect/La+Habitaci%C3%B3n+Roja\">Read more on Last.fm</a>'),('La Húngara',136382,14823,' <a href=\"https://www.last.fm/music/+noredirect/La+H%C3%BAngara\">Read more on Last.fm</a>'),('La K\'onga',679282,32488,' <a href=\"https://www.last.fm/music/La+K%27onga\">Read more on Last.fm</a>'),('La La Love You',1812951,69541,'La La Love You is a pop punk and indie rock band from Parla, Madrid, Spain, that was formed in 1996. The original members were Roberto Amor, David Merino, and Rafa Torres. They initially wrote songs in English, influenced by bands like The Ramones, but later switched to Spanish.\r\nThe band\'s name, La La Love You, is a tribute to The Pixies\' song of the same name. Over the years, other members have joined the band, and the current lineup includes Roberto Amor, David Merino, Lydia Carré, and Oscar Hoyos. <a href=\"https://www.last.fm/music/La+La+Love+You\">Read more on Last.fm</a>'),('LA LOM',NULL,NULL,NULL),('La Nueva Mezkla',229,55,' <a href=\"https://www.last.fm/music/La+Nueva+Mezkla\">Read more on Last.fm</a>'),('La Quinta Estacion',3261197,243974,'La 5a Estacion is group of three Spaniards that left their native country and moved to Mexico to pursue a Musical career. Their first hit was \"Donde Iran?\" a pop rock tune featured on the Mexican Soap opera \"Clase 406.\" Their first album is titled \"Primera Toma.\" This first album was immediately followed by \"Flores De Alquiler\" that featured hits such as \"El Sol No Regresa,\" \"Daria,\" \"Algo Mas,\" and \"Nina.\" this album also had a cover track in tribute to Hombres G titled \"Si Yo Fuera Mujer. <a href=\"https://www.last.fm/music/+noredirect/La+Quinta+Estacion\">Read more on Last.fm</a>'),('La Renken',5499,867,' <a href=\"https://www.last.fm/music/La+Renken\">Read more on Last.fm</a>'),('La T y La M',937831,51787,' <a href=\"https://www.last.fm/music/La+T+y+la+M\">Read more on Last.fm</a>'),('La Unión',2142763,228892,'LA UNIØN grupo formado por Rafa Sánchez (cantante), Luis Bolín (bajo), Mario Martínez (guitarra) e Íñigo Zabala (teclados) a finales del año 82 en Madrid, al calor de “La Movida”. Su música influida, llena de personalidad, romanticismo, referencias literarias y cinematográficas pronto se hace notar. \"Lobo Hombre en París\", basada en un cuento de Boris Vian.  \r\n <a href=\"https://www.last.fm/music/+noredirect/La+Uni%C3%B3n\">Read more on Last.fm</a>'),('La Vida Bohème',1044933,37863,'La Vida Bohème is an alternative independent band from Caracas, Venezuela, formed by Rafael Perez, Daniel De Sousa, Sebastian Ayala, and Henry D\'Arthenay in late 2006 and mid 2007. The band takes influence from late \'70s punk, disco, funk, electronic music, jazz, salsa, reggae and dance music.  They were widely acclaimed for their debut album and it are currently one of the most popular bands in Venezuela.\r\n\r\n\r\nConformados desde 2007 por Henry D´Arthenay (voz y guitarra) <a href=\"https://www.last.fm/music/+noredirect/La+Vida+Boh%C3%A8me\">Read more on Last.fm</a>'),('LaBelle',1184020,267260,'LaBelle is an American R&B/soul group from Philadelphia, Pennsylvania, USA, who successfully melded dance music with funk and glam rock. Mostly active in the 60s and 70s disband but reformed in 2005. Their most recognised song is \"Lady Marmalade\". The group was led by Patti LaBelle, who later had a successful solo career. Nona Hendryx, Sarah Dash and Cindy Birdsong rounded out the group, with Hendryx especially notable as a prolific songwriter.\n\nIn 1961 <a href=\"https://www.last.fm/music/Labelle\">Read more on Last.fm</a>'),('Lady A',8680613,654908,'lady antebelum <a href=\"https://www.last.fm/music/+noredirect/Lady+A\">Read more on Last.fm</a>'),('LAGOS',2614071,125150,'LAGOS es un dueto venezolano formado por Luis Jiménez y Mr. A on the Beat (Agustín Zubillaga), quienes han sido a lo largo de más de 10 años productores y compositores para muchos artistas latinoamericanos. \r\n\r\nACERCA DE LAGOS\r\n\r\nLuis Jiménez tiene una carrera de más de 10 años en la industria musical como músico, productor, compositor y artista. Compositor y productor de canciones para Los Mesoneros, Jorge Blanco, Samo, Camilo Séptimo, Arawato, Ruby Tates, Danna Paola, Lasso, Javiera Mena, Maite Perroni, entre muchos más.  <a href=\"https://www.last.fm/music/Lagos\">Read more on Last.fm</a>'),('Larnell Lewis',NULL,NULL,NULL),('Las Ovejas Negras',5223,1021,' <a href=\"https://www.last.fm/music/Las+Ovejas+Negras\">Read more on Last.fm</a>'),('Las Pelotas',1864837,97193,'Las Pelotas is an Argentinian rock band that originated from the separation of an older and pioneer band called Sumo. It is an alternative rock band that currently holds one of the top spots in popularity throughout Argentina.\r\nFormed in 1988 in Buenos Aires.\r\n\r\nFirst line-up\r\nGermán Daffunchio (guitar)\r\nAlejandro Sokol (main vocals)\r\nAlberto \"Superman\" Troglio (drums)\r\nWilly Robles (bass)\r\n\r\nSecond line-up\r\nGermán Daffunchio (guitar and backing vocals)\r\nAlejandro \"Bocha\" Sokol (main vocals) <a href=\"https://www.last.fm/music/Las+Pelotas\">Read more on Last.fm</a>'),('Latin Fresh',197118,43990,'Roberto Carlos De Los Rios Reyes initiated his inclination to music at the age of 13 while studying at American Institute (Panama) in the year of 1988.\r\nIn 1993 he traveled to Guayaquil to continue his studies but ended working his musical ideas. There, he participated in two contests for rap amateurs, winning both and earning his recording participation in a first album (so far he just recorded for mix tapes).\r\nIn 1995 tunes as: “Tranquilo” and “Ella Se Arrebata\" <a href=\"https://www.last.fm/music/Latin+Fresh\">Read more on Last.fm</a>'),('LATIN MAFIA',12857121,209073,'Emilio, Milton y Mike son las promesas de lo urbano que surgieron en TikTok destacándose siempre por el talento que los arropa. Lo que comenzó como un sueño durante la pandemia hoy ya es una realidad, y es que la disciplina, consistencia y talento que llevan en la sangre los ha llevado a convertirse en una de las revelaciones más aclamadas de la escena.\r\n Comenzaron componiendo desde su cuarto, y gracias a su habilidad nata en la música conectaron de forma rápida y sorprendente con el público <a href=\"https://www.last.fm/music/Latin+mafia\">Read more on Last.fm</a>'),('Laufey',NULL,NULL,NULL),('Laura Maré',32056,2568,' <a href=\"https://www.last.fm/music/Laura+Mar%C3%A9\">Read more on Last.fm</a>'),('Laza Bossa',87194,7598,' <a href=\"https://www.last.fm/music/Laza+Bossa\">Read more on Last.fm</a>'),('LCD Soundsystem',92714306,2386543,'\r\nLCD Soundsystem is the musical project of producer James Murphy, co-founder of dance-punk label DFA Records. Formed in 2001 in New York City, New York, United States, the music of LCD Soundsystem can also be described as a mix of alternative dance and post punk, along with elements of disco and other styles. \r\n\r\nDuring the band\'s final years, Murphy was accompanied by Al Doyle (guitar, percussion -- also of Hot Chip), Tyler Pope (!!! / Out Hud) (bass), Nancy Whang (keyboards) and Pat Mahoney (drums). <a href=\"https://www.last.fm/music/LCD+Soundsystem\">Read more on Last.fm</a>'),('Lee Cabrera',225041,48959,'“Give Steven Lee 5 minutes and he’ll have the place upside down…..” (GURU DISCO - VALENCIA, SPAIN)\n\nSort of how its been for this NYC youngster. One half of the massive Lee-Cabrera team who’s 2003 “Shake It” record sought record of the year honors and champed a 10 National Pop Chart Selection with “Move a Little Closer” (the vocal version). Signed with Ministry of Sound world-wide and a regular on Pete Tong’s Essential Selection Steven Lee (Lee-Cabrera) in his short 4 years has tasted about all this business can offer. <a href=\"https://www.last.fm/music/+noredirect/Lee+Cabrera\">Read more on Last.fm</a>'),('Lee Ritenour\'s 6 String Theory',NULL,NULL,NULL),('Leiva',2357249,87002,'José Miguel Conejo Torres (Madrid, 30 de abril de 1980), más conocido como Leiva, es un músico, cantautor español y multiinstrumentista de rock. En 2001, formó junto a Rubén Pozo la banda de rock en español Pereza, con la que grabó seis discos hasta su separación en 2011. Tras la disolución del grupo, inició una carrera en solitario en la que lleva cuatro discos grabados. <a href=\"https://www.last.fm/music/Leiva\">Read more on Last.fm</a>'),('Lilly Wood and The Prick',7377485,792099,' <a href=\"https://www.last.fm/music/+noredirect/Lilly+Wood+and+the+Prick\">Read more on Last.fm</a>'),('Linda Fields',70590,21614,'Linda Fields released the singles \"Shame Shame Shame\" and \"In The Summertime\".\nIn the 70s, Linda was member of The Funky Boys. <a href=\"https://www.last.fm/music/Linda+Fields\">Read more on Last.fm</a>'),('Linkin Park',699855678,6737591,'Linkin Park is an American alternative rock band from Agoura Hills, California. The band\'s current lineup comprises of vocalist/rhythm guitarist/keyboardist Mike Shinoda, lead guitarist Brad Delson, bassist Dave Farrell, DJ/turntablist Joe Hahn, drummer Colin Brittain, and lead vocalist Emily Armstrong. Shinoda, Delson, Farrell and Hahn are founding members. Vocalists Mark Wakefield, Chester Bennington & drummer Rob Bourdon are former members of the band. <a href=\"https://www.last.fm/music/Linkin+Park\">Read more on Last.fm</a>'),('LISA',119989486,1848293,'There are at least eight known artists with the name \"Lisa\": two are from Japan, one from Thailand who based in South Korea, one from France, two from Holland, one from USA, and one from Italy. \r\n\r\n1) Risa Oribe (織部里沙 Oribe Risa, born June 24, 1987), better known by her stage name LiSA  is a Japanese singer signed to Aniplex under Sony Music Artists. Her stage name is an acronym for \'Love is Same All\', a band she formed in 2008. She is known <a href=\"https://www.last.fm/music/Lisa\">Read more on Last.fm</a>'),('Little love saxophone',NULL,NULL,NULL),('Lizzy McAlpine',98354906,1319232,'Elizabeth Catherine McAlpine, also known as Lizzy McAlpine (born September 21, 1999) is a vocalist, songwriter, and musician who hails just outside of Philadelphia, Pennsylvania. She studied songwriting at Berklee College of Music located in Boston before leaving in her junior year to pursue music full-time. In April 2020, at the beginning of the COVID-19 pandemic, she started the Instagram #BerkleeAtHome streaming concert series. Her musical style has been described as \"folk-focused\", \"folk-pop\", and a blend of \"jazz, pop, and R&B\". <a href=\"https://www.last.fm/music/Lizzy+McAlpine\">Read more on Last.fm</a>'),('Lofi Cat',46644,8162,' <a href=\"https://www.last.fm/music/LOFI+CAT\">Read more on Last.fm</a>'),('Longe Beach Grooves',97,40,' <a href=\"https://www.last.fm/music/Longe+Beach+Grooves\">Read more on Last.fm</a>'),('Lori Meyers',4109591,120236,'Lori Meyers is an spanish indie pop band from Loja, Spain, formed in 1998. The members are Antonio López, Julián Méndez, Alejandro Méndez and Alfredo Núñez. \r\n\r\nFirst their style was asociated to the noise pop of Los Planetas (Granada is near Loja) but later the 60s revival influences with rich vocal harmonies related them with other granadian band: Los Ángeles.\r\n\r\nThey have produced two EPs, La Caza and Ya Lo Sabes, and three LPs, \"Viaje De Estudios\", \"Hostal Pimodan\" and \"Cronolánea\".\r\n\r\nMore information on www.lorimeyers.net <a href=\"https://www.last.fm/music/Lori+Meyers\">Read more on Last.fm</a>'),('lorleaf',NULL,NULL,NULL),('Los Angeles',124524,11790,'LOS ANGELES presents the shining talents of Michele Luppi: an Italian amazing singer who cut his teeth at the VIT Los Angeles, with Robin Randall (co-writer of hits for FM, Mark Free, James Christian etc) as one of his musical coaches.\r\n\r\nUpon his return to Italy, he gathered considerable experience having the opportunity to sing alongside some of the most important national and international artists, including: Maurizio Solieri, Andrea Braido, Umberto Tozzi, Glenn Hughes and Ian Paice of Deep Purple. <a href=\"https://www.last.fm/music/LOS+ANGELES\">Read more on Last.fm</a>'),('Los Buitres De Culiacan Sinaloa',524406,56170,'Los Buitres, Directamente de la tierra del tomate y la musica alegre llega el conjunto norteno los buitres de culiacan sinaloa. Desatando un torbellino de alegria al interpretar sus corridos y canciones de amor asi llegan sus cuatro jovenes integrantes a romper los esquemas de la musica nortena. Eduardo, Eulogio, Carlos, y Oscar. Son los nombres de estos cuatro chavos culiacanenses cuya unica aficion es deleitar a al publico desde siempre. En su musica <a href=\"https://www.last.fm/music/Los+Buitres+De+Culiacan+Sinaloa\">Read more on Last.fm</a>'),('Los Charly\'s Orchestra',54125,10116,'Music project created by the two Venezuelans producers Juan Laya & Jorge Montiel. Combining a retro but still modern sounding style, Los Charly’s Orchestra are characterize by creating a feeling that blends the Disco, Funk & Soul of the 70\'s from a Latin perspective. The duo has worked in collaborations with some artists of the top scene, such as: Xantoné Blacq, Noel Mckoy, Rotimo Soul, Matheus Nova, Tom Nowak, Kenny Barry, Dj Joey Negro, Paul Batik <a href=\"https://www.last.fm/music/Los+Charly%27s+Orchestra\">Read more on Last.fm</a>'),('Los Delinqüentes',1260295,111310,'Los delinqüentes fue un grupo musical andaluz fundado en 1998, originario de Jerez de la Frontera (Cádiz), originalmente compuesto por Miguel Ángel Benítez Gómez, Er Migue, Marcos del Ojo (conocido como Er Canijo de Jeréz) y Diego Pozo Er Ratón y su Banda del Ratón.\r\n\r\nSe caracterizan por realizar una fusión de ritmos de su tierra natal con un pop inflamable y burlesco muy cercano al funky, así como rock y blues, en el que ocupan extensivamente expresiones y formas de pronunciar del dialecto andaluz. <a href=\"https://www.last.fm/music/+noredirect/Los+Delinq%C3%BCentes\">Read more on Last.fm</a>'),('Los Ébora',102,21,' <a href=\"https://www.last.fm/music/Los+%C3%89bora\">Read more on Last.fm</a>'),('Los Latinos',64672,16547,' <a href=\"https://www.last.fm/music/Los+Latinos\">Read more on Last.fm</a>'),('Los Punsetes',2314060,68932,'Los Punsetes are a quintet formed in Madrid, Spain in 2004.  After releasing a couple of demos (2004 and CD 2006), an official first 4 track single, 7 Pulgadas (2007), was published by (WA)TT records.\r\n\r\nTheir first full length was released LP with Gramaciones Grabofónicas in 2008, which included the lead single \'Dos Policías\'. LP2 was launched in 2010 with the single \'Tus Amigos\'. \'Una montaña es una montaña\', their third LP was produced by Pablo Díaz-Reixa <a href=\"https://www.last.fm/music/Los+Punsetes\">Read more on Last.fm</a>'),('Los Rebujitos',391703,28074,'THIS TEXT IS FROM WIKIPEDIA:\r\nManuel y Yerai forman el grupo \"Los Rebujitos\". Nacidos en Tarifa (Cádiz), sacan su primer disco en el año 2004 bajo el título \"Lo Que Me Gusta De Ti\". Un álbum con el cual logran hacerse un hueco en el mundo de la música, vendiendo mas de 40.000 mil copias y realizando más de 70 conciertos por toda la geografía española. Después de ese éxito deciden editar una Edición Especial, con temas extras y un DVD con algunos temas en concierto y videoclips. <a href=\"https://www.last.fm/music/Los+Rebujitos\">Read more on Last.fm</a>'),('Los Symon',0,0,NULL),('Los Tucanes De Tijuana',4158487,318306,'Los Tucanes de Tijuana is a Mexican band founded on 13 April 1987 by Mario Quintero Lara and a group of talented friends in Tijuana, Baja California, Mexico. From humble beginnings, starting their musical career by playing at nightclubs they rose to become the most successful and sought after Norteño band in Mexico, Latin America and the United States. They are by far the global ambassadors of Norteña music and Corrido ballads.\r\n\r\n\r\nLos Tucanes esta formado de cinco mexicanos originarios de Sinaloa México. <a href=\"https://www.last.fm/music/Los+Tucanes+de+Tijuana\">Read more on Last.fm</a>'),('LosDelGas',3673,524,' <a href=\"https://www.last.fm/music/Losdelgas\">Read more on Last.fm</a>'),('Louden',18960,4074,' <a href=\"https://www.last.fm/music/Louden\">Read more on Last.fm</a>'),('Louis Cole',4607813,198029,'Louis Cole is a Los Angeles-based singer-songwriter, producer and multi-instrumentalist. He is one half of the electro funk duo KNOWER, which he formed with Genevieve Artadi in 2009. The two also frequently collaborate with each other on their respective releases. He is also a member of the experimental duo Clown Core.\n\nLouis released his third studio album Time in 2018. He also has an active YouTube channel where he uploads music videos and other related content, including short comedy songs. <a href=\"https://www.last.fm/music/Louis+Cole\">Read more on Last.fm</a>'),('Love of Lesbian',11270313,174459,'Love of Lesbian is a Spanish indie pop/indie rock band. \r\nIn the beginning they were influenced by The Cure (they toured with them in Spain), Radiohead and R.E.M. Today they have the personal Love of Lesbian sound and style. There is always a \"sold out\" at all their concerts. Each one is a mix of party-concert-celebration-catharsis.\r\nSanti Balmes, the writer, main composer, and charismatic leader brings to each album excellent lyrics of high composition, from a delicious sense of humour to deep emotional tales. <a href=\"https://www.last.fm/music/Love+of+Lesbian\">Read more on Last.fm</a>'),('Luar La L',3103425,93452,' <a href=\"https://www.last.fm/music/Luar+La+L\">Read more on Last.fm</a>'),('Lucho RK',996825,28581,' <a href=\"https://www.last.fm/music/Lucho+RK\">Read more on Last.fm</a>'),('Luck Ra',3155115,113253,'Juan Facundo Almenara, conocido por su nombre artístico Luck Ra es un cantante, trapero y streamer argentino.​ <a href=\"https://www.last.fm/music/Luck+Ra\">Read more on Last.fm</a>'),('Ludovic Louis',NULL,NULL,NULL),('Lugeer',60,17,' <a href=\"https://www.last.fm/music/Lugeer\">Read more on Last.fm</a>'),('Luis Cortés',98554,9036,' <a href=\"https://www.last.fm/music/Luis+Cort%C3%A9s\">Read more on Last.fm</a>'),('Luis Enrique',1775393,230809,'Nicaraguan salsa vocalist Luis Enrique was one of Latin music\'s first pioneers of the romantic \"salsa sensual\" style. Approaching an otherwise aggressive and bright musical style with a smoother, more emotive sensibility, Enrique laid the groundwork for salsa and Latin pop artists to follow, such as Marc Anthony and Victor Manuelle. Enrique immigrated to the States in 1978, taking up residence in L.A. He applied the musical training and apprenticeship he\'d received from his father wherever possible <a href=\"https://www.last.fm/music/Luis+Enrique\">Read more on Last.fm</a>'),('Luis Fonsi',15027822,1309345,'Luis Alfonso Rodríguez López-Cepero, more commonly known as Luis Fonsi, (born April 15, 1978 in San Juan, Puerto Rico) is a Latin Grammy winning Puerto Rican singer, composer and soap opera actor.\r\n\r\nFonsi and his family moved to Orlando, Florida, during Fonsi\'s early childhood. Fonsi\'s childhood was relatively average for kids his age, beginning to dream about becoming a member of Menudo, arguably Latin America\'s most famous boy band in history, around the time he was ten years old. <a href=\"https://www.last.fm/music/Luis+Fonsi\">Read more on Last.fm</a>'),('Luis Miguel',35976243,829907,'Luis Miguel Gallego Basteri (born 19 April 1970) is a Mexican singer and icon in Latin America, often referred to as El Sol de México (The Sun of Mexico), which is the nickname his mother gave him as a child- \"mi sol\". He is widely regarded as the most successful artist in Latin American history, having successfully performed in a wide range of musical styles, including pop, ballads, boleros, tangos, jazz, big band and mariachi. Luis Miguel is also <a href=\"https://www.last.fm/music/Luis+Miguel\">Read more on Last.fm</a>'),('Luis R Conriquez',6628602,174972,'Luis Roberto Conriquez es un cantante mexicano de Sonora. Después de dejar su trabajo en una gasolinera, se centró en escribir canciones y pronto firmó con el sello independiente Kartel Music en 2018, donde lanzó su primer álbum Mis Inicios. Recibió atención con su sencillo \"El Buho\" en 2019, que fue uno de los sencillos de su disco Corridos Bélicos, que fue lanzado en 2020. Entre ese mismo año y 2022 lanzaría más álbumes y decenas de sencillos. <a href=\"https://www.last.fm/music/Luis+R+Conriquez\">Read more on Last.fm</a>'),('Luiz Arreguin',372,180,' <a href=\"https://www.last.fm/music/Luiz+Arreguin\">Read more on Last.fm</a>'),('luna jazzena',NULL,NULL,NULL),('M-Clan',1701047,116715,'M-Clan is a Spanish rock band. The band, initially named Murcíelagos Clan, was formed in Murcia, Spain in 1992 by Carlos Tarque and Ricardo Ruipérez.\r\n\r\nIn March 1993 the band added Santiago Campillo, Pascual Saura, Juan Otero and Iñigo Uribe, under the name \'El clan de los murciélagos\', (clan of bats), which soon became \'M-Clan\'. The band\'s sound was heavily influenced by Southern rock artists. The group currently consists of Carlos Tarque (vocals), J. <a href=\"https://www.last.fm/music/M-Clan\">Read more on Last.fm</a>'),('Maajjyyn',NULL,NULL,NULL),('Macaco',3220412,249240,'Macaco is a multicultural musical band from Barcelona, created in 1997 when ex-Magia Animal, Dr. No, and Ojos de Brujo, Macaco (Dani Carbonell) joined La Hermandad Chirusa, a band formed by talented musicians from Argentina, Colombia, Brazil, and Spain, to make his first solo record. The band has changed much over the years, the  only exception being Dani. The band members come from different countries such as Brazil, Cameroon, Venezuela and Spain.  <a href=\"https://www.last.fm/music/Macaco\">Read more on Last.fm</a>'),('Made famous by Tito el Bambino',343,126,' <a href=\"https://www.last.fm/music/Made+famous+by+Tito+El+Bambino\">Read more on Last.fm</a>'),('Madonna',346042751,5409793,'Madonna Louise Veronica Ciccone (born August 16, 1958 in Bay City, Michigan) is an American singer, songwriter and actress. She is considered one of the most influential figures in popular culture and has often been referred to as the \"Queen of Pop\". Madonna is noted for her continual reinvention and versatility in music production, songwriting and visual presentation. She is also known for pushing the boundaries of artistic expression in mainstream music, while maintaining control over every aspect of her career. <a href=\"https://www.last.fm/music/Madonna\">Read more on Last.fm</a>'),('Maga',1358284,93010,'There are two Maga´s.\r\n\r\nA Spanish band from Sevilla (Spain) with David García (drums), Javier Vega (bass) & Miguel Rivera (vocals, lyrics, keyboard and guitar)\r\n They took the name of Maga from a character of Julio Cortázar\'s book \"Rayuela\". \r\n Their 1st EP (Bidimensional) was one of the best EP\'s in Spain as said spanish music magazines as Muzikalia or Rockdelux. In 2002 they release Their first album  Maga (The white one). In 2004, they record their second album  Maga (the black one), and in 2006 the third, named Maga too (red) . <a href=\"https://www.last.fm/music/Maga\">Read more on Last.fm</a>'),('Magazine Street 24',NULL,NULL,NULL),('Maisak',673996,69816,'Maisak (born Maikel Rafael Rico Torres) is a rising Latin urban artist whose music fuses reggaetón with elements of vallenato and other coastal-Caribbean rhythms. He draws from both his Venezuelan roots and his upbringing in Colombia to craft a sound that blends romantic lyricism, nostalgic melodies and danceable urban production.\r\n\r\nHe began his career writing songs for other artists and later launched his solo work, gaining recognition through tracks that speak to love <a href=\"https://www.last.fm/music/Maisak\">Read more on Last.fm</a>'),('Makano',610004,85726,'Makano is a Panamanian reggaeton performer born on 1985 in\r\nPanama City, Panama. His official name is Ernan Enrique Jiménez. He became especially know for his album \"Te Amo\", which was released in United States in November 18, 2008 and peaked at number 29 in the Billboard Top Latin Albums chart. <a href=\"https://www.last.fm/music/Makano\">Read more on Last.fm</a>'),('Malcolm Todd',53037948,968240,'Best known for his warm, alternative R&B sound, 22 year-old Malcolm “Todd” Hobert hails from Los Angeles and is an up-and-coming lovesick musician.\r\n\r\nInitially starting with a small community of fans he eventually began advertising on TikTok and had a breakthrough with his single Art House. While being significantly popular, it paled in comparison to when he struck gold with an advertisement for the then-unreleased track, Roommates. 3 videos teasing the song gained upwards to 2 million views each. <a href=\"https://www.last.fm/music/Malcolm+Todd\">Read more on Last.fm</a>'),('Mallin',116888,27438,'Mallin is the Co-Owner of Hungarian Hot Wax Records, a Midlands based dance music record label alongside Glasgow Underground regular Sam Dexter. \n\nWith releases on labels like the famed Glasgow Underground, Mallin\'s music has been supported far and wide from house music legends like John Summit, Prunk & Kevin McKay. \n\nMallin\'s most notable club track \'Thick Of It\' has remained cemented at the top of Beatport\'s top 100 for more than half a year and <a href=\"https://www.last.fm/music/mallin\">Read more on Last.fm</a>'),('Malú',1337671,79365,'There are at least 4 singers named Malú or Malu.\r\n\r\n1.  María \'Malú\' Lucía Sánchez (born 15 March, 1982) is a singer from Madrid, Spain. Malú was discovered at the age of 15 when she was singing at a family party. She began the recording of her first album Aprendiz in January 1998. Malú is the niece of the flamenco singer-songwriter Paco de Lucía.\r\n\r\n2. Malu is a pop singer from Amsterdam, The Netherlands. There is no accent on the letter \'u\', but scrobbles of her songs end up here due to Last. <a href=\"https://www.last.fm/music/+noredirect/Mal%C3%BA\">Read more on Last.fm</a>'),('Maluma',29336581,948937,'Juan Luis Londoño Arias (Born January 28, 1994, Medellín, Colombia), is a singer of Colombian nationality. He began his musical career at an early age in his hometown of Medellín, there has developed an established career in Latin America, becoming nominated for several awards from major musical relevance.\r\n\r\nPrior to serving as a singer, Maluma started in football, a sport he practiced for eight years in a row, reaching the lower divisions of the equipment Atlético Nacional and La Equidad. <a href=\"https://www.last.fm/music/Maluma\">Read more on Last.fm</a>'),('mamiyosoyelth',47047,2880,' <a href=\"https://www.last.fm/music/mamiyosoyelth\">Read more on Last.fm</a>'),('Manhattan Jazz Quartett',NULL,NULL,NULL),('Manolito Simonet y su Trabuco',116520,15710,'Founded on February 25, 1993, and having already started to develop their style when various key members were part of Maravilla de Florida, Manolito y su Trabuco was one of the first timba bands, but it wasn\'t until the second wave, in 1995, that they released their first album, Directo al corazón. In 2006, about to release their 7th album, Hablando en serio, they\'ve enjoyed a gradual and steady rise in popularity and are now generally considered to be among the top three or four true timba bands in Havana. <a href=\"https://www.last.fm/music/Manolito+Simonet+Y+Su+Trabuco\">Read more on Last.fm</a>'),('Manu Cort',64181,4413,' <a href=\"https://www.last.fm/music/Manu+Cort\">Read more on Last.fm</a>'),('Manu Katché',NULL,NULL,NULL),('Manu López',NULL,NULL,NULL),('Manuel Carrasco',1205714,81886,'Manuel Carrasco (born January 15, 1981) is a Spanish singer who was born in Isla Cristina, Province of Huelva (Andalucía), Spain. He was one of the three finalists of the second edition of TV program Operación Triunfo and his debut album called \"Quiéreme\" sold more than 200,000 records. <a href=\"https://www.last.fm/music/Manuel+Carrasco\">Read more on Last.fm</a>'),('Manuel Turizo',9095984,488526,'Manuel Turizo Zapata (born April 12, 2000), better known as Manuel Turizo, is a Colombian reggaeton singer and songwriter. Born and raised in Montería, Córdoba, he began making music at the age of thirteen with the influence of his older brother, Julián Turizo. When he was sixteen he independently recorded and  three singles: \"Baila Conmigo\", \"Vámonos\" and \"Una Lady Como Tú\", the latter gained wide popularity in 2017, and shortly after he signed under the label La Industria Inc. <a href=\"https://www.last.fm/music/Manuel+Turizo\">Read more on Last.fm</a>'),('Mar Lucas',87415,10346,' <a href=\"https://www.last.fm/music/Mar+Lucas\">Read more on Last.fm</a>'),('Marc Anthony',10489531,793027,'Marco Antonio Muñiz (born September 16, 1964), better known by his stage name Marc Anthony.\r\n A New Yorker born and raised, the product of a music-loving Puerto Rican family, his parents named him Marco Antonio Muñíz in honor of the great Mexican balladeer of the same name. \r\nBorn Marco Antonio Muñiz September 16, 1964 (age 52)\r\nNew York City, New York, U.S.\r\nNationality American Puerto Rican\r\nOccupation Singer songwriter actor record producer television producer <a href=\"https://www.last.fm/music/Marc+Anthony\">Read more on Last.fm</a>'),('Marcela Mangabeira',734984,67278,'Marcela Mangabeira (born August 31, 1981)  is a Brazilian singer from the state of Mato Grosso. She began her singing career in 1998 and after winning numerous local singing contests, Marcela toured through Spain, Denmark, Germany, France and the UK as a guest singer with BossaCucaNova.\r\n\r\nIn 2003, she moved to Rio de Janeiro and recorded her first album Simples a year later.  <a href=\"https://www.last.fm/music/Marcela+Mangabeira\">Read more on Last.fm</a>'),('Marcelo Radomski',445,105,' <a href=\"https://www.last.fm/music/Marcelo+Radomski\">Read more on Last.fm</a>'),('Mari Froes',NULL,NULL,NULL),('Mark Ambor',5450448,551756,'Mark Damboragian (known professionally as Mark Ambor) (born December 4, 2000) is an American singer-songwriter. He is best known for his 2024 single \" Belong Together\". <a href=\"https://www.last.fm/music/Mark+Ambor\">Read more on Last.fm</a>'),('Mark9',17,8,' <a href=\"https://www.last.fm/music/mark9\">Read more on Last.fm</a>'),('Marlon',550011,35493,'There are four artists with this name:\r\n\r\n1. Marlon (born August 24, 1977 in Cuba) is a Cuban singer, better known as the winner of the third season of Objetivo Fama, a Puerto Rican reality-show -singing talent contest broadcast by Univision Puerto Rico, and Telefutura network in the United States.\r\n\r\nMarlon Fernández was born in La Lisa, Cuba in 1977 to José and Raquel Fernández. At the age of 14, he formed a five-piece band that would help him in his future career. <a href=\"https://www.last.fm/music/Marlon\">Read more on Last.fm</a>'),('Maroon 5',272604850,6440586,'Maroon 5 is an American pop rock band that originated in Los Angeles, California, United States. The group was formed in 1994 as Kara\'s Flowers while its members were still in high school and originally consisted of Adam Levine (lead vocals, guitar), Jesse Carmichael (guitar, backing vocals) Mickey Madden (bass guitar) and Ryan Dusick (drums). Kara\'s Flowers signed to Reprise Records and released an album, \"The Fourth World\", in 1997. After a tepid response to the album <a href=\"https://www.last.fm/music/Maroon+5\">Read more on Last.fm</a>'),('Marta Santos',220394,17683,' <a href=\"https://www.last.fm/music/Marta+Santos\">Read more on Last.fm</a>'),('Martin Hoper',NULL,NULL,NULL),('Martox',216534,38449,' <a href=\"https://www.last.fm/music/Martox\">Read more on Last.fm</a>'),('Marvin Gaye',84548650,3615839,'Marvin Pentz Gay, Jr. (2 April 1939 - 1 April 1984) was an American soul and rnb singer, songwriter, producer, and multi-instrumentalist, known as \"The Prince of Soul\", or \"The Prince of Motown.\" Originally a member of the doo-wop group The Moonglows, he pursued a solo career after the group disbanded and released many successful solo hits including \"I Heard It Through the Grapevine\", \"Let\'s Get It On\" and  \"What\'s Going On\". His best albums are still held in extremely high regard, and he is often cited as one of the finest singers of his era. <a href=\"https://www.last.fm/music/Marvin+Gaye\">Read more on Last.fm</a>'),('Mary Nelson',21371,4441,' <a href=\"https://www.last.fm/music/Mary+Nelson\">Read more on Last.fm</a>'),('Mateo Flowers',NULL,NULL,NULL),('Matt Bianco',NULL,NULL,NULL),('Matt Duncan',1587517,193770,'Matt Duncan is a classically trained instrumentalist and songwriter in his mid-20s. “Beacon” features smooth vocals, brilliant lyrics, and jawdropping syncopation, perfect pitch and painstaking, perfectionistic production.\r\n\r\nA Lafayette High School alum, Duncan first gained attention with the now-defunct Parlour Boys, one of Lexington’s strongest indie bands in decades. A pianist and vocalist who also plays bass, guitar and a number of other instruments, Duncan is also a member of the band Englishman, a project of Andrew English. <a href=\"https://www.last.fm/music/Matt+Duncan\">Read more on Last.fm</a>'),('Matt Hansen',4849995,198177,' <a href=\"https://www.last.fm/music/Matt+Hansen\">Read more on Last.fm</a>'),('Matt Maeson',13324716,611144,'Matt Maeson is an American singer-songwriter from Chesapeake Bay, Virginia. Learning drums and guitar at a young age and eventually touring as part of his father\'s prison ministry. Melding bluesy indie folk and modern production, he began posting tracks on SoundCloud and eventually caught the ear of Atlantic affiliate Neon Gold Records, which signed him in 2016. Maeson embarked on his first headlining tour that summer, which was presented by Communion, the music organization founded by Mumford & Sons\' Ben Lovett. <a href=\"https://www.last.fm/music/Matt+Maeson\">Read more on Last.fm</a>'),('Matteo Mancuso',NULL,NULL,NULL),('Mau y Ricky',2636735,192767,'For the past few years, Mauricio and Ricky Montaner had been busy writing songs for other artists like Thalía, Miguel Bosé, Diego Boneta, Yuridia, Leslie Grace, to name a few, until recently when they decided the songs they were composing would be for their EP titled Arte under the label of Sony Music.\r\n\r\nThe young duo, Mau y Ricky, sons of music icon Ricardo Montaner, have released the album\'s first single, \"Voy Que Quemo,\" a song they decided best represents the music that is coming out in the LP, expected to release in July. <a href=\"https://www.last.fm/music/Mau+y+Ricky\">Read more on Last.fm</a>'),('Max Carra',75531,9367,' <a href=\"https://www.last.fm/music/Max+Carra\">Read more on Last.fm</a>'),('Maxipaul',1209,307,' <a href=\"https://www.last.fm/music/Maxipaul\">Read more on Last.fm</a>'),('MAYOMA JAZZ TRIO',NULL,NULL,NULL),('Maytree',49194,9895,'1]Maytree are a electronica band from chester and wales. There sound is a mixture of drum \'n bass, house, trip hop, jungle, techno and generic dance.\nThey are:\n\nScott - Lead vocals, Synth\nChris - Lead guitar, vocals\nDuncan - bass guitar, vocals\nRichard - Brass, Vocals, Synth, Sampling. \n\n\n2]Maytree is a Korean a cappella vocal group. \n\nThe groups members are as follows:\n\nHan Yun-Joo (한연주) - Soprano\nKang Soo-Kyung (강수경) - Alto\nChoi Kyung-Young (최경영) - Tenor <a href=\"https://www.last.fm/music/Maytree\">Read more on Last.fm</a>'),('MC BF',1388728,109190,' <a href=\"https://www.last.fm/music/Mc+BF\">Read more on Last.fm</a>'),('Mc Brinquedo',950434,79745,'Vinícius Ricardo, conhecido como MC Brinquedo é um jovem funkeiro nascido em São Paulo e autor da música \'Boquinha De Aparelho\'. O cantor começou praticar na esquina da própria casa, brincando com seus amigos. Durante uma das cantorias, o Mc 2K, padrinho do Mc Brinquedo, o chamou para fazer parte da equipe de artistas do escritório da KL.\n\nBrinquedo tornou-se popular na internet fazendo uso de redes sociais como o facebook, Twitter e Instagram, onde com frequência interage com fãs e publica seu dia a dia. <a href=\"https://www.last.fm/music/MC+Brinquedo\">Read more on Last.fm</a>'),('Melba Moore',677532,123188,'Melba Hill, 29 October 1945, New York City, New York, USA. Based in New York, Melba Moore first attracted attention in the Broadway production of Hair. Although she has continued her thespian inclinations, winning an award for her performance in the musical Purlie, Moore has also forged a successful singing career. \'This Is It\', a minor US hit, reached the UK Top 10 in 1976, and although her pop chart placings have since been inconsistent, Moore remained a fixture on the R&B lists over the following decade. <a href=\"https://www.last.fm/music/Melba+Moore\">Read more on Last.fm</a>'),('Melendi',7761386,307000,'His full name is Ramón Melendi Espina. Spanish pop singer with rock, flamenco, and rumba influences. Was born on January 21, 1979 in Oviedo, Asturias. \r\n\r\nHe realized very quickly that he wasn\'t made for studying, but he was good at soccer. He played in the lower ranks of Astur CF, at the time a reserve team for Real Oviedo. Afterwards, he worked as a waiter in several bars and spent all night out, living experiences that would later go on to make up the lyrics of his songs. <a href=\"https://www.last.fm/music/Melendi\">Read more on Last.fm</a>'),('Melody Explorer',NULL,NULL,NULL),('Melody Gardot',NULL,NULL,NULL),('Memortal',22881,3257,' <a href=\"https://www.last.fm/music/Memortal\">Read more on Last.fm</a>'),('Mengui y Carmelo',2214,429,' <a href=\"https://www.last.fm/music/Mengui+y+Carmelo\">Read more on Last.fm</a>'),('Mentol',50419,11069,' <a href=\"https://www.last.fm/music/Mentol\">Read more on Last.fm</a>'),('Mentolados',169,43,' <a href=\"https://www.last.fm/music/Mentolados\">Read more on Last.fm</a>'),('Mesita',4210571,224061,'Mesita is the name of more than one artist:\r\n1) US indie pop \r\n2) Uruguay rap/trap \r\n\r\n1) James Cooley AKA Mesita is an American multi-instrumentalist from Colorado. He started releasing music under The Frustration Corporation, a plunderphonics project. He released his debut album under Mesita, Cherry Blossoms, in June 2008, with his debut EP No Worries coming out around a year later. In 2010, he released his second EP Living/Breathing. The EP changed his sound from indie rock to a more polished indietronica/pop sound. <a href=\"https://www.last.fm/music/Mesita\">Read more on Last.fm</a>'),('Metric',108269225,2737766,'Metric are an indie rock/New Wave band formed in 1998 in Toronto, Canada. The band members are Emily Haines (vocals, synths, guitar, tambourine), James Shaw (guitar, synths, theremin, backing vocals), Josh Winstead (bass, synths, backing vocals) and Joules Scott-Key (drums). The band name was inspired after a sound called \"Metric\" that was programmed by Shaw on his keyboard. They were based at various times at Toronto, Montreal, London, NYC and LA. <a href=\"https://www.last.fm/music/Metric\">Read more on Last.fm</a>'),('Mezzoforte',NULL,NULL,NULL),('MGMT',212909460,5124157,'MGMT is an American alternative band which formed in 2002 in Middletown, Connecticut, United States. The band\'s founding members, Andrew VanWyngarden (lead vocalist, primary songwriter, multi-instrumentalist) and Ben Goldwasser (backing vocalist, multi-instrumentalist), met while attending Wesleyan University, and have remained as the core of the group to this day.\r\n\r\nThey intially named their project The Management, under which they recorded two demo EPs (which ended up being unofficially leaked online in 2005 as Climbing to New Lows) <a href=\"https://www.last.fm/music/MGMT\">Read more on Last.fm</a>'),('Miami Horror',14014955,778646,'Miami Horror are an Australian indie-electronic band from Melbourne, Australia (with the name referring to producer, Benjamin Plant, and to the four-piece live incarnation). Beginning in  2007 under the moniker Miami Horror, Plant started with a series of remixes. The debut release came in 2008 with a five-track EP, Bravado, on Virgin Records. The live show has Plant augmented by Josh Moriarty (Peacocks, ex-Young & Restless) (guitars), DJ/producer Aaron Shanahan (drums), and Daniel Whitechurch (bass, keyboards, and guitars). <a href=\"https://www.last.fm/music/Miami+Horror\">Read more on Last.fm</a>'),('Michael Foster',20652,2726,'Michael Foster (musician)  (born December 9, 1966)\r\n\r\nAfter over 20 auditions, for a band called White Heat where Bill Leverty played. \r\nMichael Foster was one of those people whom auditioned and when Leverty heard Michael Fosters drumming skills, Bill Leverty  was impressed and he quickly hired him. eventually they would met C.J. Snare and Perry Richardson, forming Firehouse in 1988.\r\n\r\nMichael Foster\'s Official Site\r\n\r\nFirehouse Official\r\n\r\nMichael Foster Likes The Pittsburgh Steelers, And NASCAR\r\n\r\n <a href=\"https://www.last.fm/music/Michael+Foster\">Read more on Last.fm</a>'),('Michael Marc',112858,19044,' <a href=\"https://www.last.fm/music/Michael+Marc\">Read more on Last.fm</a>'),('Michael Marcagi',4218121,368845,'Michael Marcagi is an American singer-songwriter from Cincinnati, Ohio. Prior to his solo career, Marcagi performed in a band called the Heavy Hours. \r\n\r\nMarcagi released his solo debut single, \"The Other Side\", in December 2023. \r\n\r\nMarcagi\'s debut EP, American Romance, was released in February 2024. <a href=\"https://www.last.fm/music/Michael+Marcagi\">Read more on Last.fm</a>'),('Michel Camilo',NULL,NULL,NULL),('Micky More & Andy Tee',25456,6563,' <a href=\"https://www.last.fm/music/Micky+More+&+Andy+Tee\">Read more on Last.fm</a>'),('Micky Santana',1966,606,' <a href=\"https://www.last.fm/music/Micky+Santana\">Read more on Last.fm</a>'),('MIDI, MIX & SOUL',1,1,' <a href=\"https://www.last.fm/music/MIDI,+MIX+&+SOUL\">Read more on Last.fm</a>'),('Midnight Groove Ensemble',NULL,NULL,NULL),('Miguel Bosé',6056882,322795,'Miguel Luchino González Bosé (born April 3, 1956) is a Latin Grammy-winning musician and actor from Spain. He is one of the biggest stars in the Spanish speaking world mainstream, both in Spain and Latin America, and a well-known actor in French cinema as well.\r\n\r\nBosé was born in San Fernando Hospital in Panama City, Panama, the son of the famous Italian actress Lucia Bosé and the legendary bullfighter Luis Miguel González Lucas. He is also cousin of Carmen Ordóñez. His Godfather was Luchino Visconti. <a href=\"https://www.last.fm/music/+noredirect/Miguel+Bos%C3%A9\">Read more on Last.fm</a>'),('Miguel Bueno',150774,22962,' <a href=\"https://www.last.fm/music/Miguel+Bueno\">Read more on Last.fm</a>'),('Mike Terrana',NULL,NULL,NULL),('Mike Turk',1617,151,' <a href=\"https://www.last.fm/music/Mike+Turk\">Read more on Last.fm</a>'),('Mikel Izal',158820,10712,'Mikel Izal, (Pamplona, 1982) es un destacado compositor y cantante reconocido por su participación en el grupo IZAL. Su incursión en el mundo de la música profesional se produjo a los 24 años, tras su llegada a Madrid. En la capital, comenzó a frecuentar el circuito de cantautores, obteniendo en 2008 diversos premios relacionados con la música de autor, como el Certamen de Jóvenes Creadores de la Comunidad de Madrid. En 2010, Mikel Izal emprende un nuevo camino al fundar el grupo IZAL <a href=\"https://www.last.fm/music/Mikel+Izal\">Read more on Last.fm</a>'),('Miki Martz',59442,4459,' <a href=\"https://www.last.fm/music/Miki+Martz\">Read more on Last.fm</a>'),('Miles Davis',NULL,NULL,NULL),('Miles Vesper',NULL,NULL,NULL),('Militantes del Climax',NULL,NULL,NULL),('Milo Grande',NULL,NULL,NULL),('Ministry Of Funk',108597,23479,'Alias of DJ Marcello Castelli <a href=\"https://www.last.fm/music/Ministry+Of+Funk\">Read more on Last.fm</a>'),('Miquel Casany & Arturo Serra',116,42,' <a href=\"https://www.last.fm/music/Miquel+Casany+&+Arturo+Serra\">Read more on Last.fm</a>'),('MiSHNRZ',27521,4148,' <a href=\"https://www.last.fm/music/MiSHNRZ\">Read more on Last.fm</a>'),('Miss Caffeina',1948667,64200,'Miss Caffeina is an indie pop/rock group from Spain, formed in Madrid in 2006. The band\'s current lineup features Alberto Jiménez (vocals), Sergio Sonal (guitar), Antonio Poza (bass), and Álvaro Navarro (keyboards).\r\nThe band initially gained recognition with a series of EPs, including Destrucción Creativa (2007), En Marte y Carrusel (2008), and Magnética (2009). Their debut full-length album, Imposibilidad del fenómeno, was released in 2010. <a href=\"https://www.last.fm/music/Miss+Caffeina\">Read more on Last.fm</a>'),('Mitzi',649425,65163,'	\nMitzi, the guise of Dominiqe Bird, Jad Lee, Charles Murdoch and Cale Suesskow in what first seemed to be an unusual collaboration, has taken form, developing a recognisable sound.\n\nAfter playing in various accomplished bands such as BMX (2009 unearthed Parklife winners), Comic Sans (2010 unearthed St.Jeromes Laneway winners), Charlie Why! (Bang Gang 12 inches) and The Gallery Kiss, the four have brought their own unique traits to the table, creating a sound that is smooth, warm and full. <a href=\"https://www.last.fm/music/Mitzi\">Read more on Last.fm</a>'),('Mixmaster',12560,2123,' <a href=\"https://www.last.fm/music/Mixmaster\">Read more on Last.fm</a>'),('Mk.gee',28633223,671371,'Michael Todd Gordon (born September 27, 1996), better known by his stage name Mk.gee, is an American singer-songwriter, music producer, and multi-instrumentalist. His career began in 2017 with the release of his debut single, \"I Know How You Get\". In 2018, he followed up with two EPs, Pronounced McGee, and Fool, before releasing his debut mixtape, A Museum of Contradiction, in 2020. In 2024, Gordon released his debut studio album, Two Star & the Dream Police. <a href=\"https://www.last.fm/music/Mk.gee\">Read more on Last.fm</a>'),('Mo\' Better Band',817,29,' <a href=\"https://www.last.fm/music/Mo%27+Better+Band\">Read more on Last.fm</a>'),('Mocean',7989,2831,'mOcean (mo-shun) is a four piece rock band based out of Virginia Beach, VA. The members consist of Nick Gargiulo (guitar/vocals), Will Beasley (guitar/vocals), Jacob Caburian (bass/vocals), and Matt Cole (drums). \r\n\r\nhttp://www.moceanband.com/ <a href=\"https://www.last.fm/music/MOcean\">Read more on Last.fm</a>'),('Módulos & Los Iberos',1432,334,' <a href=\"https://www.last.fm/music/M%C3%B3dulos+&+Los+Iberos\">Read more on Last.fm</a>'),('Mohombi',3680435,435915,'Mohombi Nzasi Moupondo (born 28 August 1986 in Kinshasa, Democratic Republic of the Congo), known professionally as Mohombi, is a Swedish-Congolese R&B singer-songwriter and dancer. Mohombi is RedOne\'s first signing to 2101 Records in joint venture with Universal Music Group. From 2004 to 2008 Mohombi was part of the Swedish hip hop group Avalon with his brother Djo Moupondo. Mohombi released his debut solo single \"Bumpy Ride\" in August 2010. The single became a top-ten hit in many European countries <a href=\"https://www.last.fm/music/Mohombi\">Read more on Last.fm</a>'),('Monique Kessous',NULL,NULL,NULL),('Monyaka',17906,4634,'Monyaka was a funk group based out of Los Angeles, California. The members included Beres Barnett (vocals, guitar), Errol Moore (guitar), John Allen (keyboards), William Brown (keyboards), Larry McDonald (percussion), Val Douglas (bass), and Richie Bertram (drums).\n\nGo Deh Yaka is a disco reggae stomper from the early 80s. The song charted on August 6, 1983 and spent 7 weeks on the US charts and reached #48. <a href=\"https://www.last.fm/music/Monyaka\">Read more on Last.fm</a>'),('Morat',21360591,292486,'Morat is a Colombian band formed in the country\'s capital city, Bogotá. The band is formed by Juan Pablo Isaza (guitars and vocals), Juan Pablo Villamil (banjo and vocals) and the brothers Simón Vargas (bass and choruses) and Martín Vargas (percussion and choirs). Previously, until the end of 2016, drummer Alejandro Posada had been in the band, but the percussionist had to leave the project, being subsequently replaced by Martín Vargas.\r\n\r\nThey began to stand out internationally in 2015 <a href=\"https://www.last.fm/music/Morat\">Read more on Last.fm</a>'),('Morocco\'s Band',13288,3371,' <a href=\"https://www.last.fm/music/Morocco%27s+Band\">Read more on Last.fm</a>'),('Mr Mystery',NULL,NULL,NULL),('MR WIGGLES',10745,1149,'Mr Wiggles is one of the original members of the legendary Rocksteady Crew. Besides a bboy, he also is involved in graffiti and dj\'in(producing) doing various workshops. Don\'t miss him if he comes in your town. <a href=\"https://www.last.fm/music/Mr+Wiggles\">Read more on Last.fm</a>'),('Mr. 40Fo Phantom',56,15,' <a href=\"https://www.last.fm/music/MR.+40FO+PHANTOM\">Read more on Last.fm</a>'),('Mr. Eric & Mr. Michael',25987,5052,' <a href=\"https://www.last.fm/music/Mr.+Eric+&+Mr.+Michael\">Read more on Last.fm</a>'),('Mr. Talkbox',31243,5806,' <a href=\"https://www.last.fm/music/Mr.+Talkbox\">Read more on Last.fm</a>'),('Music P',42593,11898,' <a href=\"https://www.last.fm/music/Music+P\">Read more on Last.fm</a>'),('MVSTERIOUS',586930,42911,' <a href=\"https://www.last.fm/music/MVSTERIOUS\">Read more on Last.fm</a>'),('My Chemical Romance',505290090,4688542,'My Chemical Romance is an American rock band from New Jersey, United States formed in 2001. The band consists of lead vocalist Gerard Way, guitarists Ray Toro, Frank Iero and bassist Mikey Way. Shortly after forming, the band signed to Eyeball Records and released their debut album I Brought You My Bullets, You Brought Me Your Love in 2002. They signed with Reprise Records the next year and released their major label debut Three Cheers for Sweet Revenge <a href=\"https://www.last.fm/music/My+Chemical+Romance\">Read more on Last.fm</a>'),('Myke Towers',25528811,614894,'Myke Towers, whose real name is Michael Torres, is a Puerto Rican rapper and composer born on January 15, 1994 in Río Piedras, Puerto Rico. Since his teenage years, Myke Towers has been involved in the underground rap scene in Puerto Rico under the name Mike Towers, and his first compositions and freestyles were published on his SoundCloud account. He gained recognition in 2014 with songs such as \"Día de cobro\", \"Por Mí\", \"Es Normal\" and \"En los Bloques\". <a href=\"https://www.last.fm/music/Myke+Towers\">Read more on Last.fm</a>'),('Myles Smith',7943750,542018,'Myles Smith (born in Luton on 3 June 1998) is a British singer-songwriter. \r\n\r\nFrom a young age, Smith taught himself to play guitar and piano, and by the age of 12, he was performing at local open-mic nights. Smith began posting cover versions of songs on TikTok in August 2020. His acoustic cover of The Neighbourhood\'s \"Sweater Weather\" went viral in 2022, leading to its full release in February 2023. He gained significant attention with his covers, including Amber Run’s \"I Found\". <a href=\"https://www.last.fm/music/Myles+Smith\">Read more on Last.fm</a>'),('Naama',NULL,NULL,NULL),('Nanpa Básico',2249666,92073,' <a href=\"https://www.last.fm/music/Nanpa+B%C3%A1sico\">Read more on Last.fm</a>'),('Nari',214561,49789,'Melancholia (nari) is a 17 year old agender musician from South Africa. Her first recorded song was under an unknown alias and released in March of 2019. Since then, she has expanded continuously and developed her sound as an artist predominant in the Hyperpop scene <a href=\"https://www.last.fm/music/nari\">Read more on Last.fm</a>'),('Nassim & M-Why',6657,1202,' <a href=\"https://www.last.fm/music/Nassim+&+M-Why\">Read more on Last.fm</a>'),('Nate James',373896,37501,'Nates James is a British soul singer / songwriter who released his debut album, Set The Tone, in 2005. The album, heavily influenced by classic soul artists such as Prince and Stevie Wonder, won James widespread critical acclaim and two MOBO nominations for Best Newcomer and Best R&B Artist. The album, penned almost entirely by James, spans a wide variety of music styles, from the bassy R&B of \"Set The Tone\" and the upbeat pop of \"Universal\" to classic ballad \"Justify Me\" and verging on rock influences in \"I\'ll Decline\". <a href=\"https://www.last.fm/music/Nate+James\">Read more on Last.fm</a>'),('Nateki',1475444,155762,' <a href=\"https://www.last.fm/music/Nateki\">Read more on Last.fm</a>'),('NDKj',14687,4643,'DJ and producer NDKj aka: Andrea Quirico was born in 1981 in Novara (Italy). \n\nHe became fascinated with electronic music – especially techno – at a young age and soon started djing himself. His first DJ appearance was in 1998 when he played in some smaller clubs and private parties in Northern Italy. At that time his sound was inspired by some of the big names in the techno scene who were known for playing hard but groovy techno. But “only” <a href=\"https://www.last.fm/music/NDKj\">Read more on Last.fm</a>'),('Ne-Yo',61081981,3248463,'\r\nShaffer Chimere Smith (born on October 18, 1979 in Camden, Arkansas), better known by his stage name Ne-Yo, is a Grammy Award winning American R&B singer, producer and actor currently signed to Def Jam Records. In 2006 he released his debut album In My Own Words, which featured the hit single So Sick. The song reached #1 on the Billboard Hot 100 and helped his album debut at #1 on the Billboard 200. He has since released 2007\'s Grammy award winning Because of You and 2008\'s Year of the Gentleman <a href=\"https://www.last.fm/music/Ne-Yo\">Read more on Last.fm</a>'),('Nebulossa',1076748,62449,'Nebulossa is a Spanish electropop duo from Ondara, consisting of singer Maria \"Mery\" Bas (born 18 September 1968) and keyboardist and producer Mark Dasousa (born 2 January 1974).\r\n\r\nNebulossa formed in 2018. The name of the group alludes to nebulae (nebulosa in Spanish) because on a trip to Port Ainé they went to an astronomical observatory where they constantly mentioned them. The double S is a symbolic reference to the Valencian, because the way the word is pronounced in Spanish <a href=\"https://www.last.fm/music/Nebulossa\">Read more on Last.fm</a>'),('Ñejo & Dalmata',1128718,95936,'Ñejo & Dálmata, also known as Ñejo y Dálmata, are a reggaeton duo from Ponce, Puerto Rico. They had worked together in collaborations with other reggaeton artists before they released their album Broke & Famous in 2007. Some of Ñejo\'s and some of Dálmata\'s songs have reached the Billboard 200 in 2006 and 2007.\r\n\r\nÑejo has been involved with reggaeton since the production of DJ Joe 5 was released. They started working as a duo on Fatal Fantasy 2. <a href=\"https://www.last.fm/music/+noredirect/%C3%91ejo+&+Dalmata\">Read more on Last.fm</a>'),('Nelly Furtado',111440053,4679661,'Nelly Kim Furtado (born December 2, 1978 in Victoria, British Columbia) is a Canadian singer and songwriter. Furtado has sold over 40 million records worldwide, making her one of the most successful Canadian artists. She is widely known for her musical versatility and genre experimentation.\r\n\r\nShe first gained fame with her trip hop-inspired debut album, Whoa, Nelly! (2000), which was a critical and commercial success that spawned two top-10 singles on the Billboard Hot 100, \"I\'m Like a Bird\" and \"Turn Off the Light\". <a href=\"https://www.last.fm/music/Nelly+Furtado\">Read more on Last.fm</a>'),('Ñengo Flow',4862065,225973,'Edwin Rosa, publicly popular as \"Ñengo Flow\" is a hip hop artist and composer of Puerto Rican music. Its fast and complex letters have referred to as the \"Real G\" urban type.\r\n\r\nFlow Ñengo born on October 15, 1981 in the town of Rio Piedras. This great rapper grew and raised in the town of Bayamon, Puerto Rico. It is there since childhood he was interested the world of urban music. His beginnings as a rapper were developed with letters of the street, everyday living Edwin Rosa. <a href=\"https://www.last.fm/music/+noredirect/%C3%91engo+Flow\">Read more on Last.fm</a>'),('Never Dull',570085,78440,'Born and raised in San Diego, Never Dull mixes his Latin American heritage with the Californian vibes he has always known to produce his energizing groovy sound and share nothing but positive vibes with dance music lovers around the globe.\n\nProducing tracks since 2017, Never Dull has released more than 100 official tracks including original productions, disco edits, and remixes ranging from old classic house to nu-disco. Along the way, he has received support from DJs like Disclosure <a href=\"https://www.last.fm/music/Never+Dull\">Read more on Last.fm</a>'),('Nevo',3726,849,' <a href=\"https://www.last.fm/music/+noredirect/Nevo\">Read more on Last.fm</a>'),('Nguyên Lê',NULL,NULL,NULL),('Nick Jonas',20937745,1257075,'\r\nNicholas Jerry \"Nick\" Jonas (born September 16, 1992) is an American singer-songwriter and actor best known as one of the Jonas Brothers, a pop-rock band he formed with his brothers Joe and Kevin. After 2010, Nick has focused primarily on his own career, releasing solo material, appearing in musicals, and acting in film and television.\r\n\r\nA performer since the age of seven (the age at which he joined the Broadway cast of Annie Get Your Gun), Nicholas made his songwriting debut in 2002 <a href=\"https://www.last.fm/music/Nick+Jonas\">Read more on Last.fm</a>'),('Nicki Minaj',298506037,4626487,'Onika Tanya Maraj-Petty, born December 8th, 1982, is known professionally as Nicki Minaj. Minaj is a Trinidadian-born rapper and singer based in the United States of America. Nicki Minaj is most recognized for her musical versatility, alter egos, and the animated flow of her raps. She first gained underground attention after releasing her debut mixtape, Playtime Is Over. Nicki later released two more mixtapes before her debut album, Sucka Free and Beam Me Up Scotty. <a href=\"https://www.last.fm/music/Nicki+Minaj\">Read more on Last.fm</a>'),('Nicky Jam',14544489,998952,'\r\nNick Rivera Caminero better known as Nicky Jam was born to a Puerto Rican father and a Dominican mother in 1980 in Boston Massachussets which he live in until he was six and moved to \r\nBarrio Obrero, P.R. He is a reggaeton artist known for hits like:\r\n\"Me Voy Pa\'l Party\" \"Chambonea\" \r\n\"No Soy Tu Marido\" \"I\'m Not Your Husband\" which is a remix in spanglish of \"No Soy Tu Marido\"\r\n <a href=\"https://www.last.fm/music/Nicky+Jam\">Read more on Last.fm</a>'),('Nickzzy',384719,20523,' <a href=\"https://www.last.fm/music/Nickzzy\">Read more on Last.fm</a>'),('Nils Landgren Funk Unit',808582,76381,'Nils Landgren was born in 1956. He began playing drums at the age of six. At 13 he layed his hands and lips on the trombone and was hooked for life.\nBetween 1972 and 1978 Nils studied classical trombone at the music college in Karlstad with David Maytan and at the university in Arvika with Ingemar Roos. During this time he also met the legendary Swedish Folk-Jazz pioneer Bengt-Arne Wallin and the fantastic tromboneplayer and proffessor of the Graz Conservatory in Austria, Eje Thelin. <a href=\"https://www.last.fm/music/Nils+Landgren+Funk+Unit\">Read more on Last.fm</a>'),('Nils Ohrmann',31447,7377,' <a href=\"https://www.last.fm/music/Nils+Ohrmann\">Read more on Last.fm</a>'),('Nine Sparks Riots',NULL,NULL,NULL),('Niños Bravos',17803,2069,' <a href=\"https://www.last.fm/music/Ni%C3%B1os+Bravos\">Read more on Last.fm</a>'),('Niños Mutantes',1138984,44250,'Spanish Indie Pop band from Granada (Spain)formed in 1994 with 3 members (Nani Castañeda on drums, Migue Haro on bass and J.A. Martínez on lyrics and guitar). Nani and Migue were members of the band Mama Baker.\r\nThe name comes from an art exhibition in Berlin with rare pics of Mutant Children.\r\nTheir influences are The Beatles, Los Brincos, David Bowie, P.j. Harvey, dEUS, Suede, Surfin Bichos, Pixies ...\r\nA band with their own personality and original ideas, deep lyrics and powerful guitars and drums. \r\n <a href=\"https://www.last.fm/music/+noredirect/Ni%C3%B1os+Mutantes\">Read more on Last.fm</a>'),('Nio Garcia',5385263,364417,'Luis Antonio Quiñones García conocido por su nombre artístico Nio García es un cantante, compositor y bailarín puertorriqueño.​​ <a href=\"https://www.last.fm/music/Nio+Garcia\">Read more on Last.fm</a>'),('Niuver',NULL,NULL,NULL),('NMIXX',75973186,680223,'NMIXX (Hangul: 엔믹스; Katakana: エンミックス; known pre-debut as JYPn) is a South Korean girl group formed by SQU4D, a sub-label of JYP Entertainment. The current members are:LILY (릴리), HAEWON (해원), SULLYOON (설윤), BAE (배이), JIWOO (지우), KYUJIN (규진). Originally as seven, they debuted on February 22, 2022 with the single album AD MARE.\r\n\r\nName Meaning:The name NMIXX is a compound word of the letter \'N\', which stands for \"now <a href=\"https://www.last.fm/music/NMIXX\">Read more on Last.fm</a>'),('Nonpalidece',1070158,71483,'Nonpalidece es un grupo argentino de reggae, formado en 1996, originalmente por Néstor Ramljak (voz y guitarra), Facundo Cimas (bajo), Diego Bravo (guitarra) y Galo Llorente (batería). Más tarde, se unen a la banda Ariel Sciacaluga y Leo Rodríguez (percusión), Bruno Signaroli (trompeta), Agustín Azubel (saxo tenor), German Bonilla (batería) y Martín Mortola (teclado). Actualmente es la banda de Reggae Roots mas grande de la Argentina, superando por ejemplo a Los Cafres, con la cual no tienen buena relacion. <a href=\"https://www.last.fm/music/Nonpalidece\">Read more on Last.fm</a>'),('Norman Rocha',0,0,NULL),('Nova y Jory',709178,72062,'Nova & Jory, are a reggaeton duo. Nova, was born in Ponce, Puerto Rico and Jory was born in Carolina, Puerto Rico. They started their career in 2003, are currently signed to Millones Records. They are working on their debut album Mucha Calidad set to be released November 2010. \r\n\r\nFernando L. González, known as “Nova” was born in Ponce, Puerto Rico, and raised in Santa Isabel and Peñuelas, Puerto Rico. Fernando Sierra, better known as “Jory” was born in Carolina, Puerto Rico, and raised in the Residencial Torres de Sabana. <a href=\"https://www.last.fm/music/Nova+y+Jory\">Read more on Last.fm</a>'),('NTG',418108,28446,' <a href=\"https://www.last.fm/music/NTG\">Read more on Last.fm</a>'),('Nut-K',851,185,'Nut-K first began DJing in his early teenage years. Before long he was making mixtapes for his buddies. One thing led to the other, and eventually, he had to try my skills as a musician. He hasn’t exactly been super devoted to getting his music out in the world. To him, it’s always been more about having fun and enjoying the process. He still does, although the creation process these days looks quite different from the early years. <a href=\"https://www.last.fm/music/Nut-k\">Read more on Last.fm</a>'),('NXGHT!',961342,77930,'NXGHT! is a Brazilian music producer whose work seamlessly blends phonk, electronic, and dark atmospheric elements. His music is high-energy, raw, and intense, creating a unique space in the underground music scene. What started out as a hobby of making beats has quickly turned into a flourishing career, making NXGHT! one of the most exciting figures in the genre today.\n\nAlthough details about his real name, birthdate, and early life remain unknown, NXGHT!’s music speaks for itself. <a href=\"https://www.last.fm/music/NXGHT%21\">Read more on Last.fm</a>'),('O.C.A',63145,5523,' <a href=\"https://www.last.fm/music/O.C.A\">Read more on Last.fm</a>'),('Ocean Breeze Band',NULL,NULL,NULL),('Oden & Fatzo',2693694,269979,'The electronic live trio is a Parisian underground singularity. \nAfter hitting numerous clubs, the ensemble is on the road again to explore new venues and spread their erratic vibes.\nTheir music is a continuous flow of complex grooves with broke rhythms mixing minimal, house and funky techno music infusing bright and psychedelic ambiances. <a href=\"https://www.last.fm/music/Oden+&+Fatzo\">Read more on Last.fm</a>'),('Odyssey',1989752,304970,'Odyssey is a name of at least nineteen acts:\n\n1) A New York based U.S. billboard charts scored dance act.\n2) A U.S. psychedelic rock group\n3) A Swedish progressive metal band by Dan Swanö\n4) A German eurodance project\n5) A Greek project name used by Vangelis\n6) A U.S. drum & bass producer\n7) A later name of a band called Oracle\n8) A U.S. Motown album by a pop group from 1972\n9) A Brent Smedley (Iced Earth\'s drummer) solo group\n10) A Polish electronica/ambient project <a href=\"https://www.last.fm/music/Odyssey\">Read more on Last.fm</a>'),('Ogryzek',4653399,253361,'Sebastian Kryrstian Ogryzek (born 2003) known simply as Ogryzek is a Polish music producer. His musical style has been described as Brazilian funk, drawing inspiration from artists like PXLWYSE and Eternxlkz.\nOgryzek skyrocketed to fame on Tik Tok with his viral tracks GLORY &  AURA. <a href=\"https://www.last.fm/music/ogryzek\">Read more on Last.fm</a>'),('Ohio Players',4012180,577071,'The Ohio Players was a funk and R&B band whose heyday was in the mid- to late 1970s. They formed in Dayton, Ohio in 1959 as the Ohio Untouchables, and initially included members Robert Ward (vocals/guitar), Marshall \"Rock\" Jones (bass), Clarence \"Satch\" Satchell (saxophone/guitar), Cornelius Johnson (drums), and Ralph \"Pee Wee\" Middlebrooks (trumpet/trombone). The Ohio Untouchables broke up in 1963, with Ward leaving for a solo career, but the core <a href=\"https://www.last.fm/music/Ohio+Players\">Read more on Last.fm</a>'),('Oki y Los Pibes De Oro',88,18,' <a href=\"https://www.last.fm/music/Oki+y+Los+Pibes+De+Oro\">Read more on Last.fm</a>'),('Oli Silk',NULL,NULL,NULL),('Oliver Crosby',NULL,NULL,NULL),('Olivia Dean',NULL,NULL,NULL),('Omar Courtz',8878497,191091,'Joshua Omar Medina Cortés (Carolina, Puerto Rico, 11 de octubre de 1997), conocido artísticamente como Omar Courtz, es un cantante y compositor puertorriqueño de los géneros reguetón, trap y Rhythm and blues latino. <a href=\"https://www.last.fm/music/Omar+Courtz\">Read more on Last.fm</a>'),('Omar Montes',1869858,111584,'Omar Ismael Montes Moreno es un cantante y personaje mediático español que se dio a conocer por sus apariciones en reality shows como Mujeres y hombres y viceversa, Gran Hermano VIP y Supervivientes, así como por su relación con Isa Pantoja, hija de Isabel Pantoja.​ <a href=\"https://www.last.fm/music/Omar+Montes\">Read more on Last.fm</a>'),('Omar Rodríguez-López Group',NULL,NULL,NULL),('Omega',3577375,320232,'The are multiple artists called Omega:\r\n1. A Hungarian progressive and hard rock band\r\n2. An alias of techno musician Naoki\r\n3. A Lithuanian pop group\r\n4. An American rapper\r\n5. A dubstep artist\r\n6. A British metal band\r\n7. A Greek black/thrash/speed metal band\r\n8. A Dominican mambo singer\r\n9. A Chilean rapper\r\n10. An Italian black/avantgarde/ambient metal band\r\n11. A Beat rock ensemble from Estonia\r\n\r\n1. Omega is one of the most successful Hungarian rock bands. <a href=\"https://www.last.fm/music/Omega\">Read more on Last.fm</a>'),('ONE OK ROCK',51764347,598305,'ONE OK ROCK (ワンオクロック, \"ok\" pronounced as a word) is a Japanese alternative rock/pop punk band from Tokyo formed in 2005. They play varied styles of music, with songs ranging from alternative rock and emo to post-hardcore and pop punk.\r\n\r\nMembers:\r\n* Vocals: Taka (森内 寛貴, Moriuchi Takahiro, born April 17, 1988 in Tokyo)\r\n* Guitar, backing vocals: Toru (山下 亨, Yamashita Tōru, born December 7, 1988 in Osaka)\r\n* Bass: Ryota (小浜 良太, Kohama Ryōta, born September 4, 1989 in Osaka)  <a href=\"https://www.last.fm/music/ONE+OK+ROCK\">Read more on Last.fm</a>'),('ONIKX',6094,2401,' <a href=\"https://www.last.fm/music/ONIKX\">Read more on Last.fm</a>'),('ONIMXRU',2671046,237886,' <a href=\"https://www.last.fm/music/ONIMXRU\">Read more on Last.fm</a>'),('Opi the Hit Machine',112653,15347,' <a href=\"https://www.last.fm/music/Opi+The+Hit+Machine\">Read more on Last.fm</a>'),('Oques Grasses',1305399,28101,' <a href=\"https://www.last.fm/music/Oques+Grasses\">Read more on Last.fm</a>'),('Oracy',13935,2890,'Mojuba mainstay Oracy has consistently provided some of the Berlin label’s biggest highlights. <a href=\"https://www.last.fm/music/Oracy\">Read more on Last.fm</a>'),('Ordinary Sparks',NULL,NULL,NULL),('Orochi',16446714,285977,'There are two artists named Orochi.\n\n1. Flávio César Castro, better known as Orochi, is a Brazilian rapper and singer. He began his musical journey at the age of 14, participating in rap battle circuits, and gradually built his reputation within cultural circles. With a substantial online following, Orochi has amassed millions of social media followers and over one billion song plays, establishing himself as a significant figure in Brazilian rap. <a href=\"https://www.last.fm/music/Orochi\">Read more on Last.fm</a>'),('Orquesta Akokán',NULL,NULL,NULL),('Orquesta Pelinkere',1,1,' <a href=\"https://www.last.fm/music/Orquesta+PelinKere\">Read more on Last.fm</a>'),('Oscar Maydon',8708134,226895,' <a href=\"https://www.last.fm/music/Oscar+Maydon\">Read more on Last.fm</a>'),('otuka',12659200,233233,'alt account of jades ( https://soundcloud.com/otukaa ) <a href=\"https://www.last.fm/music/Otuka\">Read more on Last.fm</a>'),('Ovy On The Drums',2290465,169443,' <a href=\"https://www.last.fm/music/Ovy+On+The+Drums\">Read more on Last.fm</a>'),('Ozuna',25681971,875501,'Juan Carlos Ozuna Rosado (born March 13, 1992), known simply by his surname Ozuna , is a Puerto Rican Latin trap and reggaeton singer who is regarded as the \" New King of Reggaeton\". He has released two successful albums Odisea (2017) and Aura (2018), and since the beginning of his career, he has sold around 15 million records, making him one of the best-selling Latin music artists of all time. He made his acting debut in the film Que León. <a href=\"https://www.last.fm/music/Ozuna\">Read more on Last.fm</a>'),('Pablo Chill-E',7121035,109457,'Pablo Chill-E, is a Chilean rapper who uses Autotune and synthetyzers to bend his voice, rapping about common worldwide themes like drugs, crime, sex and money alongside a pre recorded sample of reggaeton music. This merge is known as \"Latin Trap\".\r\nCollaborating with Spanish trap artists Yung Beef and Kaydy Cain, he gained recognition through the EP \"Antijiles.\" Besides his known cliche lyrics of the style, he also addresses political corruption, societal opportunities, friendship, and the unique context of his home country. <a href=\"https://www.last.fm/music/Pablo+Chill-E\">Read more on Last.fm</a>'),('Pablo Watusi',NULL,NULL,NULL),('Pachamatrix',113,11,' <a href=\"https://www.last.fm/music/Pachamatrix\">Read more on Last.fm</a>'),('Pamela Williams',NULL,NULL,NULL),('Pan',307445,32448,'There are multiple artists with this name:\r\n\r\n1) Pan is an uplifting instrumental band from Columbia, SC. They formed in early 2010 and have released two eps called \"Post Rock is Not Dead\" and \"Meta Major!\" and also a full length called \"These Are The Things I Love And I Want To Share Them With You\". They are signed to Post-Echo.com\r\n\r\n2) PAN is a Japanese power rock group formed in 1995 in Osaka, Japan. To date they have released 3 mini albums, 4 singles, and 3 full length albums and are still performing as of 2011. <a href=\"https://www.last.fm/music/Pan\">Read more on Last.fm</a>'),('Panam Panic',NULL,NULL,NULL),('Panaphonic',76023,13445,'The PANAPHONIC project was born some years ago as a result of the ROBY J.C. playroom. During the last few years he dedicated most of the time creating the new barrio jazz gang album, just released these days, together with Steve Micarelli. At the same time he found the time to create his first solo album \"Sunrise Light\", a collection of his latest studio works where the artist produces innovative experimental sounds. In this project, ROBY brings together musical elements from around the planet and mixes them together <a href=\"https://www.last.fm/music/Panaphonic\">Read more on Last.fm</a>'),('Paola & Chiara',1507260,74118,'Paola & Chiara are two sisters born in Milan, Italy. Before joining the pop band 883/Max Pezzali in 1995-1997 they had their own group \"Elefunky\". One of the sisters appeared on the Videos of the Italian singer Laura Pausini. Later the manager of the band 883 saw the sisters play in one of the clubs in Milan signed them to the band and later their solo career started in 1997 when 883 and Paola & Chiara parted.\r\n\r\nAt the end of the 1997, the sisters won the New-Artist category for the song Amici Come Prima at the Sanremo Festival. <a href=\"https://www.last.fm/music/Paola+&+Chiara\">Read more on Last.fm</a>'),('Paolo MIllon',4612,1862,' <a href=\"https://www.last.fm/music/Paolo+MIllon\">Read more on Last.fm</a>'),('Paramore',550287702,5434450,'Paramore is a rock band formed in Franklin, Tennessee, United States in 2003. The band currently consists of Hayley Williams (vocals, keyboard), Taylor York (guitar) and Zac Farro (drums). They have released six studio albums: All We Know Is Falling, RIOT!, Brand New Eyes, their first Billboard 200 chart topper Paramore, After Laughter and their grammy winning sixth studio album This is Why .\r\n\r\nParamore, as a quartet, released their debut studio album, All We Know Is Falling, in 2005. <a href=\"https://www.last.fm/music/Paramore\">Read more on Last.fm</a>'),('Parokya Ni Edgar',4954389,118919,'Parokya ni Edgar is composed of Chito Miranda and Vinci Montaner on vocals, Darius Semaña and Gabriel CheeKee on guitars, Buhawi Meneses on bass, and Dindin Moreno on drums. The band was formed in their high school in 1993. It originally composed of Chito, Vinci, Gabriel, Miko, and Jerick. The band was at first called \"Comic Relief.\" They got their first breakthrough when they were invited by the Eraserheads to perform for them. They then added \"Din Din\" and \"Buwi\" for the drums and bass respectively. <a href=\"https://www.last.fm/music/Parokya+Ni+Edgar\">Read more on Last.fm</a>'),('Party Tyme',89782,26043,' <a href=\"https://www.last.fm/music/Party+Tyme\">Read more on Last.fm</a>'),('Pat Metheny',NULL,NULL,NULL),('Patrick DJ',404844,60162,' <a href=\"https://www.last.fm/music/Patrick+DJ\">Read more on Last.fm</a>'),('Patrick Watson',35158917,1632162,'Patrick Watson (born 1979 in Montreal, Quebec, Canada) is a Canadian singer-songwriter, whose blend of cabaret pop and classical music influences with indie rock has been compared to Rufus Wainwright, Jeff Buckley and Andrew Bird.\r\n\r\nSinging in the local church choirs as a boy, studying jazz and classical piano performance, composition, and arrangement, and singing and playing keyboards in the ska band Gangster Politics in high school. Watson left the band after graduating and began to explore other types of music <a href=\"https://www.last.fm/music/Patrick+Watson\">Read more on Last.fm</a>'),('Paula Becker',3747,954,' <a href=\"https://www.last.fm/music/Paula+Becker\">Read more on Last.fm</a>'),('Paula Mattheus',173011,8101,' <a href=\"https://www.last.fm/music/Paula+Mattheus\">Read more on Last.fm</a>'),('Pauline London',NULL,NULL,NULL),('Paulo Londra',15660925,366505,'Paulo Ezequiel Londra Farías, más conocido como Paulo Londra (Córdoba, Argentina; 12 de abril de 1998) es un rapero, cantante, compositor y músico argentino\r\n\r\n <a href=\"https://www.last.fm/music/Paulo+Londra\">Read more on Last.fm</a>'),('PE\'Z',NULL,NULL,NULL),('Pedro Guerra',1469955,116004,'Pedro Manuel Guerra Mansito (2 June 1966 in Güímar, Teneriffe) is a singer-songwriter from the Spanish Canary Islands.\r\n\r\n:: Biography\r\n\r\nGuerra is the son of Pedro Guerra Cabrera, the first President of the Canarian parliament. He began studying the guitar at the Conservatorio Superior de Música de Tenerife.\r\n\r\nAt the age of 16 he started to perform regularly throughout Tenerife. At 18 he moved to the university city San Cristóbal de La Laguna, where he met fellow singer-songwriters Andrés Molina <a href=\"https://www.last.fm/music/Pedro+Guerra\">Read more on Last.fm</a>'),('Pedro Pastoriz',25669,1476,' <a href=\"https://www.last.fm/music/Pedro+Pastoriz\">Read more on Last.fm</a>'),('PEDRO SAMPAIO',22287689,492195,'Pedro do Espirito Santo Sampaio (born 22 December 1997), better known as Pedro Sampaio (stylized in all caps) is a Brazilian DJ, music producer and singer. \n\nAt the age of 13, he began to discover his talent for percussion playing in a bucket and was then convinced his father to buy a tambourine, repinique, and timbal. A year later, he was discovered by Victor Junior while DJing at his father\'s friend\'s party. He joined Dennis DJ\'s team at age of 17. <a href=\"https://www.last.fm/music/PEDRO+SAMPAIO\">Read more on Last.fm</a>'),('Peggy Lee',12637706,1488981,'Peggy Lee (26 May 1920 – 21 Jan 2002), was an American Grammy Award-winning jazz/popular music singer-songwriter and Academy Award-nominated actress. She was born Norma Deloris Egstrom in Jamestown, North Dakota. Lee has been cited as an influence by such diverse artists as Bobby Darin, Paul McCartney, Bette Midler, Madonna, Shirley Horn, k.d. lang, Elvis Costello, Dusty Springfield, Dr. John, and numerous others. As a songwriter, she collaborated with Sonny Burke <a href=\"https://www.last.fm/music/Peggy+Lee\">Read more on Last.fm</a>'),('Peggy Simms',37458,18141,' <a href=\"https://www.last.fm/music/Peggy+Simms\">Read more on Last.fm</a>'),('Pepe Aguilar',2501813,199148,'Podríamos decir que Pepe Aguilar no tuvo otra opción que convertirse en artista, y que como artista no tuvo otra elección que convertirse en cantante. No es coincidencia que en varias ocasiones la herencia, el talento y el linaje se hayan entrelazado con Pepe Aguilar, ganador de un Grammy Americano (NARAS) en el 2000 por su producción “Por una mujer bonita”, Pepe es considerado la voz de la nueva generación de la música mexicana,  siendo <a href=\"https://www.last.fm/music/Pepe+Aguilar\">Read more on Last.fm</a>'),('Pepe y Vizio',343362,20553,' <a href=\"https://www.last.fm/music/Pepe+y+Vizio\">Read more on Last.fm</a>'),('Pereza',5029742,205843,'Pereza is composed by the guitarrist Ruben (ex Buenas Noches Rose) and the bassist Leiva (ex Malahierba). In their concerts they play with another guitarrist called Pitu and a drummer called Rober.\r\nThey have released six albums: \"Pereza\", \"Algo para cantar\", \"Animales\", \"Los amigos de los animales\", \"Aproximaciones\" and \"Aviones\". <a href=\"https://www.last.fm/music/Pereza\">Read more on Last.fm</a>'),('Perreo VIP',2298,708,' <a href=\"https://www.last.fm/music/Perreo+VIP\">Read more on Last.fm</a>'),('Peso Pluma',46350916,642804,'Hassan Emilio Kabande Laija, known as Peso Pluma, is a Mexican singer-songwriter of regional Mexican music. Born on June 15th 1999, in Zapopan, Jalisco Mexico.\r\nHe gained great popularity internationally in 2022, after his collaborations with Natanael Cano and Luis R. Conriquez, currently Peso Pluma  is one of the great promises of Mexican artists. <a href=\"https://www.last.fm/music/Peso+Pluma\">Read more on Last.fm</a>'),('Peter Brown',267793,64492,'Peter Brown is a name of at least two artists with this name:\n[1] A USA musician, composer and producer.\n[2] another USA musician.\n\n[[b]1] A USA musician, composer and producer, who first came to fame with the first million-selling 12\" dance single, \"Do Ya Wanna Get Funky With Me.\" Brown was a pioneer in home recording, having recorded his seminal hit in his bedroom. Born July 11, 1953 in Blue Island, IL, Brown, started playing drums in his teens and later began experimenting with his four-track reel-to-reel tape recorder in his bedroom studio. <a href=\"https://www.last.fm/music/Peter+Brown\">Read more on Last.fm</a>'),('Peter Flower',11956,3541,' <a href=\"https://www.last.fm/music/Peter+Flower\">Read more on Last.fm</a>'),('Peter Lee',659,152,'straight from the heart of Winchester is Peter Lee, creating acoustic, upbeat and catchy music. he is a very good friend of Rose Marie Jayne and his music is the result of his dreams, wishes and (apparently mainly unfortunate) memories. he states he has nothing better to do with his time as he has an unhealthy lack of friends (which is definitely not true) and has been out of love forever it seems. his wonderful music consists of him singing, him playing the guitar, him playing the ukulele, him playing the drums and him playing the piano. <a href=\"https://www.last.fm/music/Peter+Lee\">Read more on Last.fm</a>'),('Phantogram',44910844,1831325,'Phantogram are a trip-hop/psych-pop duo which formed in 2007 in Saratoga Springs, New York, USA. The band consists of Sarah Barthel (vocals, keyboards) and Joshua Carter (guitar, vocals). Their music can be described as a culmination of unique street beat rhythms, psychedelic melodies and organic textures. The band practices and writes music in an out-of-town farm called Harmony Lodge. The group name was inspired by the optical illusion called phantogram. <a href=\"https://www.last.fm/music/Phantogram\">Read more on Last.fm</a>'),('Philippa',9875,3159,' <a href=\"https://www.last.fm/music/Philippa\">Read more on Last.fm</a>'),('PHXNKGHXST',869,323,' <a href=\"https://www.last.fm/music/PHXNKGHXST\">Read more on Last.fm</a>'),('Pignoise',1395687,74661,'Pignoise is a Spanish rock / pop punk band comprising three members: Álvaro on guitar and voice, Polo on drums, and Pablo on bass. <a href=\"https://www.last.fm/music/Pignoise\">Read more on Last.fm</a>'),('Pinto “Wahin”',56612,11900,' <a href=\"https://www.last.fm/music/Pinto+%E2%80%9CWahin%E2%80%9D\">Read more on Last.fm</a>'),('Pirris Sosa',29002,2297,' <a href=\"https://www.last.fm/music/Pirris+Sosa\">Read more on Last.fm</a>'),('Pitbull',99831427,4218617,'Armando Christian Pérez (born January 15, 1981 in Miami, Florida), better known by the stage name Pitbull , is an American rapper signed to his own label, Mr 305 Inc. The Give Me Everything (Tonight) Songfacts reports that he adopted his canine moniker because, \"They bite to lock. The dog is too stupid to lose. And they\'re outlawed in Dade County. They\'re basically everything that I am. It\'s been a constant fight.\"\r\n\r\nHis first recorded performance was on Lil Jon & the East Side Boyz album Kings of Crunk in 2002 <a href=\"https://www.last.fm/music/Pitbull\">Read more on Last.fm</a>'),('Plan B',28653959,1241301,'There are several artists and bands with this name:\r\n\r\n1) Plan B (real name Ben Drew, b. 1983) is a rapper from Forest Gate, London. From the age of 11 he attended Anglo European School in Ingatestone Essex, before transfering to Tom Hood, an inner-city comprehensive. He has described his character, in these school days, as \"a bit of a cunt\". He is signed to 679 Recordings, home to UK rap act The Streets. His unique sound is characterised by his use of acoustic beats and lyrics involving drugs, rape, murder and underage sex. <a href=\"https://www.last.fm/music/Plan+B\">Read more on Last.fm</a>'),('Pleij',NULL,NULL,NULL),('Pol 3.14',270849,24524,'Pol o Pol 3.14 es un grupo de música español que está intergardo por Joaquín, que utiliza el nombre de Pol, y por Ricardo, Borja y Christian, los 3.14\r\nLlegó a la popularidad por interpretar sus canciones en la última temporada de Los hombres de Paco\r\nSus canciones más conocidas son \'Lo que no ves\', seguida de \'Bipolar\', la más importante para el grupo ya que fue la canción con la que llegaron a la televisión, y \'A ras de cielo\'.\r\nPol comienza en 2005 curtiéndose en los bares madrileños acompañado de su guitarra. <a href=\"https://www.last.fm/music/Pol+3.14\">Read more on Last.fm</a>'),('Polimá Westcoast',5012604,182260,'Polimá Ngangu Orellana conocido artísticamente como Polimá WestCoast, es un cantante chileno de ascendencia angoleña, considerado uno de los cantantes de trap más relevantes de Chile. <a href=\"https://www.last.fm/music/Polim%C3%A1+Westcoast\">Read more on Last.fm</a>'),('Polished Chrome',NULL,NULL,NULL),('Polo Nandez',33773,7066,' <a href=\"https://www.last.fm/music/Polo+Nandez\">Read more on Last.fm</a>'),('Poncho K',684732,40912,'Poncho K, nombre artístico de Alfonso Caballero Romero, es un músico de rock nacido en Sevilla cuya música se caracteriza por la contundencia y el surrealismo de sus letras.\r\nSus influencias van desde Triana a Pata Negra pasando por Extremoduro o Albert Pla y él mismo define su música afirmando: \"Lo mío es rock con pinceladas flamencas, poesía callejera.\r\n\r\nDiscografía:\r\n\r\n* No quiero empates. (2002) BMG\r\n* Destino de pluma y mano. (2003) BMG\r\n* Cuantovaqueré. (2005) BMG <a href=\"https://www.last.fm/music/Poncho+K\">Read more on Last.fm</a>'),('Portugal. The Man',60683636,1959731,'Portugal. The Man is an experimental indie rock  band from Wasilla, Alaska (formed in 2004), but currenly based in Portland, Oregon, USA. The band\'s line-up currently consists of singer/guitarist John Gourley and bassist Zach Carothers (both formerly of Anatomy Of A Ghost), Gourley\'s wife Zoe Manville (backup vocals/percussion), guitarist Eric Howk, drummer Jason Sechrist, and keyboardist Kyle O\'Quin (formerly of Gatsby\'s American Dream). The band has released nine studio albums (the latest being 2023\'s \"Chris Black Changed My Life\") <a href=\"https://www.last.fm/music/Portugal.+The+Man\">Read more on Last.fm</a>'),('Positive Force',167644,51553,'An eight-piece funk/soul band consisting of six males and two females (Brenda Reynolds and Vickie Drayton), Positive Force were founded in Pennsylvania through the efforts of Reynolds and Albert Williams. They were discovered by Nate Edmonds, an organist/pianist, writer, arranger, and producer for All Platinum/Stang/Sugarhill Records, who got them a deal with Sugarhill. Edmonds, who served as the group\'s mentor, also played organ with Curtis Knight & the Squires, a band that included Jimi Hendrix, in the mid-\'60s. <a href=\"https://www.last.fm/music/Positive+Force\">Read more on Last.fm</a>'),('PPM',5910,1137,'PPM (formerly Pork Pie Man) is a British bootlegger:\r\n\r\nhttp://porkpieman.wordpress.com/category/music/ <a href=\"https://www.last.fm/music/PPM\">Read more on Last.fm</a>'),('Prod Socram',168213,12971,' <a href=\"https://www.last.fm/music/Prod+Socram\">Read more on Last.fm</a>'),('Prod. By Outtake',NULL,NULL,NULL),('Progressive House Absolute Music',3329,136,' <a href=\"https://www.last.fm/music/Progressive+House+Absolute+Music\">Read more on Last.fm</a>'),('Psycho Playa',168957,18598,' <a href=\"https://www.last.fm/music/PSYCHO+PLAYA\">Read more on Last.fm</a>'),('Ptazeta',818574,68772,' <a href=\"https://www.last.fm/music/Ptazeta\">Read more on Last.fm</a>'),('Putumayo',NULL,NULL,NULL),('Pyotr Ilyich Tchaikovsky',37423811,1923384,'Pyotr Ilyich Tchaikovsky (Russian: Пётр Ильич Чайковский) (7th May 1840-6th November 1893; Old Style 25th April 1840–25th October 1893) was a Russian composer. He wrote some of the world\'s most popular concert and theatrical music in the current classical repertoire, including the ballets Swan Lake and The Nutcracker, the 1812 Overture, his First Piano Concerto, several symphonies, and the opera Eugene Onegin. His names are also transliterated Piotr <a href=\"https://www.last.fm/music/Pyotr+Ilyich+Tchaikovsky\">Read more on Last.fm</a>'),('Q Bass',9290,2968,'Original name - Dan Donnelly. He\'s an owner of the Suburban Base Records.\nGroups with him:\nBoogie Times Tribe: Jay D\'Cruze (aka D\'Cruze);\nThe Joint: Rob Playford, Dave Noddings, Sean O\'Keeffe;\nHypersonic: Andre Jacobs.\n <a href=\"https://www.last.fm/music/+noredirect/Q+Bass\">Read more on Last.fm</a>'),('Q_ARE',304396,15233,'Q_ARE es una boyband chilena que irrumpe en la escena musical como el fenómeno pop que Chile esperaba. Conformado por Jamin, J, Seba, Bin, Aiden y Fabi, seis artistas completos que escriben, producen y coreografían su propia música, el grupo combina el sonido vibrante del pop moderno con la esencia icónica de las boybands. El resultado: un sello único, innovador y de gran proyección. <a href=\"https://www.last.fm/music/Q_ARE\">Read more on Last.fm</a>'),('Q\' Lokura',585292,22367,' <a href=\"https://www.last.fm/music/Q%27+Lokura\">Read more on Last.fm</a>'),('Q2',36255,2884,' <a href=\"https://www.last.fm/music/Q2\">Read more on Last.fm</a>'),('Quantic',NULL,NULL,NULL),('Quentro',29551,5866,' <a href=\"https://www.last.fm/music/Quentro\">Read more on Last.fm</a>'),('Quevedo',21438045,362172,'Pedro Luis Domínguez Quevedo es un cantante de música urbana y rapero español radicado en Canarias.​​ <a href=\"https://www.last.fm/music/Quevedo\">Read more on Last.fm</a>'),('Quinten 909',NULL,NULL,NULL),('R.P Music, Inc.',19,11,' <a href=\"https://www.last.fm/music/R.P+Music,+Inc.\">Read more on Last.fm</a>'),('Rachel Portman',5501997,396149,'Rachel Mary Berkeley Portman (born 11 December 1960 in Haslemere, England, UK) is a British composer, best known for scoring films. She was educated at Charterhouse School and Worcester College, Oxford.\n\nMs. Portman has composed the scores for dozens of feature films, including \"Emma\", \"Chocolat\", \"Oliver Twist\", \"The Cider House Rules\", \"The Duchess\", and \"Never Let Me Go\".\nShe was the first female composer to win an Academy Award in the category of Best Musical or Comedy Score (for \"Emma\" in 1996). <a href=\"https://www.last.fm/music/Rachel+Portman\">Read more on Last.fm</a>'),('RADWIMPS',40874875,667128,'Radwimps is a Japanese rock band that formed in their first year of highschool in 2001 in Kanagawa, Japan. They play an eccentric mix of rock, punk, funk and jazz. The band achieved great commercial success in 2006 with their album Radwimps 4: Okazu no Gohan, and are best known for their later singles \"Order Made\" (2008) and \"Dada\" (2011), both of which hit number one on Oricon\'s single charts.\r\n\r\nThe five original members had been friends since middle school. <a href=\"https://www.last.fm/music/RADWIMPS\">Read more on Last.fm</a>'),('Raffa El Versatil',1267,191,' <a href=\"https://www.last.fm/music/Raffa+El+Versatil\">Read more on Last.fm</a>'),('RaiNao',798803,39561,'Naomi Ramírez is a Puerto Rican singer-songwriter known professionaly as RaiNao. Based in Santurce, San Juan, Puerto Rico, her music incorporates elements of reggaeton, jazz, R&B, and alternative pop, shaped by her background in music theory and live performance. <a href=\"https://www.last.fm/music/RaiNao\">Read more on Last.fm</a>'),('Ramsey Gold',NULL,NULL,NULL),('Raoul French',300,152,'Raoul French \n\nHouse & Techno specialist.\n\nRaoul French is one dance music\'s new breed of entrepreneurs, his sound truly comes from the underground through being a time served apprentice.Being raised in a musical family he learned to play the keyboard and drums from a early age. Around 1991 he started to get into electronic dance music being caught up in the whole rave scene which was sweeping the nation. It was at this time Raoul began to buy vinyl and learnt the art off real djing. <a href=\"https://www.last.fm/music/Raoul+French\">Read more on Last.fm</a>'),('Raphael Wressnig',13647,2670,'Throughout the years Raphael Wressnig created his very own explosive and yet elegant organ style and quickly became well established as one of the icons of the new generation of organ players and a well respected figure in the international jazz and blues scene. Raphael Wressnig was born on the 14th of October 1979 in Graz, Austria. He started to learn various styles of playing the piano and the organ like Blues, Jazz and Funk as an autodidact at the age of 16. <a href=\"https://www.last.fm/music/Raphael+Wressnig\">Read more on Last.fm</a>'),('Rasel',163951,27398,'RASEL (born Rafael Abad Anselmo on December 23, 1981 in Sevilla) is a Spanish rap singer signed to Warner Music.\r\n\r\nRASEL was born in a musical background family. He first debuted with \"Publicidad Engañosa\" in 2007. Today, his work is full of strong and fresh reggae influence with positive lyrics without changing his identity as a rap artist. He also has a single with his sister, La Dama, and his brother in law, Melendi, \"Mil Razas\". \r\n\r\n\r\n <a href=\"https://www.last.fm/music/Rasel\">Read more on Last.fm</a>'),('Raul Clyde',1039442,27979,' <a href=\"https://www.last.fm/music/Raul+Clyde\">Read more on Last.fm</a>'),('Rauw Alejandro',81833082,959664,'Raúl Alejandro Ocasio Ruiz, known professionally as Rauw Alejandro, is a Puerto Rican singer and rapper. Referred to as the \"King of Modern Reggaeton\", he belongs to \"the new generation\" of Puerto Rican urban musicians. His debut studio album, Afrodisíaco, was released in November 2020. His second studio album, Vice Versa, released in June 2021, featured the lead single \"Todo de Ti\". He has won one Latin Grammy Award from four nominations.\r\n\r\nRauw Alejandro\'s music style includes Latin R&B, reggaetón, rhythmic pop and ballads. <a href=\"https://www.last.fm/music/Rauw+Alejandro\">Read more on Last.fm</a>'),('Ravyn Lenae',39325668,1511183,'Ravyn Lenae Washington (born January 22, 1999) is an American R&B singer-songwriter from Chicago who is currently signed to Atlantic Records and the Three Twenty Three Music Group. She is also a member of the musical collective Zero Fatigue. Her debut EP, Moon Shoes EP, was released independently in 2015 and reissued by Atlantic Records in 2016. Her follow-up EP, Midnight Moonlight EP, was released in 2017. In addition to performing at several music festivals, Lenae has also toured with SZA on her Ctrl Tour and Noname on her Telefone Tour. <a href=\"https://www.last.fm/music/Ravyn+Lenae\">Read more on Last.fm</a>'),('Ray Charles',43423872,2755619,'Ray Charles (Ray Charles Robinson,  Albany, Georgia, September 23, 1930 - Beverly Hills, California, June 10, 2004), was an American singer-songwriter, musician, arranger, and band leader. \n\nAs a rock and roll, rhythm & blues, soul, blues, jazz, country and pop musician he helped to shape the sound of rhythm & blues.\n\nHe brought a soulful sound to everything from country music (\"I Can\'t Stop Loving You\") to rock and roll (\"Mess Around\"), to pop standards to a now-iconic rendition of \"America the Beautiful. <a href=\"https://www.last.fm/music/Ray+Charles\">Read more on Last.fm</a>'),('Raya Real',299869,29208,' <a href=\"https://www.last.fm/music/Raya+Real\">Read more on Last.fm</a>'),('Razz T',NULL,NULL,NULL),('Rebirth Brass Band',643150,79681,'The Rebirth Brass Band is a New Orleans brass band. The group was founded in 1983 by tuba player Philip Frazier, his brother Keith Frazier and trumpeter Kermit Ruffins, along with other musicians with them at the Joseph S. Clark Sr. High School in the Treme neighborhood of New Orleans. Rebirth is known for combining traditional New Orleans brass band music, including the New Orleans tradition of second line with funk, jazz, and soul influences. In 1992 <a href=\"https://www.last.fm/music/Rebirth+Brass+Band\">Read more on Last.fm</a>'),('Red Hot Chili Peppers',541190118,7077673,'The Red Hot Chili Peppers is an American rock band formed in Los Angeles in 1982, consisting of Anthony Kiedis (vocals), Flea (bass), John Frusciante (guitar), and Chad Smith (drums). Their music blends elements of alternative rock, funk, punk rock, hard rock, hip hop, and psychedelic rock, and they have influenced genres such as funk metal, rap metal, rap rock, and nu metal. With over 120 million records sold worldwide, the Red Hot Chili Peppers are among the best-selling bands in history. <a href=\"https://www.last.fm/music/Red+Hot+Chili+Peppers\">Read more on Last.fm</a>'),('Redtenbacher\'s Funkestra',NULL,NULL,NULL),('Reggaeton Latino Band',20112,4442,' <a href=\"https://www.last.fm/music/Reggaeton+Latino+Band\">Read more on Last.fm</a>'),('Reik',13692941,601243,'Reik is a Mexican band from Mexicali, Baja California, Mexico. Formed by Jesús Alberto Navarro Rosas (Lead Vocals), Julio Ramírez Eguía (Guitar, Backing Vocals), and Gilberto Marín Espinoza \"Bibi\" (Backing Guitar, Backing Vocals).\r\n\r\nIn 2003, Jesús Navarro and Julio Ramirez started their then-nascent musical project, tentatively called \"Reik\". It was then they recorded their first demos, which were released through the Mexican underground club scene. <a href=\"https://www.last.fm/music/Reik\">Read more on Last.fm</a>'),('Revolverheld',5223704,275910,'Revolverheld is a German rock band from Bremen, consisting of Johannes Strate (Vocals), Kristoffer Hünecke (Guitar/Vocals), Niels Grötsch (Guitar/Vocals), Jakob Sinn (Drums) and Florian Speer (Bass/ex Skatoons Bass-player).\r\n\r\nThe band was founded in Hamburg as Manga in 2003, later changed it to Tsunamikiller and adopted their current name by the end of 2004.\r\n\r\nIn 2006, they participated in „Bundesvision Song Contest“ (a parody of the „Eurovision Song Contest“) and got Bremen the second place of all 16 Bundesländer (States). <a href=\"https://www.last.fm/music/Revolverheld\">Read more on Last.fm</a>'),('Reykon',1028668,110265,'Reykon is a Colombian reggaeton singer, born in Envigado, Colombia on December 12, 1986. His birth name is Andres Felipe Robleto Londono. He rose to fame in 2009 with the song La Santa. Other hits such as No Molestes Mas, Sin Mieto, and Tuturuwa gave him more fame. In 2014, he ganed international fame with the song Secretos. Subsequently, the song was released in important U.S cities such as Chicago, New York, and Miami, where it quickly became a club anthem. <a href=\"https://www.last.fm/music/Reykon\">Read more on Last.fm</a>'),('Rhythms of Light',996,489,' <a href=\"https://www.last.fm/music/Rhythms+of+Light\">Read more on Last.fm</a>'),('Rian Milo',60698,7990,' <a href=\"https://www.last.fm/music/Rian+Milo\">Read more on Last.fm</a>'),('Ricardo Alvarez',155,56,' <a href=\"https://www.last.fm/music/Ricardo+Alvarez\">Read more on Last.fm</a>'),('Ricardo Arjona',9822619,392581,'Edgar Ricardo Arjona Morales, (born 19 January 1964, Jocotenango, Guatemala), known as Ricardo Arjona (pronounced /aɾ\'xona/), is a popular Guatemalan singer. He has won two Grammy Awards from three nominations: The 2007 Grammy for Best Latin Pop Album and the 2006 Latin Grammy for Best Male Pop Vocal Album, both for his album Adentro, (2005).\r\n\r\nHistory\r\n\r\nRicardo was born in the village of Jocotenango, near Antigua, Guatemala to Ricardo Arjona Moscoso and Noemí Morales de Arjona. <a href=\"https://www.last.fm/music/Ricardo+Arjona\">Read more on Last.fm</a>'),('Richard Page',NULL,NULL,NULL),('RICHIE ROZEX',NULL,NULL,NULL),('Rihanna',564149607,8067865,'Robyn Rihanna Fenty (born February 20, 1988), professionally known mononymously as Rihanna, is a Barbadian singer, songwriter, actress, businesswoman, entrepreneur and fashion designer.\r\n\r\nShe has attained fourteen Billboard Hot 100 number ones thus far and is the second Barbadian artist to win a Grammy Award. She is also a cultural ambassador for Barbados. In 2021 Rihanna was named a \"National Hero\" in her home country, earning her the title \"The Right Excellent.\"  <a href=\"https://www.last.fm/music/Rihanna\">Read more on Last.fm</a>'),('Rik Mol',NULL,NULL,NULL),('Riley!',1567912,39237,' <a href=\"https://www.last.fm/music/Riley%21\">Read more on Last.fm</a>'),('RIXXIA',195616,22429,'Paola Richi know as RIXXIA is an Italo-Mexican artist, producer, and DJ at the forefront of a new wave in Latin American music, blending hyper techno, pop, and Latin rhythms. Known for her dynamic performances and experimental style, RIXXIA combines soft, feminine vocals, cutting-edge production, and irreverent lyrics to deliver a refreshing and innovative musical experience. In early 2024, RIXXIA launched her solo project with the release of her debut single, \"U R SUCH LAME!\", a high-energy track featuring candid lyrics. <a href=\"https://www.last.fm/music/rixxia\">Read more on Last.fm</a>'),('RKOV',18165,4596,' <a href=\"https://www.last.fm/music/RkOv\">Read more on Last.fm</a>'),('Roar',37720980,1457725,'There are currently four artists using the name Roar:\r\n(1) An American art pop musician\r\n(2) A Croatian punk band\r\n(3) A Persian-German funk rock band\r\n(4) A Canadian pop band\r\n\r\n1.) Roar is the art pop project of singer and multi-instrumentalist Owen Evans from Phoenix, Arizona, United States. Evans started the group in 2010 following the dissolution of his former band Asleep in the Sea. Although he is often the sole performer in his recordings, he is supported live by a large roster of musicians, including members of Andrew Jackson Jihad. <a href=\"https://www.last.fm/music/Roar\">Read more on Last.fm</a>'),('Robbie Williams',70135511,2785040,'Robert Peter Williams (born 13 February 1974) is an English singer and songwriter. He found fame as a member of the pop group Take That from 1990 to 1995, and achieved commercial success after launching a solo career in 1996. His debut studio album, Life thru a Lens, was released in 1997, and included his signature song, \"Angels\". His second album, I\'ve Been Expecting You, featured the songs \"Millennium\" and \"She\'s the One\", his first number one singles. <a href=\"https://www.last.fm/music/Robbie+Williams\">Read more on Last.fm</a>'),('Robert Schumann',12074739,1047334,'Robert Schumann (8 June 1810 – 29 July 1856) was a German composer, pianist, and music critic associated with the early Romantic era. He composed works across a wide range of genres, including music for solo piano, voice and piano, chamber ensembles, orchestra, choir, and opera. His compositions are often viewed as representative of German Romanticism.\n\nBorn in Zwickau, Saxony, into a middle-class family with no direct musical background, Schumann initially considered careers in both law and music. <a href=\"https://www.last.fm/music/Robert+Schumann\">Read more on Last.fm</a>'),('Rock Nacional Internacional',630,257,' <a href=\"https://www.last.fm/music/Rock+Nacional+Internacional\">Read more on Last.fm</a>'),('Rockwell',6708096,1103699,'There are, at least, six artists known as Rockwell.\r\n\r\n1) A pseudonym of Kenneth Gordy, from Detroit, Michigan: The son of Motown Records\' founder, Berry Gordy, he changed his name so as to avoid charges of nepotism, wanting to make it in the music business on just his talent. He signed to Motown as a solo artist without his father\'s knowledge, taking his name from his high school band. His first single, the Michael Jackson-esque \"Somebody\'s Watching Me\". <a href=\"https://www.last.fm/music/Rockwell\">Read more on Last.fm</a>'),('Rodrigo',1316912,118909,'Rodrigo Alejandro Bueno (born 24/5/1973 in Córdoba, Argentina; died 24/6/2000 in Buenos Aires, Argentina), also known by his stage name Rodrigo or nickname \"El Potro\", was a very popular cuarteto singer from Argentina. He is considered one of the most important singers of cuarteto music, as he brought this genre from his birth place in Córdoba to big popularity throughout Argentina.\r\n\r\nIf you\'re listening to, or looking for, classical music by the Spanish composer, please then consider going to artist Joaquín Rodrigo. <a href=\"https://www.last.fm/music/Rodrigo\">Read more on Last.fm</a>'),('Rollo & Skate',4,4,' <a href=\"https://www.last.fm/music/Rollo+&+Skate\">Read more on Last.fm</a>'),('Roman Street',NULL,NULL,NULL),('ROSÉ',97640622,1573963,'ROSÉ (Hangul: 로제) or Roseanne Park is a South Korean-New Zealander singer-songwriter under THEBLACKLABEL and Atlantic Records. And also holds a group contract with YG Entertainment, serving as the vocalist for the girl group BLACKPINK (Hangul: 블랙핑크).\r\n\r\nIn March 2021, ROSÉ made her solo debut with her single album R, selling 448,089 copies in its first week - the highest figure by a Korean female soloist. Its lead single “On the Ground” was a commercial success <a href=\"https://www.last.fm/music/Ros%C3%A9\">Read more on Last.fm</a>'),('Royal Blood',41466157,1040599,'There are several artists with this name:\r\n---\r\n1) Formed at the beginning of 2011, Royal Blood is a 2-piece band from Worthing, West Sussex, UK. Having known each other for years in different bands, Mike Kerr (Bassist/Vocalist) & Ben Thatcher (Drums) finally came together and went into the studio to record ‘Figure It Out’ – the first track that brought attention to the band. At the tail end of 2013, Royal Blood released ‘Out of The Black’, their debut single on Black Mammoth Records.  <a href=\"https://www.last.fm/music/Royal+Blood\">Read more on Last.fm</a>'),('RØZ',1178258,80626,' <a href=\"https://www.last.fm/music/R%C3%98Z\">Read more on Last.fm</a>'),('Rubber Souls',NULL,NULL,NULL),('Rubbini',8777,1493,' <a href=\"https://www.last.fm/music/Rubbini\">Read more on Last.fm</a>'),('Ruben Willmer Band',NULL,NULL,NULL),('RUBII',NULL,NULL,NULL),('Rulo y la contrabanda',462529,18755,' <a href=\"https://www.last.fm/music/Rulo+y+la+contrabanda\">Read more on Last.fm</a>'),('Rupatrupa',591960,29586,' <a href=\"https://www.last.fm/music/Rupatrupa\">Read more on Last.fm</a>'),('rusowsky',11649731,291639,'Rusowsky is the artistic alter ego behind which Ruslan Mediavilla hides, a young man from Madrid with Belarusian roots and classical musical training. He is one of the representatives of the new underground scene that is flourishing these days thanks to the ease of being able to record songs from home, without having large technological means. <a href=\"https://www.last.fm/music/Rusowsky\">Read more on Last.fm</a>'),('Russian Red',6863839,265191,'Lourdes Hernández (born 20 November, 1985) is a singer-songwriter based in Madrid, Spain. The moniker for Lourdes comes from a lipstick color she frequently uses. Her beautifully crafted, minimal songs beam delicate folk harmonies and lustrous vocals. The band was originally formed in 2007, by Lourdes and Brian Hunt, with whom she had previously recorded some songs, and who helped her record her first album. However, before it was released, they split up.  <a href=\"https://www.last.fm/music/Russian+Red\">Read more on Last.fm</a>'),('RUZE',242527,32805,'With releases on labels PIV, Elrow, Toolroom, Abode, Etiquette, Rawsome and many more; Ruze have forged a direct path through House music with their trademark sound, garnering DJ support from the likes of Prunk, Chris Stussy, Toman, Josh Butler, MK, Wade, Latmun, Mark Knight, Format B, Prok & Fitch, Hector Couto, and Russ Yallop to name a few. Expect quality productions and infectious grooves from the UK’s newest exports. <a href=\"https://www.last.fm/music/Ruze\">Read more on Last.fm</a>'),('Rvfv',4346893,263278,' <a href=\"https://www.last.fm/music/Rvfv\">Read more on Last.fm</a>'),('Rvssian',6451269,501507,'Tarik Johnson, commonly known as Rvssian and previously as RUSSIAN, is a Jamaican music producer, singer and entrepreneur. Rvssian, is the founder of Head Concussion Records, a music production company situated in Kingston, Jamaica. <a href=\"https://www.last.fm/music/RVSSIAN\">Read more on Last.fm</a>'),('Ryan',1953925,293889,'1. RYAN is an American soloist under WAYF. He made his debut on July 31st, 2025, with the digital single, “AROJIN“. He is known for competing in the survival show, BOYS II PLANET.\r\n\r\n2.RYAN es una banda de Garage Rock/Alternativo argentina. Sus integrantes son Dante, Mou, Tortu, Cata y Agus. \r\nEn enero de 2022 presentaron su disco debut \"BAR\'CELONA\".\r\nA lo largo de este año, la banda comenzó a pisar fuerte en varios escenarios del circuito alternativo porteño como lo son Moscú y El Emergente <a href=\"https://www.last.fm/music/Ryan\">Read more on Last.fm</a>'),('Ryan Castro',6985676,345001,'Ryan Castro es una de las nuevas caras del reggaetón y, aunque en sus videos juega con la clásica estética aspiracional de los carros de alta gama y las mansiones, su proyecto nació en el barrio Pedregal, al norte de Medellín. El colegio, las calles y los vecinos del sector pueden dar fe de cómo fue el comienzo de su historia.\r\n\r\nLuego de salir del colegio, a los 16 años, se proyectó para hacer música a nivel profesional. Inspirado por las música y las películas que vio de 50 Cent <a href=\"https://www.last.fm/music/Ryan+Castro\">Read more on Last.fm</a>'),('Ryan Paris',869342,156954,'Ryan Paris (born Fabio Roscioli in 1953 in Rome, Italy) is an artist who gained international popularity in 1983 for the worldwide hit, Dolce Vita, composed and produced by Pierluigi Giombini. Paris continued to release in the mid-1980s and 1990s, but was never able to duplicate the success of his previous hit.\r\n\r\n <a href=\"https://www.last.fm/music/Ryan+Paris\">Read more on Last.fm</a>'),('Ryder Quartet',NULL,NULL,NULL),('Sabonetes',789408,26637,'Sabonetes are Alexandre (drums),  Wonder (guitar), Artur (vocals, guitar) and João Davi (bass). They are an indie rock band from Curitiba, southern Brazil.  <a href=\"https://www.last.fm/music/Sabonetes\">Read more on Last.fm</a>'),('Sade',NULL,NULL,NULL),('SAIKO',8498032,343079,'Saiko is the name of at least four different music entities:\r\n\r\n1) Saiko is a Pop rock band from Chile. Former La Ley members, Luciano Rojas and Rodrigo Aboitiz decided to create their own band, and they made castings looking for a female vocalist. They finally choose Denisse Malebrán, and debuted in 1999 releasing their first album Informe Saiko. In 2006 Malebrán decided to leave the band to pursue a solo career. In April 2007 she gave her last concert with the band in Teatro Teletón <a href=\"https://www.last.fm/music/Saiko\">Read more on Last.fm</a>'),('Saint Jude',627394,89069,'There are multiple artists using this name:\n\n1. A female fronted rock band from England found in 2005, see also Saint Jude UK. Their music is a mix of Rock, blues and soul. They say being inspired by artist and bands as: Aretha Franklin, Janis Joplin and Led Zeppelin.\n\n2. Hardcore/Punk/Crust band from Providence, RI\n\n3. Saint Jude is an alias of South London producer and songwriter Jude Woodhead. Jude\'s self titled EP was released in 2019 on Slow Dance records, containing a blend of rolling ambient pop music and off-kilter indie tunes. <a href=\"https://www.last.fm/music/Saint+Jude\">Read more on Last.fm</a>'),('Saint Motel',26108561,1195326,'Saint Motel (stylized as SAINT MOTEL) is an American alternative rock  band from Los Angeles whose music has been described as everything from \"dream pop\" to \"prog\". The band consists of A/J Jackson (lead vocals, guitar, piano), Aaron Sharp (lead guitar), Dak Lerdamornpong (bass), and Greg Erwin (drums). \r\n\r\nTheir debut EP, ForPlay, was released in 2009. The band\'s first full-length album, Voyeur, was released in 2012. \r\n\r\nTheir second album, saintmotelevision, was released in 2016.  <a href=\"https://www.last.fm/music/Saint+Motel\">Read more on Last.fm</a>'),('Saison',206364,39300,'London based house duo Saison have, over the last few years, carved out a niche of their own. Named the best deep house artist of 2018 and 2019 by Traxource, and one of the biggest selling deep house artist on Beatport, they have released on some of the most respected house labels in the world, including Defected, Toolroom, Large Music, Sonar Kollektiv, and Suara to name a few. \n\nThey’ve also remixed many titans of the scene including such musically diverse artists as Jack Back, Chez Damier, Dave Lee and Kevin Yost. <a href=\"https://www.last.fm/music/Saison\">Read more on Last.fm</a>'),('Sajo Bkule',NULL,NULL,NULL),('Sam Greenfield',NULL,NULL,NULL),('Sam Levine',NULL,NULL,NULL),('Samantha James',NULL,NULL,NULL),('Samantha Palos',5625,777,' <a href=\"https://www.last.fm/music/Samantha+Palos\">Read more on Last.fm</a>'),('Samuraï',1329855,35827,'Aroca Lorente, better known by her stage name Samuraï, is a Spanish singer-songwriter from Madrid. Born on November 25, 2000, she has become a notable voice in the Spanish music scene, blending pop and alternative rock with a punk attitude.\r\nHer artistic name, Samuraï, originated in her childhood due to a hairstyle she frequently wore. She began her career in 2019 with the release of her first song, \"Me Quedo Contigo,\" which is available exclusively on YouTube. <a href=\"https://www.last.fm/music/Samura%C3%AF\">Read more on Last.fm</a>'),('San Venus',134646,2808,' <a href=\"https://www.last.fm/music/San+Venus\">Read more on Last.fm</a>'),('Sancamaleon',48474,2143,'Sancamaleón nace a mediados del \'99, como un sexteto que une ska, ritmos afro latinos, hardcore, samba y jazz. A mediados de 2000, su primer demo llega a manos del ex Soda Stereo Zeta Bossio, que los selecciona para integrar un compilado.\r\n\r\nEn 2001 editan su primer EP con cinco temas, de manera independiente, y filmaron el video de \"El Camino\", que consiguió mucha rotación canales de música.\r\n\r\nA comienzos del 2002, luego de una gira por el interior del país <a href=\"https://www.last.fm/music/sancamaleon\">Read more on Last.fm</a>'),('Sandia',NULL,NULL,NULL),('Saphena Trio',NULL,NULL,NULL),('Sauver',49,7,' <a href=\"https://www.last.fm/music/sauver\">Read more on Last.fm</a>'),('Sayfalse',3979210,214091,' <a href=\"https://www.last.fm/music/Sayfalse\">Read more on Last.fm</a>'),('Schwarz & Funk',728598,85210,'SCHWARZ & FUNK is a House & Lounge sound project created by the german producers Bob Schwarz and Jesse Funk in 2001. Inspired by the Balearic House vibes of Ibiza, Bob and Jesse created their own sound of House, Lounge, Chillout and Ambient tunes. By now SCHWARZ & FUNK proved to be a long-time project, very successful and loved by music enthusiasts all over the planet.\n\nBeing professional and passionate musicians themselves, they frequently work together with other outstanding musicians and singers. <a href=\"https://www.last.fm/music/Schwarz+&+Funk\">Read more on Last.fm</a>'),('Scruscru',116097,19770,' <a href=\"https://www.last.fm/music/scruscru\">Read more on Last.fm</a>'),('Sean Pratt',NULL,NULL,NULL),('Sebastian Llosa',324816,21931,'Sebastián Llosa (June 1st, 1992) is a Peruvian singer and songwriter.\r\nHe completed his school years in Lima and later studied at Yale University in the United States. \r\nSebastián grew up in an artistic environment: his father is a film director and his mother a singer. His early musical influences were classic rock, but he later discovered Latin Pop, Soul, and R&B. \r\nIn 2021, Sebastián moved to Miami to compose and produce the songs for his debut album. <a href=\"https://www.last.fm/music/Sebastian+Llosa\">Read more on Last.fm</a>'),('Sebastian Yatra',14147603,614703,'Sebastián Obando Giraldo (born 15 October 1994), known professionally as Sebastián Yatra, is a Colombian singer and songwriter. He began as a Latin pop artist and has recorded many ballads, but has released several successful reggaeton singles. Yatra is noted for his romantic lyrics, melding traditional lyricism with modern reggaeton influences. He rose to prominence in Latin America in 2016 when he released the hit \"Traicionera\". He has released <a href=\"https://www.last.fm/music/Sebastian+Yatra\">Read more on Last.fm</a>'),('Sebastien Rebels',2664,921,' <a href=\"https://www.last.fm/music/Sebastien+Rebels\">Read more on Last.fm</a>'),('Sebb Junior',183263,33387,'French artist based in Spain, Sebb Junior is one of the most hard-working House music DJ producer of the past few years, thanks to hundred of singles, Ep’s and remixes on hugely respected labels like Large Music, Madhouse Records, Nervous Records, Milk & Sugar, Quantize Records, Let There Be House and many more.\n\nHis talent for delivering groovy, emotive and catchy House tracks that hit the spot is demonstrated through his multitude of releases since 2015. <a href=\"https://www.last.fm/music/Sebb+Junior\">Read more on Last.fm</a>'),('Sech',7148832,354370,'Carlos Isaías Morales Williams (born December 3, 1993), better known as Sech, is a Panamanian singer. In April 2019 he released his album Sueños, reaching number three on the Billboard Top Latin Albums chart. In an interview with Billboard, Sech mentioned El General being an influence for his music. He first reached popularity with his song \"Miss Lonely\", in 2017. <a href=\"https://www.last.fm/music/Sech\">Read more on Last.fm</a>'),('Selena Gomez',196544763,3056437,'Selena Marie Gomez (born July 22, 1992) is an American actress, singer, and businesswoman. She began her career as a child actress on the children\'s television series Barney & Friends (2002–2004) and later gained prominence for her role as Alex Russo on the Disney Channel sitcom Wizards of Waverly Place (2007–2012). In 2008 she signed with Hollywood Records and formed the band Selena Gomez & the Scene, which released the albums \"Kiss & Tell\" (2009), \"A Year Without Rain\" (2010), and \"When the Sun Goes Down\" (2011). <a href=\"https://www.last.fm/music/Selena+Gomez\">Read more on Last.fm</a>'),('Sergio Dalma',819025,75719,'Sergio Dalma is a Catalan pop singer. He was born as Josep Sergi Capdevila Querol on September 28, 1964 in Sabadell (near Barcelona).\r\n\r\nSergio Dalma started his career singing in bands and doing chorus, until he won the TV program \"Gent d\'aqui\", in the Catalan station of TVE, which won him a regular contract to sing in the Shadows night-club in Barcelona. Sergio signed up with the record company Horus, and edited his first album, \"Esa chica es mia\", in 1989. <a href=\"https://www.last.fm/music/Sergio+Dalma\">Read more on Last.fm</a>'),('Sergio Helou',1236,705,' <a href=\"https://www.last.fm/music/Sergio+Helou\">Read more on Last.fm</a>'),('Sevdaliza',29786841,1036526,'Sevda Alizadeh (born 1 September 1987), known professionally as Sevdaliza, is an Iranian-Dutch singer and songwriter. Born in Iran and based in Rotterdam, The Netherlands, she was originally a professional basketball player before embarking upon a music career. Her music has been described as a fusion of trip hop, experimental pop, and alternative R&B, while incorporating influences from various other sources.\r\n\r\nSevdaliza\'s visually sophisticated music videos caught the attention of many international blogs and magazines <a href=\"https://www.last.fm/music/Sevdaliza\">Read more on Last.fm</a>'),('SH3TLVIZ',253311,33495,' <a href=\"https://www.last.fm/music/SH3TLVIZ\">Read more on Last.fm</a>'),('Shakedown',1618874,293023,'The Swedish-Swiss dance act made up of Mandrax and Seb K, best known for the hit \"At Night\".\n\nBy the time they started Shakedown in 1999, Mandrax and Seb K. already had a good idea of each other’s musicality: they’re brothers, blending Swiss and Swedish backgrounds. Stephan Mandrax is no newcomer to electronic music. Initially a fan of new wave and punk (making his 1984 DJ debut in a rock club), house music found him in 1986. Stephan moved to New York in 1992 <a href=\"https://www.last.fm/music/Shakedown\">Read more on Last.fm</a>'),('Shakira',171016061,4696412,'Shakira Isabel Mebarak Ripoll is a Colombian singer. Born and raised in Barranquilla, She made her recording debut with Sony Music Colombia at the age of 13. Following the commercial failure of her first two albums, Magia (1991) and Peligro (1993), she rose to prominence in Hispanic countries with her next albums, Pies Descalzos (1995) and Dónde Están los Ladrones? (1998). She entered the English-language market with her fifth album, Laundry Service (2001), which sold over 13 million copies worldwide. <a href=\"https://www.last.fm/music/Shakira\">Read more on Last.fm</a>'),('Sharon Jones & The Dap-Kings',8756383,719002,'Sharon Jones & the Dap-Kings, aka Sharon Jones and the Dap-Kings, are a funk/soul band, founded in Brooklyn, NY, USA (1996). They are signed to Daptone Records, where the Dap-Kings are the house band. They are widely thought to be spearheads of a revivalist movement that aims to capture the essence of funk/soul music as it was at its height in the mid-1960s to mid-1970s. Part of the way this is achieved is to shun modern digital recording methods in favour of using traditional analogue recording equipment. <a href=\"https://www.last.fm/music/+noredirect/Sharon+Jones+&+The+Dap-Kings\">Read more on Last.fm</a>'),('Shawn Lee\'s Ping Pong Orchestra',2197675,186776,'Shawn Lee\'s Ping Pong Orchestra is a project by multi-instrumentalist shawn lee whose current touring band project is called AM & Shawn Lee. \n\nShawn grew up in a rural area on the outskirts of Wichita, Kansas. His mother is half Lebanese, half American Indian, his father Irish-American. While his peers got off on cheesy corporate rock and the kind of line-dancing tunes recently fashionable in Gap ads, Shawn was groovin to the blaxploitation funk Sly and the Isleys. <a href=\"https://www.last.fm/music/Shawn+Lee%27s+Ping+Pong+Orchestra\">Read more on Last.fm</a>'),('Shelow Shaq',259580,38823,' <a href=\"https://www.last.fm/music/Shelow+Shaq\">Read more on Last.fm</a>'),('SHIBUSASHIRAZU',NULL,NULL,NULL),('Shinova',488520,13401,'Shinova is a Spanish alternative rock and indie rock band formed in 2008 in Berriz, Biscay, Spain. The quartet is made up of Gabriel de la Rosa (vocals), Daniel del Valle (guitar), Erlantz Prieto (guitar), and Joshua F.G. (drums).\r\n\r\nEarly in their career, their music was closer to hard rock and alternative metal, and they were often compared to Spanish bands like Sôber and Savia. However, starting with their third album, Ana y el Artista Temerario (2014), the group made a significant shift toward indie rock. <a href=\"https://www.last.fm/music/Shinova\">Read more on Last.fm</a>'),('Siberia',NULL,NULL,NULL),('Sidecars',661138,34322,'Sidecars es un nuevo y joven cuarteto madrileño que aúna la tradición del buen pop-rock en castellano con una admirable habilidad para fabricar melodías de alto valor comercial, sin renunciar a un buen tanto por ciento de honestidad y una pizca de pícara chulería. El grupo está liderado por Juancho -guitarra y voz- y se completa con Manu -guitarra-, Hierbas -bajo- y Ruli -batería-. Sidecars son herederos de la saga que arrancó con Tequila y su genuina fijación “stoniana” <a href=\"https://www.last.fm/music/Sidecars\">Read more on Last.fm</a>'),('Sienna',154315,12253,'There are two artists known as Sienna. The wikis here are sperate.\r\n\r\n1. Six-piece Sienna have been quietly making quite a noise in their native Scotland. Formed in Summer 2012 from Kinross -- known to most as home of T In The Park -- they are the first band from their hometown to have performed at the legendary festival, where they packed out the T Break tent (a feat unheard of for an unsigned band), following in the footsteps of fellow Scots Biffy Clyro. <a href=\"https://www.last.fm/music/Sienna\">Read more on Last.fm</a>'),('Siloé',454811,18088,'Siloé is a Spanish musical group that formed in 2016 in Valladolid, Spain. The band\'s musical style is a blend of folk, pop-rock, and electronic music. The members are Fito Robles (vocals), Xavi Road (guitar), and Jaco Betanzos (drums), who joined the group in 2022. The members originally met as students at the University of Valladolid.\r\nThe band’s name, Siloé, is a reference to the biblical story of Jesus healing a blind man. According to the band <a href=\"https://www.last.fm/music/+noredirect/Silo%C3%A9\">Read more on Last.fm</a>'),('Sin Ser Derrotados',9,3,' <a href=\"https://www.last.fm/music/Sin+Ser+Derrotados\">Read more on Last.fm</a>'),('Sixsense',45684,7660,'\" Sixsense \" is 31 year old producer Ben Damski from Be\'Er Sheva`,  Israel.\nMUSIC PRODUCER : Psytrance / Full-On / Progressive / Ambient Music \nhttps://soundcloud.com/sixsense\nBiography\nhttps://soundcloud.com/bdmusix\nhttps://soundcloud.com/sixsense-vs-frisky\nhttps://soundcloud.com/bendamski\nhttps://soundcloud.com/ambiantmusic\nhttps://soundcloud.com/sixsense-more-music... See More\nsixsense ben damski - מוסיקאי ויוצר ! MUSIC by sixsense // - מוסיקאי - beer sheva israel <a href=\"https://www.last.fm/music/Sixsense\">Read more on Last.fm</a>'),('Ska Cubano',NULL,NULL,NULL),('Skank',22079809,650656,'Skank is a pop/rock/reggae band in Brazil. The band started 1991, in Belo Horizonte, Minas Gerais.\r\n\r\nThe debut album, Skank (1993), was successful around the underground circuit. The second album, \"Calango\", came out in 1994 . “É Proibido Fumar”, “Te Ver”, “Pacato Cidadão”, “Jackie Teckila” and “Esmola” were the biggest hits.\r\n\r\nIn 1996, “Garota Nacional”, the single of \"O Samba Poconé\" gave Skank international success. The band travelled around the world, performing in Latin America, United States and Europe. <a href=\"https://www.last.fm/music/Skank\">Read more on Last.fm</a>'),('Skarlet',11936,1305,' <a href=\"https://www.last.fm/music/Skarlet\">Read more on Last.fm</a>'),('Skrillex',103768341,2891523,'Skrillex is the pseudonym used by Los Angeles, California, USA musician Sonny Moore to differentiate his electronic solo work from his work with From First to Last and his other solo projects. \r\n\r\nAs Skrillex, Moore is an electronic DJ and producer boasting a musical style that incorporates electro house, fidget house, and brostep. Moore began producing and performing under the alias Skrillex at clubs in the Los Angeles area in 2008.  \r\n\r\nThroughout 2010, Skrillex became a bigger and bigger part of Moore’s life. <a href=\"https://www.last.fm/music/Skrillex\">Read more on Last.fm</a>'),('Sky Rompiendo',2710564,154183,'Alejandro Ramírez Suárez (born May 23, 1992), better known as Sky Rompiendo (“breaking sky” or “Sky breaking”), Sky Rompiendo el Bajo or just Sky is a Colombian producer, songwriter and DJ. He gained recognition at a young age, creating hits with Latin trap and reggaetón artists such as Anitta, Feid, J Balvin, Karol G, Maluma, Nicky Jam and Ozuna. He has received six Latin Grammy Awards as a producer and songwriter.\r\n\r\nRamírez was born on May 23, 1992, in Medellín, Colombia. <a href=\"https://www.last.fm/music/Sky+Rompiendo\">Read more on Last.fm</a>'),('Sky Sailing',2159206,89052,'Sky Sailing is a side project of Adam Young, the artist behind Owl City, Port Blue, Color Therapy, Insect Airport, and Seagull Orchestra. The songs on the album, An Airplane Carried Me To Bed, were written before he started Owl City.\r\n\r\nThe debut album An Airplane Carried Me To Bed   is a step into the past, the documented account of a shy boy from Minnesota with more hopes and dreams than he knew what to do with. When you listen to this record, you can hear naivety, innocence, inexperience and the wide-eyed imaginings of a wishful thinker.  <a href=\"https://www.last.fm/music/Sky+Sailing\">Read more on Last.fm</a>'),('Skywatchers',470494,33280,'A musical group (inc\' Dean Honer) and Jarrod Gosling from I Monster and singer Kevin Pearce, founded in early 2009. Based in / around Sheffield & Colchester, England. The band released their debut album in 2010 entitled \'The Skywatchers Handbook\'. Their next single, a new mix of \'Serves Me Right\' will be issued in February. The band are currently playing live dates in the UK. <a href=\"https://www.last.fm/music/Skywatchers\">Read more on Last.fm</a>'),('Slavik',154112,12049,' <a href=\"https://www.last.fm/music/Slavik\">Read more on Last.fm</a>'),('Smooth Jazz Music',NULL,NULL,NULL),('Snarky Puppy',NULL,NULL,NULL),('Só',NULL,NULL,NULL),('Sobrezero',8185,1308,' <a href=\"https://www.last.fm/music/Sobrezero\">Read more on Last.fm</a>'),('Soca Man',30063,10566,' <a href=\"https://www.last.fm/music/Soca+Man\">Read more on Last.fm</a>'),('Soft Jazz Background Music',NULL,NULL,NULL),('Soft Machine',NULL,NULL,NULL),('SOG',138634,19937,'There are at least five bands with the name \"SOG\" or \"Sog\":\r\n\r\n1.- German emo/hardcore from the 90\'s.\r\n2.- Spanish Folk group.\r\n3.- Alias of Woflgang Voigt (minimal techno). 2 releases (this alias) on Kompakt.\r\n4. - Hungarian rapper from Bloose Broavaz.\r\n5. - New Zealand Alternative Rock group. <a href=\"https://www.last.fm/music/Sog\">Read more on Last.fm</a>'),('sombr',62737797,1558307,'Shane Michael Boose (New York City, July 5, 2005.) better known as his stage name sombr, is a singer-songwriter, producer, and multi-instrumentalist. \r\n\r\nShane told 1883magazine that he adopted his stage name after releasing his debut single in 2021, \"Nothing Left to Say\" which reflects the initials of his name as an acronym.\r\n\r\nReleased on June 15, 2022, sombr\'s first single to blow up was \"caroline\", boasting an upwards of 30 million streams today. Due to his platform on TikTok, he has grown a large attraction of Gen Z fans.  <a href=\"https://www.last.fm/music/sombr\">Read more on Last.fm</a>'),('Son De Ak',12126,1288,' <a href=\"https://www.last.fm/music/Son+de+AK\">Read more on Last.fm</a>'),('Sonny Fodera',NULL,NULL,NULL),('Sonodab',5472,1505,' <a href=\"https://www.last.fm/music/Sonodab\">Read more on Last.fm</a>'),('Sonus Brass Ensemble',55,13,' <a href=\"https://www.last.fm/music/Sonus+Brass+Ensemble\">Read more on Last.fm</a>'),('Soopasoul',226312,36253,'The funk phoenix rises from the flames of rave. \n\nSoopasoul is that rarest of things in this electronic age of dance music. A band where everything is played in live, where loops and plug-ins are passed over in favour of a drum kit in the living room, guitars and bass that are lying around and a funky horn section so steeped in tradition that you can feel the real deal being played out in front of your ears. \n\nDanny Hybrid the man behind Soopasoul grew up in Manchester and has been a music pioneer since the age of 14. <a href=\"https://www.last.fm/music/Soopasoul\">Read more on Last.fm</a>'),('Sopa De Cabra',631297,31783,'Sopa de Cabra was a successful Catalan rock band of the 90s and early 2000s. Formed in 1986 in Girona, they are considered, together with Sau (pop), Els Pets (pop-rock) and Sangtrait (metal), the founders of the \"Rock Català\" movement. Sopa\'s lead singer/lyrics Gerard Quintana and lead guitar/lyrics Josep Thió have paralleled solo successful careers.\r\n\r\nIn 1991, in the height of their popularity, they recorded a double LP, part of it live: \"Ben Endins\" (Deep Inside), which became a platinum disc in 2000. <a href=\"https://www.last.fm/music/Sopa+De+Cabra\">Read more on Last.fm</a>'),('Soul Cola',2492,608,' <a href=\"https://www.last.fm/music/Soul+Cola\">Read more on Last.fm</a>'),('Soul II Soul',3074125,447301,'Soul II Soul is a two-time Grammy winning act that emerged at the end of the 1980s from London. The group initially attracted attention as a sound system, playing records at house and street parties (where their clothing style - dubbed \"Funki Dred\" - quickly made a splash, inspiring them to start a line of clothing). Founded by Jazzie B and featuring a changing roster of other musicians - notably Nellee Hooper, Simon Law, Phillip \'Daddae\' Harvey and <a href=\"https://www.last.fm/music/Soul+II+Soul\">Read more on Last.fm</a>'),('Soul Jawa',1001,506,' <a href=\"https://www.last.fm/music/Soul+Jawa\">Read more on Last.fm</a>'),('SoulChef',NULL,NULL,NULL),('SoulNectar',1003,418,' <a href=\"https://www.last.fm/music/SoulNectar\">Read more on Last.fm</a>'),('Soultask',134,53,' <a href=\"https://www.last.fm/music/Soultask\">Read more on Last.fm</a>'),('Spanish Flow',28737,4861,' <a href=\"https://www.last.fm/music/SPANISH+FLOW\">Read more on Last.fm</a>'),('Spanish Guitar',175472,21790,'This is mistagged; please tag your tracks using the artists\' names. <a href=\"https://www.last.fm/music/Spanish+Guitar\">Read more on Last.fm</a>'),('Spanish Harlem Orchestra',275796,54094,'Spanish Harlem Orchestra, the two-time Grammy winning Salsa and Latin Jazz band, sets the standard for excellence for authentic, New York style, hard core salsa. Live or recorded, it doesn\'t get any better.\r\n\r\nWhether a concert hall or an outdoor jazz festival, there is no easing you in, they are coming at you full force from start to finish. Their energy on stage, rich sound and musical precision leave audiences mesmerized until the last note is played. <a href=\"https://www.last.fm/music/Spanish+Harlem+Orchestra\">Read more on Last.fm</a>'),('Spanish With Liz',6082,328,' <a href=\"https://www.last.fm/music/Spanish+With+Liz\">Read more on Last.fm</a>'),('Sponsors',51589,4861,'There is more than one artist with this name:\r\n\r\n1) Sponsors  is an Argentine Rock band formed in 2008 by Joaquin Levinton after the dissolution of his previous band : Turf\r\n\r\nIn full time after completing successful presentation at Quilmes Rock 2007, Turf , or rather its leader Joaquin Levinton , he said \" enough.\"\r\n\r\nLevinton quarreled with his colleagues, and locked himself in his house to take. He wrote more than 300 songs and in June 2008 it came to light the first album . <a href=\"https://www.last.fm/music/Sponsors\">Read more on Last.fm</a>'),('Spyro Gyra',NULL,NULL,NULL),('Stacey Kent',NULL,NULL,NULL),('Stacy Kidd',54413,13498,'Stacy Kidd was born in Chicago in 1972 and started DJing in 1987 after being amazed by the music he was hearing on the radio. He started out recording Chicago house mixes off the radio, and would try to mix them together with 2 tape decks. He would even try to mix them together on one radio with 2 tape players on it. After doing that for a year, Stacy began to have a good ear for the music and started to buy records…. but didn’t even own a turntable yet. <a href=\"https://www.last.fm/music/Stacy+Kidd\">Read more on Last.fm</a>'),('Stanislav Jenis',79,36,' <a href=\"https://www.last.fm/music/Stanislav+Jenis\">Read more on Last.fm</a>'),('Stanley Clarke',NULL,NULL,NULL),('Stef Davidse',65030,11577,' <a href=\"https://www.last.fm/music/Stef+Davidse\">Read more on Last.fm</a>'),('Stepz',1605275,149625,'Stepz is a rapper, dancer, comedian and actor from Croydon in South London. \r\nHe is mostly known for his POV comedy skits on TikTok but has shown an ability to switch flows on beats as well. <a href=\"https://www.last.fm/music/Stepz\">Read more on Last.fm</a>'),('Steve Barakatt',NULL,NULL,NULL),('Stex',7236,1711,'There are multiple artist under the name \"Stex\":\n\nEarly dance 90s act produced by Darren Allison and Steven Spacek.\nThey recorded the album \"Spiritual Dance\" and some singles like \"Still Feel The Rain\" or Boys Are Vain\".\nUkrainian pop artist from early 2000s (real name - Ярослав Стаховский). Known for getting featured in a TV-show \"SHIT-парад\" on MTV, with a video to the song \"Bla-Bla-Bla\". <a href=\"https://www.last.fm/music/Stex\">Read more on Last.fm</a>'),('Stina Förster',4361,931,' <a href=\"https://www.last.fm/music/Stina+F%C3%B6rster\">Read more on Last.fm</a>'),('Sting',NULL,NULL,NULL),('Stormykid',39796,2769,' <a href=\"https://www.last.fm/music/Stormykid\">Read more on Last.fm</a>'),('Sufjan Stevens',288105376,3767506,'Sufjan Stevens (Born July 1, 1975) is an American musician, songwriter, and multi-instrumentalist from Petoskey, Michigan. He is known for his lyrically focused and instrumentally rich songs that often relate to faith and family. He has enjoyed wide critical success in the United States. He is considered part of the folk revival through indie pop, but his influences are very broad, including experimental electronic music, the jazz of Vince Guaraldi, and the academic minimalism of Steve Reich and Philip Glass.  <a href=\"https://www.last.fm/music/Sufjan+Stevens\">Read more on Last.fm</a>'),('Sungazer',NULL,NULL,NULL),('Super Express',11424,2194,' <a href=\"https://www.last.fm/music/Super+Express\">Read more on Last.fm</a>'),('Supersubmarina',3004060,70914,'Supersubmarina is a Spanish indie pop-rock band from Baeza (Jaen). <a href=\"https://www.last.fm/music/Supersubmarina\">Read more on Last.fm</a>'),('Surf Curse',43366501,1912180,'A gritty and melodic Nevada-bred guitar-and-drum duo who later became a fixture of Los Angeles\' D.I.Y. garage and punk scenes, Surf Curse aligned themselves with the artist-run Danger Collective label where they released albums like 2017\'s Nothing Yet and 2019\'s Heaven Surrounds You. The sudden viral success of \"Freaks,\" a song they\'d released years earlier, earned them a deal with Atlantic, which issued the band\'s fourth album, Magic Hour, in 2022. <a href=\"https://www.last.fm/music/Surf+Curse\">Read more on Last.fm</a>'),('svlient',291623,36457,' <a href=\"https://www.last.fm/music/svlient\">Read more on Last.fm</a>'),('Swoosh',54357,17639,'DJ Swoosh (FIN)\n\nSwoosh a.k.a. Tero Viento attended the first Finnish warehouse parties of the early 90s and has been obsessed with techno culture ever since. Many of the early genres of electronic dance music such as acid, rave, hardcore and drum’n’bass have influenced his current selection of tunes. Especially the harder, harsher side of dance music appealed to him, and albums from numerous different genres piled up in his collection over the years. <a href=\"https://www.last.fm/music/Swoosh\">Read more on Last.fm</a>'),('SXID',2281143,183976,' <a href=\"https://www.last.fm/music/SXID\">Read more on Last.fm</a>'),('Syl Johnson',1909251,297172,'Syl Johnson (born Sylvester Thompson in Holly Springs, Mississippi, on 1 July 1936; died 6 February 2022 ) was an American blues and soul singer and music producer. His most successful records included \"Different Strokes\" (1967), \"Is It Because I\'m Black\" (1969) and \"Take Me to the River\" (1975). \"Different Strokes\" has been sampled by number of rappers including Wu-Tang Clan, Hammer, and the Ghetto Boys. Blues guitarist and singer Jimmy Johnson, and bassist Mack Thompson, are his brothers. <a href=\"https://www.last.fm/music/Syl+Johnson\">Read more on Last.fm</a>'),('Sylvia Bennett',NULL,NULL,NULL),('Synartesis',96,63,' <a href=\"https://www.last.fm/music/Synartesis\">Read more on Last.fm</a>'),('T-SQUARE',NULL,NULL,NULL),('Tabloid',NULL,NULL,NULL),('TAKAO UEMATSU',NULL,NULL,NULL),('Talkbox Radio',902,187,' <a href=\"https://www.last.fm/music/Talkbox+Radio\">Read more on Last.fm</a>'),('Talon Bourne',NULL,NULL,NULL),('Tame Impala',376288409,4052153,'Tame Impala is the psychedelic music project of Australian multi-instrumentalist Kevin Parker, blending rock, pop, and electronic sounds with lush production and introspective lyrics. Their discography includes Innerspeaker (2010), Lonerism (2012), Currents (2015), The Slow Rush (2020), and Deadbeat (2025). As a touring act, Tame Impala consists of Parker (guitar, vocals), Dominic Simper (guitar, synthesiser), Jay Watson (synthesiser, vocals, guitar), Cam Avery (bass guitar, vocals), and Julien Barbagallo (drums, vocals). <a href=\"https://www.last.fm/music/Tame+Impala\">Read more on Last.fm</a>'),('Tan Bionica',5746897,98371,'Tan Biónica is a pop rock band from Argentina. The group was formed in 2002 in Buenos Aires by vocalist Santiago \"Chano\" Moreno Charpentier, his younger brother Gonzalo \"Bambi\" Moreno Charpentier, Sebastián Seoane (guitar), and Diego Lichtenstein (drums). Tan Biónica worked on the soundtracks for the telenovelas Graduados and Viudas e hijos del Rock and Roll.\r\n\r\nTan Biónica enjoyed significant radio airplay and fame after the release of their second studio album, Obsesionario, in 2010. <a href=\"https://www.last.fm/music/Tan+Bionica\">Read more on Last.fm</a>'),('tarchi',1238109,14600,' <a href=\"https://www.last.fm/music/Tarchi\">Read more on Last.fm</a>'),('Technimatic',2235827,128376,'Technimatic  is the collaborative effort of drum and bass producers Peter Rogers, aka Technicolour and Andy Powell, aka Komatic from London, UK.\n\nHaving started making music together back in 2007 as Technicolour & Komatic, releasing their first record ‘Preacher’ on Technique’s sister imprint Worldwide Audio, little could be known of what the future had in store. Since then the duo have gone on to release their liquid-infused blend of hyper-coloured drum and bass on labels such as Critical <a href=\"https://www.last.fm/music/Technimatic\">Read more on Last.fm</a>'),('Tecupae',66849,8967,' <a href=\"https://www.last.fm/music/Tecupae\">Read more on Last.fm</a>'),('Tercer Cielo',722513,50411,'http://www.musicacristiana.fm\r\n\r\nTercer Cielo means Third Heaven, and is a duo of pop contemporary Christian music actually composed by the marriage of Juan Carlos Rodriguez (Dominican) and Evelyn Herrera (Mexican), formed in 2000 and re-released in 2007.\r\n\r\nTercer Cielo begins when the young Juan Carlos Rodriguez and Marcos Yaroide both Dominicans and longtime friends, began singing as something made by passion only in occasional and local Christian events in their city of origin. <a href=\"https://www.last.fm/music/Tercer+Cielo\">Read more on Last.fm</a>'),('terrarium.',NULL,NULL,NULL),('Terrence Brian',1231,487,' <a href=\"https://www.last.fm/music/Terrence+Brian\">Read more on Last.fm</a>'),('The Academy: Segunda Misión',829057,60911,' <a href=\"https://www.last.fm/music/The+Academy:+Segunda+Misi%C3%B3n\">Read more on Last.fm</a>'),('The American Dawn',3695797,429146,' <a href=\"https://www.last.fm/music/The+American+Dawn\">Read more on Last.fm</a>'),('The Aristocrats',NULL,NULL,NULL),('The Bamboos',3011328,294601,'The Bamboos are an Australian deep funk and soul band hailing from Melbourne. Formed in 2000 by guitarist/producer Lance Ferguson, the band has gone through several lineup changes over the years, but Ferguson has remained a constant presence. They initially drew inspiration from the raw funk of the late 1960s and early 1970s, but their sound has evolved over time to incorporate elements of hip-hop, psychedelic pop, and even symphonic arrangements. <a href=\"https://www.last.fm/music/The+Bamboos\">Read more on Last.fm</a>'),('The Band CAMINO',16469830,374491,'The Band CAMINO is an alternative, indie rock group originating in Memphis, Tennessee and consisting of Jeffery Jordan (vocals, guitar), Spencer Stewart (vocals, guitar), and Garrison Burgess (drums). The band is named after a Chevrolet El Camino that Rowell spotted at the time. The band\'s previous members include Andrew Isbell (drums), who departed from the band in June 2017 and Graham Rowell (bass), who was removed from the band in April 2020 after accusations of sexual misconduct between him and fans surfaced online.  <a href=\"https://www.last.fm/music/The+Band+CAMINO\">Read more on Last.fm</a>'),('The Black Jets',292445,68065,' <a href=\"https://www.last.fm/music/The+Black+Jets\">Read more on Last.fm</a>'),('THE BOX',3918961,176493,'There are, at least, three artists named The Box.\n\n1) A Montreal, Canada new wave band, formed 1981 by Jean-Marc Pisapia (an early member of Men Without Hats). The band was re-started, in 2003, with new lineup.\nOriginally, Jean-Marc recruited guitarist Guy Florent and bassist Jean-Pierre Brie for the band, who were originally known as Checkpoint Charlie before settling on the name The Box.  After a 15-year hiatus the band released their fifth album, the progressive-rock flavored \"Black Dog There\" on Komfy-Universal. <a href=\"https://www.last.fm/music/The+Box\">Read more on Last.fm</a>'),('The Brisks',3155,896,' <a href=\"https://www.last.fm/music/The+Brisks\">Read more on Last.fm</a>'),('The Brothers Johnson',2957297,413380,'A top group of the funk & disco era, this guitar & bass playing duo featured two brothers, and in 1977 their single Strawberry Letter 23 ( written by Shuggie Otis) was a top hit on the Pop and R&B charts. In 1980 their single Stomp! was another huge hit, reaching #1, and appearing on the album \"Light Up The Night\" which itself rose to number 5 on the Billboard album charts, being mentioned as number 46 on the year end  \"Top 100 LPs of 1980\" list in Rolling Stone Magazine. <a href=\"https://www.last.fm/music/+noredirect/The+Brothers+Johnson\">Read more on Last.fm</a>'),('The Colours That Rise',228698,58013,' <a href=\"https://www.last.fm/music/The+Colours+That+Rise\">Read more on Last.fm</a>'),('The Dip',2893657,237946,'The Dip is an electrifying nine-piece soul band from Seattle, Washington. Featuring three members of Beat Connection, the band toes the line between crooning soul and hard-driving funk. Featuring crunchy lines from the Honeynut Horns, The Dip is a throwback groove that is sure to get you movin\'.   <a href=\"https://www.last.fm/music/The+Dip\">Read more on Last.fm</a>'),('The Drums',49868729,2073480,'1)  The Drums are an American alternative rock band from Brooklyn, NY. Jonny Pierce and Jacob Graham met at summer camp when they were children and have been best friends ever since. Soon after their initial meeting, they formed Goat Explosion and toured extensively in North America during their teenage years. Around 2003, Pierce and Adam Kessler formed Elkland. In the meantime, Graham formed a band called Horse Shoes (Shelflife Records). Pierce ultimately <a href=\"https://www.last.fm/music/The+Drums\">Read more on Last.fm</a>'),('The Fearless Flyers',NULL,NULL,NULL),('The Funk Factor',248,69,' <a href=\"https://www.last.fm/music/The+Funk+Factor\">Read more on Last.fm</a>'),('The Funkees',566182,91485,'The Funkees were a rock band from the east of Nigeria. All members were veterans of the Biafran War. \nThey recorded a number of singles in the 1970s for HMV and EMI Nigeria, before moving to London to record their debut album The Point Of No Return. <a href=\"https://www.last.fm/music/The+Funkees\">Read more on Last.fm</a>'),('The Funky Town',5346,1521,' <a href=\"https://www.last.fm/music/The+Funky+town\">Read more on Last.fm</a>'),('The Gap Band',4431106,591035,'The Gap Band was a funk and soul group, the three-piece being known for hits such as \"Outstanding\" and \"You Dropped a Bomb on Me\".Their first major hit was a snazzy rnb tune called \"Shake\". Just prior to the completion of their first major album, bringing them under the wing of Mercury, musician Charlie Wilson ran the song by his brothers Robert and Ronnie, thinking that they might ridicule the lyrics. His brothers loved it though, and the 1979 song ended up being a popular single in numerous clubs <a href=\"https://www.last.fm/music/The+Gap+Band\">Read more on Last.fm</a>'),('The Harmony Group',166534,37014,' <a href=\"https://www.last.fm/music/The+Harmony+Group\">Read more on Last.fm</a>'),('The High Kings',2366378,155866,'The High Kings is an Irish ballad group formed by the same creators as Celtic Woman. Finbarr Clancy, Brian Dunphy, Martin Furey, and Darren Holden make up the group.  <a href=\"https://www.last.fm/music/The+High+Kings\">Read more on Last.fm</a>'),('The Irrepressibles',5745956,408618,'The Irrepressibles is an art-pop collective founded and led by composer and musician Jamie McDermott from the United Kingdom. Created in 2003, the band have released two full studio albums to date and 5 EPs, with a further 6th slated for release in 2014.\r\n\r\nOn the January 11, 2010, The Irrepressibles released their debut studio album, Mirror Mirror, a collection of 12 baroque pop songs produced by Dimitri Tikovoi and William Turner Duffin, and written by Jamie McDermott. <a href=\"https://www.last.fm/music/The+Irrepressibles\">Read more on Last.fm</a>'),('The Jive Turkeys',36293,8026,' <a href=\"https://www.last.fm/music/The+Jive+Turkeys\">Read more on Last.fm</a>'),('The Killers',369839959,6769218,'There are multiple artists using this name:\r\n\r\n1. The Killers is an American rock band from Las Vegas, Nevada, formed in 2001. \r\nThey got the name from the fictional band The Killers in the video for New Order\'s song Crystal. \r\nAs of 2021, the band has released six studio albums, which have sold 28 million records worldwide. \r\n\r\nThe Early Years\r\nInitially, The Killers played at large clubs in Las Vegas. With the band\'s line-up stable and their repertoire of songs expanding <a href=\"https://www.last.fm/music/The+Killers\">Read more on Last.fm</a>'),('The Last Dinner Party',27068621,739421,'The Last Dinner Party are a British alternative rock band from London, United Kingdom, formed in 2021 by Abigail Morris (vocals), Lizzie Mayland (vocals, guitar), Emily Roberts (lead guitar, mandolin, flute), Georgia Davies (bass) and Aurora Nishevci (keys, vocals). \r\n\r\nMorris, Davies and Mayland met in 2020 in London before starting university and decided to form a band after attending gigs together in London. Their original name The Dinner Party was <a href=\"https://www.last.fm/music/The+Last+Dinner+Party\">Read more on Last.fm</a>'),('The Mamas & The Papas',39994111,2594196,'The Mamas & the Papas (credited as The Mama\'s and the Papa\'s on the debut album cover) was a leading vocal group of the 60s from New York. The group recorded and performed from 1965 to 1968, releasing five albums and charting ten hit singles that hold up as well today as they did back in the sunshine era. While spending relatively a short time in the realm of popular music, some group members have pointed to their short time in the spotlight as a reason why they still have loyal fans today. <a href=\"https://www.last.fm/music/The+Mamas+&+the+Papas\">Read more on Last.fm</a>'),('The Marías',200815376,2285873,'Formed in Los Angeles in late 2016, The Marías is a smooth rendezvous of jazz percussion, hypnotic guitar riffs, smoke- velvet vocals and nostalgic horn solos, there’s something undeniably sensual in the group’s dreamlike fusion of jazz, psychedelia, funk and lounge.\r\n\r\nThe band is named after its lead singer María Zardoya, who was born in Puerto Rico and raised in Atlanta, Georgia. She and her partner Josh Conway, the drummer, met at a show at the Kibitz Room, the bar and music venue inside Canter\'s Deli in Los Angeles. <a href=\"https://www.last.fm/music/The+Mar%C3%ADas\">Read more on Last.fm</a>'),('The Naked And Famous',33847418,1256433,'The Naked and Famous is a two piece indie band hailing from Auckland, New Zealand, now based out of Los Angeles, California. The band comprises Thomas Powers, Alisa Xayalith, Aaron Short, David Beadle and Jesse Wood, with Powers and Xayalith being the two current active members. According to the Young Blood Songfacts, they took the name from a line in UK trip hop singer-songwriter Tricky\'s track, Tricky Kid.\r\n\r\nAfter their initial formation in 2008 <a href=\"https://www.last.fm/music/The+Naked+and+Famous\">Read more on Last.fm</a>'),('The New Raemon',1865674,53220,'The New Raemon is an indie pop band from Barcelona, Spain. The band has been active since 2008 and is fronted by the Catalan musician Ramon Rodriguez who sings and plays guitar. He is accompanied by Ricky Falkner, who plays bass, drums as well as being the backing vocals. Pablo Garrido plays electric guitar and Marc Prats plays keyboard. <a href=\"https://www.last.fm/music/The+New+Raemon\">Read more on Last.fm</a>'),('The Offline',642740,85137,'The Offline is an instrumental cinematic soul project based in Hamburg, Germany. Inspired by moody soundtracks of 1960s and 1970s film composers (Francois de Roubaix, Brian Bennet, David Axelrod et al.), The Offline releases atmospheric, soulfully visual tunes with dramatic library-music-esque cinematic arrangements. \n\nThe Offline came to life, when composer and photographer Felix Müller travelled the Atlantic coastline in the south of France with his analogue camera, capturing beach life on film. <a href=\"https://www.last.fm/music/The+Offline\">Read more on Last.fm</a>'),('The Rebels',57633,10606,'1) The Rebels were a surf rock band from Buffalo, NY.  They were also known as The Rockin\' Rebels.  The Rebels formed in 1958.  They recorded their most known well known song Wild Weekend in 1962.  The original band consisted of Jim and Mick Kipler, Tom Gorman and Paul Balon.\r\n\r\n2) The Rebels were a 60\'s garage rock band from Iran.\r\nBefore Prince formed The Time, he considered using his backing band as a side-project called The Rebels. The 1979 project was a group effort, with songs being written and sung by the various members. <a href=\"https://www.last.fm/music/The+RebelS\">Read more on Last.fm</a>'),('The Rollin\' Deep',110892,17104,' <a href=\"https://www.last.fm/music/The+Rollin%27+Deep\">Read more on Last.fm</a>'),('The Script',72697014,2887839,'The Script is a pop rock band which formed in 2001 in Dublin, Ireland. The band currently consists of Danny O\'Donoghue (vocals), Glen Power (drums), Benjamin Seargent (bass) and Ben Weaver (guitar). Mark Sheehan was also a member of the band up until his death in 2023. Sheehan was the co-founder of the band along with O\'Donoghue. \r\n\r\nAfter reaching number fifteen in the charts with their 2008 debut single \"We Cry,\" their second single \"The Man Who Can\'t Be Moved\" peaked at number two. <a href=\"https://www.last.fm/music/The+Script\">Read more on Last.fm</a>'),('The Sequence',138613,23294,'\"The Sequence\" can refer to either a 1980\'s hip hop/funk group or a modern pop-rock band from southern California.\n\n(1) The Sequence was an all-female old school hip hop/funk trio signed to the Sugar Hill label in the early 1980s. The group consisted of Cheryl (Cheryl The Pearl) Cook, Gwendolyn (Blondie) Chisolm, and lead singer/rapper Angie Stone, who subsequently became a member of Vertical Hold and later a solo artist.\n\n(2) The Sequence consists of Travis Van Hoff (vocals), Jason Yata (Guitar), Brandon Dennis (Drums), and Kevin (Bass). <a href=\"https://www.last.fm/music/The+Sequence\">Read more on Last.fm</a>'),('The Sorcerers',NULL,NULL,NULL),('The Stanley Clarke Band',NULL,NULL,NULL),('The Super Smart Trio',NULL,NULL,NULL),('The Tallest Man On Earth',41914209,1120989,'Kristian Matsson (born 30 April 1983) is a singer-songwriter from Dalarna, Sweden, who performs under the stage name of The Tallest Man on Earth. Matsson grew up in Leksand, and began his solo career in 2006, having previously been the lead singer of the indie band Montezumas. His music has often drawn comparisons to the music of Bob Dylan.\r\n\r\nSince 2006, Matsson has released four full-length albums and two EPs. He records and produces these in his home, and usually records his voice and guitar together on one track. <a href=\"https://www.last.fm/music/The+Tallest+Man+on+Earth\">Read more on Last.fm</a>'),('The War On Drugs',37257810,904111,'\r\nThe War on Drugs is an American indie rock band from Philadelphia, Pennsylvania.\r\n\r\nBand member Adam Granduciel (born Adam Granofsky in Dover, Massachusetts) moved from Oakland, California to Philadelphia in  2003, where he met Kurt Vile and began playing music with him. They began playing as The War on Drugs in 2005, and self-released a demo EP. While Vile and Granduciel formed the backbone of the band, they had a number of accompanists early in the group\'s career <a href=\"https://www.last.fm/music/The+War+on+Drugs\">Read more on Last.fm</a>'),('Thorleifs',172542,13886,'Thorleifs was a Swedish dansband formed in 1962 in Norrhult, Kronoberg County, Sweden and led by Thorleif Torstensson. \r\nThe band that sings in Swedish and many other languages, also released albums in German.\r\n It also took part in Melodifestivalen 2009 with the song \"Sweet Kissin\' in the Moonlight\" but did not proceed into the finals.\r\nThe band broke up fall 2012 and released their farewell album \" Tack & Farväl\" (Thanks & farewell) \r\n\r\nMembers\r\n\r\n Guitar, lead vocals and saxophone Thorleif Torstensson (1962-2012) <a href=\"https://www.last.fm/music/Thorleifs\">Read more on Last.fm</a>'),('Tiago PZK',11301963,268950,'Tiago Uriel Pacheco, más conocido como Tiago PZK o simplemente Tiago, es un freestyler y artista de trap argentino. <a href=\"https://www.last.fm/music/Tiago+PZK\">Read more on Last.fm</a>'),('Ticy',14448,2061,' <a href=\"https://www.last.fm/music/ticy\">Read more on Last.fm</a>'),('Tigran Hamasyan',NULL,NULL,NULL),('Till Brönner',NULL,NULL,NULL),('Tim Bowman',NULL,NULL,NULL),('Timber Timbre',8759070,439099,'Timber Timbre is a Canadian folk music project formed in 2005 and featuring Mika Posen, Simon Trottier and Taylor Kirk.\r\n\r\nTheir debut album \"Cedar Shakes\", recorded in a farm house near Bobcaygeon, Ontario, was released in 2006. Hence the moniker Timber Timbre as an ode to the surroundings and the warm haunting sound of the album.\r\n\r\n2007 saw the release of Medicinals, an album recorded by Kirk in his empty Toronto apartment. \"Cedar Shakes came from driving around in fields <a href=\"https://www.last.fm/music/Timber+Timbre\">Read more on Last.fm</a>'),('TINI',18743330,379218,'There are at least two artists named Tini:\r\n\r\n1) Martina  Stoessel, known professionally as TINI (stylized in all caps) is an Argentine singer, songwriter and actress. She began her career by appearing on the Argentine children\'s television series Patito Feo (2007–2008). She rose to prominence for her lead role as Violetta Castillo in the Disney Channel Latin America original telenovela, Violetta (2012–2015), and afterwards portrayed the same character in the series\' sequel film Tini: The Movie (2016). <a href=\"https://www.last.fm/music/Tini\">Read more on Last.fm</a>'),('Tito \"El Bambino\"',2910042,249669,'Efraín David Fines Nevares (born October 5, 1981), known professionally as Tito \"El Bambino\", is a Puerto Rican recording artist. He rose to fame as Tito of the duo Héctor & Tito.\r\nIn 2010 his song, \"El Amor\", written with Joan Ortiz Espada, was awarded Latin Song of the Year by the American Society of Composers, Authors and Publishers (ASCAP). He was awarded Songwriter of the Year at the 2011 ASCAP.\r\n\r\nMusical Career\r\n\r\nAs Héctor & Tito\r\n\r\nTito and his partner released a number of hit songs in their native Puerto Rico <a href=\"https://www.last.fm/music/Tito+%22El+Bambino%22\">Read more on Last.fm</a>'),('Tito Double P',11704805,185061,'Jesús Roberto Laija García, known professionally as Tito Double P, is a Mexican rapper, singer and songwriter. He is best known as the cousin of fellow musician Peso Pluma and has written several songs within his discography. He released his debut studio album Incómodo (2024) on 22 August 2024, which debuted at number 20 on the US Billboard 200. <a href=\"https://www.last.fm/music/Tito+Double+P\">Read more on Last.fm</a>'),('Tobtok',1018879,165187,'30-year-old Tobtok aka Tobias Karlsson leads the new wave of Swedish electronic music DJ / producers. With over 400 million streams globally and consistent support across BBC Radio 1, KISS FM, Capital and more, including spins from Mistajam, Pete Tong, Scott Mills, Charlie Hedges, and Joel Corry, Tobtok continues to prove he is a rare talent. His single “New Levels“ was certified BBC Radio Tune of The Week and seems certain to become his biggest hit yet. <a href=\"https://www.last.fm/music/Tobtok\">Read more on Last.fm</a>'),('Tom Browne',828300,173816,'Tom Browne (born October 30, 1954, Queens, New York), commonly referred to as \"Mr. Jamaica Funk\", is a jazz trumpeter who rose to prominence first through his early work with Sonny Fortune and for his #1 charting 1980 single \"Funkin\' For Jamaica (N.Y)\" and notable dance tracks like \"Thighs High\". \n\nBrowne originally played piano, having taken lessons from the age of 11. Turning to the trumpet, inspired by his collection of jazz albums, his first gig was in a Queens club, The Village Door. <a href=\"https://www.last.fm/music/Tom+Browne\">Read more on Last.fm</a>'),('Tommy Twinkle',539237,13379,' <a href=\"https://www.last.fm/music/Tommy+Twinkle\">Read more on Last.fm</a>'),('Toni Traus Composer',0,0,NULL),('Tontxu',152368,15459,'Singer/songwriter Tontxu (born J. Antonio Ipiña) got involved in music after composing his first song at the age of 11, later becoming a radio station programmer and announcer. After moving to Madrid, Tontxu started touring the local club circuit, having the opportunity to make his first record in 1997. Se Vende was produced by Javier Monforte and Gonzalo Benavides. Corazón de Mudanza followed in 1998. Inspired by Cuban nueva trova and prominent Spanish songwriters <a href=\"https://www.last.fm/music/Tontxu\">Read more on Last.fm</a>'),('Tony Bass',5637,1646,' <a href=\"https://www.last.fm/music/Tony+Bass\">Read more on Last.fm</a>'),('Tony Madrid',578,217,' <a href=\"https://www.last.fm/music/Tony+Madrid\">Read more on Last.fm</a>'),('Toolate Groove',19969,4490,' <a href=\"https://www.last.fm/music/Toolate+Groove\">Read more on Last.fm</a>'),('TOTO',53178580,2969341,'Toto is an American rock band formed in Los Angeles, California, in 1977. The group blends elements of pop, rock, soul, funk, hard rock, R&B, blues, and jazz. They have released 14 studio albums and sold over 50 million records worldwide, receiving several Grammy Awards and an induction into the Musicians Hall of Fame and Museum in 2009.\r\n\r\nKeyboardist and vocalist David Paich and drummer Jeff Porcaro, both experienced session musicians, founded the band and were joined by bassist David Hungate <a href=\"https://www.last.fm/music/Toto\">Read more on Last.fm</a>'),('Toyota Playa',9331,1559,' <a href=\"https://www.last.fm/music/TOYOTA+PLAYA\">Read more on Last.fm</a>'),('Train',56224545,3294394,'Train is an American pop rock band from San Francisco that was formed in 1993. Since 2024, the band consists of Pat Monahan (lead vocals), Taylor Locke (guitar, vocals), Hector Maldonado (bass, vocals), Jerry Becker (keyboards, guitar), and Matt Musty (drums).\r\n\r\nWith a lineup that included original members Monahan, Rob Hotchkiss, Jimmy Stafford, Scott Underwood, and Charlie Colin, the band achieved mainstream success with their debut album Train. The album was released in 1998 with the hit \"Meet Virginia\". <a href=\"https://www.last.fm/music/Train\">Read more on Last.fm</a>'),('Travis Birds',204355,14735,'“Una mezcla entre un niño, un señor muy serio, una tarada y un escarabajo común”, así es como se autodefine. Su primer álbum “Año X”, recopila diez canciones basadas en diez historias que ven el mundo con un punto de vista muy particular.  <a href=\"https://www.last.fm/music/Travis+Birds\">Read more on Last.fm</a>'),('Trebol Clan',0,0,NULL),('Trestrece',10427,1168,' <a href=\"https://www.last.fm/music/Trestrece\">Read more on Last.fm</a>'),('Tristan',1175221,117373,'There are multiple artists under the name Tristan :\n\n1]. Tristan - a pop/folk group from Jakarta, Indonesia\n2]. Tristan - Tristan Cooke is a DJ from The United Kingdom\n3]. Tristan - a new band from The Netherlands\n\n1]. Here’s a new, interesting group with interesting music concept. The name Tristan came from Latin tristis which means ‘sad’, a reference to the tragic fate of Tristram in a medieval story “Tristram and Isolde”. But being totally sad is not what two multitalented men behind the group <a href=\"https://www.last.fm/music/Tristan\">Read more on Last.fm</a>'),('Trombone Shorty',1798803,138319,'Troy \"Trombone Shorty\" Andrews (born January 2, 1986) is a trombone  and trumpet  player from New Orleans, Louisiana, United States. \n\nTroy Andrews is the younger brother of trumpeter and bandleader James Andrews . Growing up in New Orleans\' Treme neighborhood, \"Trombone Shorty\" was participating in brass band parades as a child, carrying his trombone even before his arms were long enough to reach all the positions of the slide. Andrews was a bandleader by the age of 6. <a href=\"https://www.last.fm/music/Trombone+Shorty\">Read more on Last.fm</a>'),('Trueno',17973612,338493,'Mateo Palacios Corazzina, better known as Trueno, is an Argentine rapper and freestyler, originally from the La Boca neighborhood in Buenos Aires. He is known for his outstanding participation in rap battles, winning contests such as FMS Argentina and Red Bull Batalla De Los Gallos in 2019.\r\n\r\nHis debut album, Atrevido was released on July 23, 2020 through NEUEN and distributed by Sony Music Latin. The album features the collaborations of artists such as Alemán, Wos, Nicki Nicole and Bizarrap. <a href=\"https://www.last.fm/music/Trueno\">Read more on Last.fm</a>'),('Tu Otra Bonita',163975,15517,' <a href=\"https://www.last.fm/music/Tu+otra+bonita\">Read more on Last.fm</a>'),('TUNE UNIVERSE',1039,500,' <a href=\"https://www.last.fm/music/TUNE+UNIVERSE\">Read more on Last.fm</a>'),('Turek',1630,499,' <a href=\"https://www.last.fm/music/Turek\">Read more on Last.fm</a>'),('Twenty One Pilots',393734096,3164314,'Twenty One Pilots (stylized in all lowercase or as twenty øne piløts) is an American musical duo from Columbus, Ohio. Initially a trio, the group was formed in 2009 by lead vocalist Tyler Joseph, Nick Thomas and Chris Salih, with Nick and Chris leaving in 2011. Since their departure, the line-up has consisted of Joseph and drummer Josh Dun. The duo is best known for their singles \"Stressed Out\", \"Ride\", and \"Heathens\". The group received a Grammy Award for Best Pop Duo/Group Performance at the 59th Annual Grammy Awards for \"Stressed Out\". <a href=\"https://www.last.fm/music/Twenty+One+Pilots\">Read more on Last.fm</a>'),('Two Door Cinema Club',125795937,3056541,'Two Door Cinema Club is a Bangor and Donaghadee, Northern Ireland, UK, electropop / alternative band, formed 2007, consisting of Alex Trimble (vocals, guitar), Kevin Baird (bass, vocals), Sam Halliday (guitar, vocals) and, live only, Benjamin Thompson (drums) and Jacob Berry (keyboard, vocals).  The band has released four albums: \"Tourist History\" (2010), \"Beacon\" (2012), \"Gameshow\" (2016), and \"False Alarm\" (2019).\r\n\r\nThe band\'s name resulted from Halliday\'s mispronunciation of the local cinema\'s name, Tudor Cinema. <a href=\"https://www.last.fm/music/Two+Door+Cinema+Club\">Read more on Last.fm</a>'),('Ty Pursglove',NULL,NULL,NULL),('Tyler Broughton',NULL,NULL,NULL),('Uffie',11419883,620404,'Anna-Catherine Hartley (born December 9, 1987), known professionally as Uffie, is an American-French singer, songwriter, rapper, DJ, and fashion designer formerly signed to French electronic music record label Ed Banger Records. Uffie\'s music incorporates synthpop, acid house, alternative dance, and \"somewhere between electro, rap and nu skool\". Her music is said to have \"had a lasting and widespread influence in the 2010s\" . \n\nShe was born in Miami, raised in Hong Kong and now lives in Paris. <a href=\"https://www.last.fm/music/Uffie\">Read more on Last.fm</a>'),('Ulises Bueno',370138,21160,' <a href=\"https://www.last.fm/music/Ulises+Bueno\">Read more on Last.fm</a>'),('Ultraligera',170454,5594,'Ultraligera is a Spanish alternative rock and indie rock band that was formed in 2021. Their music draws on a variety of influences, including grunge, alternative pop, indie rock, and post-punk revival. This mix has helped them develop a unique sound that has made them stand out in the Spanish music scene.\r\n\r\nThe band\'s current members are Gisme (vocalist and lyricist), Coque Fernández (guitarist), Santi Urruela (bassist), and Martín Aparicio (drummer). <a href=\"https://www.last.fm/music/Ultraligera\">Read more on Last.fm</a>'),('USHER',98033329,4864593,'Usher Raymond IV (born October 14, 1978) is an American singer, songwriter, dancer, and actor, known for his influence on contemporary R&B and pop music. He released his self-titled debut album, \"Usher,\" in 1994 at the age of 15, and rose to prominence with his second album, \"My Way\" (1997), which produced his first US Billboard Hot 100 number-one single, \"Nice & Slow,\" as well as the top-two singles \"My Way\" and \"You Make Me Wanna...\".\r\n\r\nHis third album <a href=\"https://www.last.fm/music/Usher\">Read more on Last.fm</a>'),('Vakero',107025,16668,'http://www.myspace.com/vakerospm23\r\n\r\nManuel Varet Martes Mejor conocido como VAKERO, Sus inicios en el ámbito musical datan del año 1995, cuando incursiona en el grupo One Play con quien forma un dúo con Wilkin La Tormenta con quien trabajo musicalmente hasta el año 1997 y pasa a formar parte del grupo bien conocido en el genero urbano como PERFECTO CLAN ( LA RAP SONORA) grupo que en sus inicios lo forma EL PITUFO (ex integrante del GRUPO UNIDO) <a href=\"https://www.last.fm/music/Vakero\">Read more on Last.fm</a>'),('Valentino Merlo',246700,27914,' <a href=\"https://www.last.fm/music/Valentino+Merlo\">Read more on Last.fm</a>'),('vangoura',98318,10426,' <a href=\"https://www.last.fm/music/vangoura\">Read more on Last.fm</a>'),('Varry Brava',594923,28254,'Varry Brava is a Spanish indie pop band created in Murcia in 2009. It is formed by Óscar Ferrer (vocals), Aarön Sáez (keyboards) and Vicente Illescas (guitar).\r\n\r\nThe group\'s name comes from joining Barry White\'s name with the song \"Brava\", by Italian singer Mina Mazzini.\r\n\r\nIn 2009 their self-produced demo Ídolo was released. Composed of ten songs, in which they show a clear influence of the Spanish pop of the 1980s, such as Nacha Pop and Radio Futura, spiced with disco music and reminiscences of new romantic. <a href=\"https://www.last.fm/music/Varry+Brava\">Read more on Last.fm</a>'),('Veintiuno',537880,20381,'Veintiuno is a Spanish indie rock band from Toledo, Spain, formed in 2011. Their sound is a mix of alternative rock, indie pop, and soul, and they\'ve become known for their energetic live shows and introspective lyrics.\r\n\r\nThe band\'s current members are Diego Arroyo (vocals, guitar, and keyboards), Yago Banet (bass), Pepe Narváez (drums), and Rafa Pachón (guitar).\r\n\r\nVeintiuno self-released their first album, Nada parecido, in 2015, which was funded through a crowdfunding campaign. <a href=\"https://www.last.fm/music/Veintiuno\">Read more on Last.fm</a>'),('Velvet Swing Express',NULL,NULL,NULL),('Veronica Mortensen',NULL,NULL,NULL),('Vetusta Morla',9681952,162788,'Vetusta Morla is a Spanish indie rock band originally from Tres Cantos, Madrid, who sings in Spanish. After nine years of musical journey, in February 2008 they published their first feature, Un día en el mundo. Three years later, in 2011, they published their second album, Maps. On April 8 after several years of touring Spain and other countries, they published their third album,La Deriva. In 2017 they publish their fourth album Mismo Sitio, Distinto Lugar. <a href=\"https://www.last.fm/music/Vetusta+Morla\">Read more on Last.fm</a>'),('VICENT MUSIC',0,0,NULL),('Victor Drija',135167,4887,' <a href=\"https://www.last.fm/music/Victor+Drija\">Read more on Last.fm</a>'),('Victor Valverde',328338,27741,' <a href=\"https://www.last.fm/music/Victor+Valverde\">Read more on Last.fm</a>'),('Victoria',NULL,NULL,NULL),('Vince Guaraldi Trio',NULL,NULL,NULL),('Vincen García',NULL,NULL,NULL),('Vincent Ingala',NULL,NULL,NULL),('Viva Suecia',1631618,36003,'Viva Suecia is an indie rock band from Murcia, Spain, formed in 2014. The group consists of Rafa Val, Alberto Cantúa, Jess Fabric, and Fernando Campillo. They have established themselves as a prominent name in the Spanish indie music scene, known for their powerful sound and emotionally charged lyrics.\r\n\r\nTheir debut album, La fuerza mayor (2016), garnered critical and public attention. This was followed by Otros principios fundamentales (2017), which solidified their position in the music world and earned them a Premios Ondas award. <a href=\"https://www.last.fm/music/Viva+Suecia\">Read more on Last.fm</a>'),('W Sound',2116244,201555,' <a href=\"https://www.last.fm/music/W+Sound\">Read more on Last.fm</a>'),('Wallows',120420748,1989343,'Wallows is an American alternative rock band based in Los Angeles composed of Dylan Minnette (guitar and vocals), Braeden Lemasters (guitar and vocals), and Cole Preston (drums and vocals). The band began releasing songs independently in April 2017 starting with \"Pleaser\", which reached number two on the Spotify Global Viral 50 chart.\r\n\r\nIn April 2017, the band released their first single under the Wallows moniker, \"Pleaser\". The song would eventually <a href=\"https://www.last.fm/music/Wallows\">Read more on Last.fm</a>'),('Walls',2333854,84290,'There is more than one artist with this name:\r\n\r\n1) Walls is an electronic duo from United Kingdom, made up of members Sam Willis (of ALLEZ-ALLEZ) and Alessio Natalizia (of BANJO OR FREAKOUT).\r\n\r\nThey have released \"Walls\" (2010) and \"Coracle\" through Kompakt Records.\r\n\r\n2) WALLS is a hardcore band from Seattle/Portland: Pounding rhythms, dissonant riffs, and a terrifying vocalist all come together to create something really brutal and powerful, featuring three fourths of the final Cold Sweat line up <a href=\"https://www.last.fm/music/Walls\">Read more on Last.fm</a>'),('Walter Fargi',400,139,' <a href=\"https://www.last.fm/music/walter+fargi\">Read more on Last.fm</a>'),('Walter Fargi vs. Manuel Deep',39,18,' <a href=\"https://www.last.fm/music/+noredirect/Walter+Fargi+vs.+Manuel+Deep\">Read more on Last.fm</a>'),('Walter Olmos',121508,15023,' <a href=\"https://www.last.fm/music/Walter+Olmos\">Read more on Last.fm</a>'),('Wampi',108356,8387,' <a href=\"https://www.last.fm/music/Wampi\">Read more on Last.fm</a>'),('Whirr',31460580,680647,'Whirr is an American shoegaze band from San Francisco, California, United States. They formed in 2010, originally as Whirl. The name was created by the original drummer, Sergio Miranda, in the midst of recording the band\'s first demos as a nameless project. It was a homage to all the bands of \"the Scene That Celebrates Itself” (Lush, Ride, Moose, Medicine, Lilys, etc.). They had to legally change the name after a woman performing acoustic covers of Black Sabbath songs trademarked \"Whirl\" and threatened a lawsuit. <a href=\"https://www.last.fm/music/Whirr\">Read more on Last.fm</a>'),('Whitefield Brothers',406247,57578,'The Poets of Rhythm have been known by many pseudonyms. Bo Baral\'s Excursionists of Perception, Bus People Express, Dynamic Soundmakers, Karl Hector & the Funk Pilots, The Mercy Sluts, The Mighty Continentals, The New Process, Organized Raw Funk, The Pan-Atlantics, The Soul-Saints Orchestra, The Soul Sliders, Syrup, Das Geldene Zeitalter and The Woo Woo\'s to name - well most of them actually. But the constant at the centre of all these monikers is  Jan (\'JJ\')and Max (\'Muggy\') Weissenfeldt, or The Whitefield Brothers.\n\nThis bio needs adding to! <a href=\"https://www.last.fm/music/Whitefield+Brothers\">Read more on Last.fm</a>'),('Wig Wam',2403387,148230,'Wig Wam is a Norwegian rock band, which is dedicated to the Glam rock, Glam metal and imitates the style of typical American rock bands from the 1980s.\r\n\r\nWig Wam come from Norway, more specifically the county of Østfold, and they were founded in 2001. Before their establishment the band members were already active in the music business, playing in bands like Dream Police, Artch, Sha-Boom, Ole Evenrud, Heads\'N Tails and Alien, or as solo artists. Wig Wam worked hard to get to the top of the national charts <a href=\"https://www.last.fm/music/Wig+Wam\">Read more on Last.fm</a>'),('Wild Cherry',4077774,741815,'Rob Parissi (lead vocals & guitar) was raised in the tough, diverse steel mill town of Mingo Junction, Ohio. Parissi graduated from Mingo High School in 1968. Rob formed his first band in 1970 in Steubenville, Ohio, one mile north of Mingo Jct. along the Ohio River. The band\'s name \"Wild Cherry\" was selected off a box of cough drops while Rob was recuperating from a brief hospital stay. The band played the Ohio Valley region, the West Virginia panhandle, and Pittsburgh, Pennsylvania. The original lineup is not known. <a href=\"https://www.last.fm/music/Wild+Cherry\">Read more on Last.fm</a>'),('William Janz',3546,491,' <a href=\"https://www.last.fm/music/William+Janz\">Read more on Last.fm</a>'),('Willie Bobo & His Orchestra',1705,282,' <a href=\"https://www.last.fm/music/Willie+Bobo+&+His+Orchestra\">Read more on Last.fm</a>'),('WILLOW',NULL,NULL,NULL),('Willow Stephens',41287,4428,' <a href=\"https://www.last.fm/music/Willow+Stephens\">Read more on Last.fm</a>'),('Willy Dj',406,139,' <a href=\"https://www.last.fm/music/Willy+Dj\">Read more on Last.fm</a>'),('Wilo & Nolo',1,1,' <a href=\"https://www.last.fm/music/Wilo+&+Nolo\">Read more on Last.fm</a>'),('Wisin',4923280,429166,'Juan Luis Morera Luna, born 19 December 1978 (age 34), is from Cayey, Puerto Rico. Wisin is better known as a rapper and occasional singer of the Reggaetón genre, from Wisin & Yandel duo. <a href=\"https://www.last.fm/music/Wisin\">Read more on Last.fm</a>'),('Wisin & Yandel',18486414,823679,'Wisin & Yandel is a Puerto Rican reggaeton duo, consisting of Llandel Veguilla Malavé Salazar (Yandel) and Juan Luis Morera Luna (Wisin). They started their career in 1995 and have been together ever since, winning several awards during that time.\r\n\r\nTheir biggest hits are \"Rakata\", \"Llamé Pa\' Verte (Bailando Sexy)\", \"Pam Pam\", \"Sexy Movimiento\", \"Pegao\",\"Síguelo\", \"Abusadora\", and \"Gracias a Tí\". Wisin & Yandel have collaborated with internationally known artists such as R. <a href=\"https://www.last.fm/music/Wisin+&+Yandel\">Read more on Last.fm</a>'),('Wolfgang Amadeus Mozart',65799008,2432568,'Wolfgang Amadeus Mozart (27 January 1756 – 5 December 1791) was a prolific and influential composer of the Classical period. For many, Mozart is the greatest of all composers. The playful, mercurial genius, who died at 35, left over 600 works (including 41 symphonies, 27 piano concertos, 22 operas, numerous Mass settings, chamber music, piano sonatas, and songs), which reveal one of the most prodigious talents ever known in music. Classical in style <a href=\"https://www.last.fm/music/Wolfgang+Amadeus+Mozart\">Read more on Last.fm</a>'),('Womack & Womack',1928043,309147,'Cecil D. Womack (25th September 1947 - 1st February 2013), is one of the famous musical Womack brothers. Although lesser known than his elder brother Bobby, he has had some success both as a songwriter and recording artist.\n\nBorn in Cleveland, Ohio.\n\nWomack and his brothers were a gospel group. They changed their name to the Valentinos and became protégés of Sam Cooke.\n\nCecil became the second husband of Motown star Mary Wells in 1967. Together they had three children: Cecil Jr, Stacy and Harry. <a href=\"https://www.last.fm/music/Womack+&+Womack\">Read more on Last.fm</a>'),('Work & Jazz',NULL,NULL,NULL),('Wow Popy',33488,3535,' <a href=\"https://www.last.fm/music/Wow+Popy\">Read more on Last.fm</a>'),('Wuicho kun',259548,19570,' <a href=\"https://www.last.fm/music/Wuicho+kun\">Read more on Last.fm</a>'),('xxanteria',5760878,382259,' <a href=\"https://www.last.fm/music/XXANTERIA\">Read more on Last.fm</a>'),('Yailin la Mas Viral',6934190,113515,'Georgina Lulú Guillermo Díaz (Santo Domingo Este, Provincia de Santo Domingo; 4 de julio de 2002) conocida por su nombre artístico, Yailín la Más Viral, es una rapera, bailarina, vedette, empresaria y modelo dominicana.[1]​Es la creadora de Cattaleya Babies, una línea especial para bebes inspirada en su hija, e Intivita La Flor, línea de cuidado íntimo para la mujer <a href=\"https://www.last.fm/music/Yailin+la+Mas+Viral\">Read more on Last.fm</a>'),('Yami Safdie',1845992,127441,' <a href=\"https://www.last.fm/music/Yami+Safdie\">Read more on Last.fm</a>'),('Yan Block',11997438,125369,' <a href=\"https://www.last.fm/music/Yan+Block\">Read more on Last.fm</a>'),('Yarea',141850,10959,'Yarea Guillén (Bilbao, 1997) siempre ha tenido claro que dedicaría su vida al arte, la interpretación y la música han sido las pasiones con que ha compaginado sus estudios de Magisterio de Música, hasta el momento ya ha participado en algunos proyectos tanto teatrales como musicales, pero este 2020 ha sido cuando ha empezado a publicar canciones bajo su propio nombre. Temas como “Cacería” o “Quédate” ya cuentan con decenas de miles de escuchas en plataformas digitales <a href=\"https://www.last.fm/music/Yarea\">Read more on Last.fm</a>'),('Yodelice',1678125,112908,'Yodelice (real name Maxim Nucci) was born on February 23, 1979 in Créteil, France. At 6, he joined the Conservatoire & learnt guitar. At 15, he joined London\'s Musician Institute, where he became the youngest guitar teacher. Playing bass, guitar & keyboards, Maxim has been noticed by Santi in 2001 & signed to Mercury. Collaborations followed... \r\nAfter his first album Maxim Nucci in 2006, Maxim went on tour. He has been Vanessa Paradis\' supporting <a href=\"https://www.last.fm/music/Yodelice\">Read more on Last.fm</a>'),('Young Cister',8121427,177072,'Esteban Alejandro Cisterna Álvarez, conocido artísticamente como Young Cister, es un rapero, cantante y compositor chileno, considerado uno de los representantes del trap y música urbana más relevantes de Chile. <a href=\"https://www.last.fm/music/Young+Cister\">Read more on Last.fm</a>'),('Young Miko',11848249,338591,'Young Miko, como se conoce artísticamente, nació en Añasco, Puerto Rico. Es una talentosa artista con sonido propio que, con tan solo 28 años, se ha catalogado como una de las artistas femeninas con más potencial dentro de la escena musical actual, en Latinoamérica. La artista irrumpió en la escena al lanzar “105 Freestyle”, su primer sencillo, en colaboración con el reconocido productor Caleb Calloway. Abriendo camino propio dentro de la escena urbana <a href=\"https://www.last.fm/music/Young+Miko\">Read more on Last.fm</a>'),('Yuletide Moonlight Serenade',NULL,NULL,NULL),('Zaja Y Mazhiel',24844,3111,' <a href=\"https://www.last.fm/music/Zaja+y+Mazhiel\">Read more on Last.fm</a>'),('Zar',89505,13017,'Zar, also known as The Shanbehzadeh Ensemble (Persian: گروه شنبه زاده) is an Iranian folk-jazz band, formed in Bushehr, Iran in 1990. The band offers a rare perspective on the traditional music and dance of the Persian Gulf, more specifically that of the southern Iranian coast. The principal instruments of the ensemble are the neyanbān (bagpipe), ney-jofti (flute), dammām (drum), zarbetempo (percussion), traditional flute, senj (cymbal) and boogh (a goat\'s horn). <a href=\"https://www.last.fm/music/Zar\">Read more on Last.fm</a>'),('Zaz',NULL,NULL,NULL),('Zenet',NULL,NULL,NULL),('Zion',3190396,314351,'There are at least five artists named Zion.\r\n\r\n1. ZION (ザイオン) is a Japanese alternative rock band from Tokachi, Hokkaido.\r\n\r\nVocals & Guitar - Mitsumura Tatsuya (光村龍哉; ex NICO touches the Walls)\r\nGuitar - Kushino Keisuke (櫛野啓介; ex jealkb as sapoto)\r\nGuitar - Yoshizawa Sachio (吉澤幸男; GAGAKIRIZE, 平方根レジェンド, Loloet)\r\nDrums - Naruhashi Taichi (鳴橋大地)\r\nBass - Sato Shinnosuke (佐藤慎之介)\r\n\r\nFormed in Tokyo in 2020. <a href=\"https://www.last.fm/music/Zion\">Read more on Last.fm</a>'),('Zmeyev',NULL,NULL,NULL),('Zoé',26591906,458685,'There are, at least, three artists known as Zoé: 1) A Mexican rock band. 2) An aka of Zoë Pollock (also, aka Zoë). 3) A French-speaking variétés françaises singer.\r\n\r\n1) A Mexican rock band, that\'s not not afraid of experimenting, with a modern sound, an eclectic style, some British influences & overall, their music\'s sophisticated without loss of rock energy. Their lyrics cover many subjects / feelings, with the same level of sophistication that their music shows, plus honesty. <a href=\"https://www.last.fm/music/+noredirect/Zo%C3%A9\">Read more on Last.fm</a>'),('Zulia',57040,9352,'Zulia is a Venezuelan artist, based in Monterrey MX.  In love with Rock and Blues, he began his career with a passion that he found in the rawness of Hip-Hop.  He is currently developing as a producer, participating in songs like \"Otro Atardecer\" by Bad Bunny in collaboration with The Marias for their album \"Un Verano Sin Ti\" <a href=\"https://www.last.fm/music/zulia\">Read more on Last.fm</a>'),('原信夫とシャープス&フラッツ',NULL,NULL,NULL),('片岡輝彦',NULL,NULL,NULL);
